	(1,'Addicted to love','    A				   G\r\nThe lights are on - but you´re not home		\r\n\r\nYour mind - is not your own\r\n          D                  \r\nYou heart sweats - your body shakes		\r\n        A\r\nAnother kiss - is what it takes\r\n				                           \r\nYou can´t sleep - you can´t eat		        \r\n           G              \r\nThere´s no doubt - you´re in deep\r\n                 D                      	        \r\nYou´re throat is tight - you can´t breathe	\r\n        A\r\nAnother kiss - is all you need\r\n\r\n   F#m                  	   D                     A\r\nOh you like to think that you´re immune to the stuff, oh yeah\r\n     F#m                            D\r\nIt´s closer to the truth to say you can´t get enough\r\n			                                  D\r\nYou know you´re gonna have to face it, you´re addicted to love\r\n\r\n\r\nYou see the signs - but you can`t read\r\nYou´re running at - a diff`rent speed\r\nYour heart beats - in double time\r\nAnother kiss - and you´ll be mine\r\nA one track mind - you can´t be saved\r\nOblivion - is all you crave\r\nIf there`s some - left for you\r\nYou don`t mind - if you do\r\nOh you like to think that you´re immune to the stuff, oh yeah\r\nIt´s closer to the truth to say you can´t get enough\r\nYou know you´re gonna have to face it, you´re addicted to love\r\n\r\nA			       G\r\nMight as well face it you`re addicted to love	\r\n\r\nMight as well face it you`re addicted to love\r\nD			       A\r\nMight as well face it you`re addicted to love	\r\n\r\nMight as well face it you`re addicted to love\r\n\r\n\r\nThe lights are on - but you´re not home	\r\nYour will - is not your own\r\nYour heart sweats - you´re teeth grind\r\nAnother kiss - and you´ll be mine\r\nOh you like to think that you´re immune to the stuff, oh yeah\r\nIt´s closer to the truth to say you can´t get enough\r\nYou know you´re gonna have to face it, you´re addicted to love\r\n\r\nMight as well face it you`re addicted to love\r\n \r\n',1,'2021-01-01 09:00:00',NULL),
	(2,'Against all odds','B7sus4         Bm7     C#m7       \r\nHow can I just let you walk away, \r\n             D               A7sus4\r\njust let you leave without a trace\r\n       G                 A/g               F#m      Bm7\r\nWhen I stand here taking ev´ry breath with you? Ooh, -\r\n           Em7                             A\r\nYou´re the only one, who really knew me at all\r\n\r\nB7sus4           Bm7  C#m7          \r\nHow can you just walk away from me, \r\n         D                     A7sus4\r\nwhen all I can do is watch you leave\r\n          G                   A/g     F#m   \r\n´Cause we shared the laughter and the pain, \r\n        Bm7\r\nwe even shared the tears\r\n           Em7                             A - Asus4\r\nYou´re the only one, who really knew me at all\r\n\r\n\r\n    A                 D/a   \r\n So take a look at me now   \r\n                       E7/a\r\n well, there´s just an empty space\r\n                     Bm7            G        \r\n And there´s nothing left here to remind me, \r\n          Em7 \r\n just the mem´ry of your face\r\n Asus4                   D/a  \r\n Well, take a look at me now, \r\n                        E7/a\r\n ´cause there´s just an empty space\r\n               Bm7            G               \r\n And you coming back to me is against all odds \r\n           Em7              Asus4 - A\r\n and that´s what I´ve got to face\r\n\r\n\r\n\r\nI wish I could make you turn around, \r\nturn around and see me cryin´\r\nThere´s so much I´ve got to say to you, \r\nso many reasons why\r\nYou´re the only one, who really knew me at all\r\n\r\nSo take a look at me now  well,\r\nthere´s just an empty space\r\nAnd there´s nothing left here to remind me,\r\njust the mem´ry of your face\r\nWell, take a look at me now, \r\n´cause there´s just an empty space\r\nBut to wait for you, is all I can do \r\nand that´s what I´ve got to face\r\nTake a good look at me now, \r\n´cause I´ll be standing here\r\nAnd you coming back to me is against the odds,\r\nit´s the chance I´ve got to take\r\n\r\n                       A7sus4/e - B7sus4/c - G - A\r\nTake a good look at me now ',2,'2021-01-01 21:30:00',NULL),
	(3,'American Pie','  G    D/F# Em7        Am            C       \r\nA long long time ago - I can still remember, \r\n         Em                    D\r\nhow that music used to make me smile\r\n    G D/F#      Em7           \r\nAnd I knew if I had my chance \r\n     Am               C\r\nthat I could make the people dance\r\n    Em              C           D\r\nAnd maybe they´d be happy for a while \r\n    Em       Am                  Em                Am\r\nbut February made me shiver with every paper I´d deliever\r\nC        G/B    Am          C                 D\r\nBad news on the doorstep, I couldn´t take one more step\r\n  G         D/F#      Em           Am7            D\r\nI can´t remember if I cried when I read about his widowed bride\r\nG         D/F#       Em              C       D7    G     C\r\nSomething touched me deep inside the day the music died\r\n\r\n   G   C        G        D\r\nSo bye bye miss American pie\r\n         G            C             G         D\r\nDrove my chevy to the levee but the levee was dry\r\n     G             C             G           D\r\nThem good old boys were drinkin´ whiskey and rye\r\n        Em                          A7   \r\nSingin´ this will be the day that I die..\r\nEm                          D7\r\nthis will be the day that I die\r\n\r\nG                 Am                  C                 Am\r\nDid you write the book of love and do you have faith in God above?\r\nEm           D    -                G     D/F#     Em\r\nIf the Bible tells you so - now do you believe in rock´n roll\r\n    Am7             C               \r\nCan music save your mortal soul and \r\nEm               A7           D\r\ncan you teach me how to dance real slow\r\n       Em                D             \r\nWell I know that your in love with him \r\n        Em              D\r\ncause I saw you dancing in the gym \r\n    C           G        A7      \r\nYou both kicked off your shoes - \r\n       G                    D7\r\nMan, I dig those rhythm and blues\r\n        G      D/F#    Em            \r\nI was a lonely teenage broncin´ buck \r\n       Am                   C\r\nwith a pink carnation and a pick up truck\r\n      G   D/F#   Em               C           D7       G     C\r\nBut I knew I was out of luck, the day  -  the mu - sic died\r\n\r\n\r\nNow for ten years we´ve been on our own \r\nand moss grows fat on a rolling stone\r\nBut that´s not how it used to be \r\nwhen the jester sang for the king and queen\r\nIn a coat he borrowed from James Dean\r\n and a voice that came from you and me\r\nOh and while the king was looking down \r\nthe jester stole his thorny crown\r\nThe courtroom was adjourned, no verdict was returned\r\nAnd while Lennin read a book on Marx \r\nthe quartet practised in the park\r\nAnd we sang dirges in the dark the day the music died\r\n\r\n\r\nHelter Skelter in the summer welter\r\n the birds flew off with a fallout shelter\r\nEight miles high and fallin´ fast,\r\n it landed foul on the grass\r\nThe players tried for a forward pass, \r\nwith the jester on the sidelines in a cast\r\nNow the halftime air was sweet perfume \r\nwhile the sergeants played a marching tune\r\nWe all got up to dance but we never got the chance \r\ncause the players tried to take the field\r\nThe marching band refuse to yield the day the music died\r\n\r\n\r\nAnd there we were all in one place,\r\n a generation lost in space\r\nWith no time left to start again, \r\nso come on, Jack be nimble, Jack be quick\r\nJack Flash sat on a candlestick,\r\n cause fire is the devils only friend\r\nAnd as I watched him on the stage \r\nmy hands were clenched in fists of rage\r\nNo angel born in hell could break that Satan´s spell\r\nAnd as the flames climbed high into the night\r\n to light the sacrificial rite\r\nI saw Satan laughing with delight the day the music died\r\n\r\nG      D/F#      Em                   Am                 C\r\nI met a girl who sang the blues and I asked her for some happy news\r\n   