	(87,'Shine a light','Saw you stretched out, in room ten-o-nine\r\nWith a smile on your face, and a tear right in your eye\r\nCouldn\'t seem to get a line on you, my sweet honey love\r\n\r\nBerber jewelry jangling down the street\r\nMakes ya wanna shut your eyes at every woman that you meet\r\nCould not seem to get a high on you, my sweet honey love\r\n\r\n\r\nMay the good Lord shine a light on you\r\nMake every song your favorite tune\r\nMay the good Lord shine a light on you\r\nWarm, like the evening sun\r\n\r\n\r\nWhen you\'re drunk in the alley baby with your clothes all torn\r\nAnd your late night friends leave you in the cold grey dawn\r\nJust seemed too many flies on you...I just can\'t brush them off\r\n\r\nAngels beating all their wings in time\r\nWith smiles on their faces, and a gleam right in their eyes\r\nWell I thought I heard a sigh from you\r\nCome on up, now come on up\r\n\r\nMay the good Lord shine a light on you....',4,'2021-02-14 15:30:00',NULL),
	(88,'Slow emotion replay','The more I see\r\nThe less I know\r\nAbout all the things I thought were wrong or right\r\n& carved in stone.\r\n\r\nSo, don\'t ask me about\r\nWar, Religion or God\r\nLove, Sex or Death\r\nBecause . . . .\r\n\r\nEverybody knows what\'s going wrong with the world\r\nBut I don\'t even know what\'s going on in myself.\r\n\r\nYou\'ve gotta work out your own salvation.\r\nWith no explanation to this Earth we fall\r\nOn hands & knees we crawl\r\nAnd we reach out & pray\r\nTo a deaf, dumb & blind God who never explains.\r\n\r\nEverybody knows what\'s going wrong with the world\r\nBut I don\'t even know what\'s going on in myself.\r\n\r\nLord, I\'ve been here for so long\r\nI can veel it coming down on me\r\nI\'m just a slow emotion replay of somebody I used to be.',51,'2021-02-15 04:00:00',NULL),
	(89,'Soupthampton Dock','they disembarked in 45 \r\nand no one spoke and no one smiled \r\nthere were too many spaces in the line \r\ngathered at the cenotaph \r\nall agreed with hand on heart \r\nto sheath the sacrificial knifes\r\n\r\nbut now\r\n\r\nshe stands upon southampton dock \r\nwith her handkerchief \r\nand her summer frock clings \r\nto her wet body in the rain \r\nin quiet desperation knuckles \r\nwhite upon the slippery reins \r\nshe bravely waves the boys goodbye again\r\n\r\nand still the dark stain spreads between \r\nhis shoulder blades \r\na mute reminder of the poppy fields and graves \r\nand when the fight was over \r\nwe spent what they had made \r\nbut in the bottom of our hearts \r\nwe felt the final cut\r\n\r\n',5,'2021-02-15 16:30:00',NULL),
