	(93,'Strawberry Fields forever','Let me take you down \'cause I\'m going to Strawberry Fields.\r\nNothing is real, and nothing to get hung about\r\nStrawberry Fields forever. \r\n\r\nLiving is easy with eyes closed.\r\nMisunderstanding all you see.\r\nIt\'s getting hard to be someone but it all works out\r\nIt doesn\'t matter much to me. \r\n\r\nLet me take you down \'cause I\'m going to Strawberry Fields.\r\nNothing is real, and nothing to get hung about\r\nStrawberry Fields forever. \r\n\r\nNo one I think is in my tree\r\nI mean it must be high or low.\r\nThat is you can\'t you know tune in\r\nBut it\'s all right. That is I think it\'s not too bad. \r\n\r\nLet me take you down \'cause I\'m going to Strawberry Fields.\r\nNothing is real, and nothing to get hung about\r\nStrawberry Fields forever. \r\n\r\nAlways, no, sometimes, think it\'s me.\r\nBut you know I know when it\'s a dream.\r\nI think, er, no, I mean, er, yes, but it\'s all wrong\r\nThat is I think I disagree. \r\n\r\nLet me take you down \'cause I\'m going to Strawberry Fields.\r\nNothing is real, and nothing to get hung about\r\nStrawberry Fields forever.\r\nStrawberry Fields forever.\r\nStrawberry Fields forever.',6,'2021-02-17 18:30:00',NULL),
	(94,'Streets of London','F                 C              Dm          Am\r\nHave you seen the old man in the closed down market\r\nBb             F               G7       C\r\nKicking up the papers with his worn out shoes\r\nF               C                Dm              Am\r\nIn his eyes you see no pride and held loosely at his side \r\n   Bb         F             C7         F\r\nIs yesterdays paper telling yesterdays news\r\n   Bb          F              C7  F\r\nSo how can you tell me you´re lonely\r\nG7                                     C     C7\r\nAnd you say for you that the sun don´t shine\r\nF               C\r\nLet me take you by the hand \r\n    Dm                   Am\r\nand lead you through the streets of London\r\nBb            F            C7                   F\r\nI´ll show you something to make you change your mind\r\n\r\nHave you seen the old girl who walks the streets of London\r\nDirt in her hair and her clothes in rags\r\nShe´s no time for talking just keeps right on walking\r\nCarrying her home in two carrier bags\r\n\r\nIn the all night café at a quarter past 11\r\nThe same old man is sitting there on his own\r\nLooking at the world over the rim of his teacup\r\nEach tea lasts an  hour and he wanders home alone\r\n\r\nHave you seen the old man outside the seamans mission\r\nMemory fading with the  medal ribbons that he wears\r\nIn our winter city the wind cries a little pity\r\nFor one forgotten hero and a world that doesn´t care',42,'2021-02-18 07:00:00',NULL),
	(95,'Superstitious','Very superstitious, writings on the wall,\r\nVery superstitious, ladders \'bout to fall\r\nThirteen month old baby, broke the looking glass\r\nSeven years of bad luck, the good things in your past.\r\n\r\nWhen you believe in things that you don\'t understand,\r\nThen you suffer,\r\nSuperstition ain\'t the way\r\n\r\nVery superstitious, wash your face and hands\r\nRid me of the problem, do all that you can\r\nKeep me in a daydream, keep me goin\' strong\r\nYou don\'t wanna save me, sad is my song\r\n\r\nWhen you believe in things that you don\'t understand\r\nThen you suffer\r\nSuperstition ain\'t the way, yeh, yeh\r\n\r\nVery superstitious, nothing more to say\r\nVery superstitious, the devil\'s on his way\r\nThirteen month old baby, broke the looking glass\r\nSeven years of bad luck, the good things in your past\r\n\r\nWhen you believe in things that you don\'t understand\r\nThen you suffer\r\nSuperstition ain\'t the way, no, no, no..',61,'2021-02-18 19:30:00',NULL),
