	(102,'The joker','F           Bb                C           Bb\r\nSome people call me the space cowboy\r\nF    Bb                     C      Bb\r\nSome call me the ganster of love\r\nF           Bb         C            Bb\r\nSome people call me Maurice\r\n        F         Bb          C      Bb\r\nCause I speak the pompatus of love\r\n\r\nPeople talk about me baby\r\nSay I´m doing you wrong doing you wrong\r\nBut don´t you worry don´t you worry baby\r\nCause I´m right here right here right here right here at home\r\n\r\n            F            Bb            F               Bb\r\nCause I´m a picker I´m a grinner I´m a lover and I´m a sinner\r\nF         Bb           C    C7\r\nI play my music in the sun\r\n      F           Bb           F        Bb\r\nI´m a joker I´m a smoker I´m a midnight joker\r\nF        Bb           C    C7\r\nI get my lovin on the run\r\n\r\nYou´re the cutest thing I ever did see\r\nI really love your peaches want to shake your tree\r\nLovey dovey lovey dovey lovey dovey all the time\r\nCome on baby I´ll show you a real good time',40,'2021-02-22 11:00:00',NULL),
	(103,'Man In the Long Black Coat','F#m   A   E   C#m\r\nF#m   A   E   F#m\r\n\r\nF#m          A            E        C#m\r\nCrickets are chirpin\' the water is high\r\n          F#m         A             E            F#m\r\nThere\'s a soft cotton dress? on the line hangin\' dry\r\nF#m          A    E       C#m \r\nWindows wide open African trees\r\nF#m       A                E         F#m\r\nBent over backwards from a hurricane breeze\r\nE\r\nNot a word, a goodbye, not even a note\r\n    F#m           A          E          F#m           \r\nShe gone with the man in the long black coat\r\n\r\n\r\nSomebody singing hangin\' around\r\nAt the old dance hall on the outskirts of  town\r\nHe looked into her eyes when she stopped him to ask\r\nIf he wanted to dance he had a face like a mask\r\nSomebody said, from the Bible he quote\r\nThere was dust on the man in the long black coat\r\n\r\nPreacher was talkin\' there\'s a sermon he gave\r\nHe said every man\'s conscience is vile and depraved\r\nYou cannot depend on him to be your guide\r\nAnd it\'s you who must keep it satisfied\r\nIt ain\'t easy to swallow, it sticks in the throat\r\nTo give her heart to the man in the long black coat\r\n\r\nD                             A\r\nThere are no mistakes in life some people say\r\n         F#m                    E           F#m\r\nAnd it\'s true sometimes you can see it that way\r\nD                         A\r\nPeople don\'t live or die, people just float\r\n    F#m                      E          F#m\r\nShe went with the man in the long black coat\r\n\r\n\r\nThere\'s smoke on the water its been there since June\r\nTree trunks uprooted neath the high passing moon\r\nFeel the pulse and vibrations and the rumblin\' force\r\nSomebody is out there beating on a dead horse\r\nShe never said nothin\', there was nothin\' she wrote\r\nShe went with the man in the long black coat',7,'2021-02-22 23:30:00',NULL),
