	(115,'You cant always get what you want','  G	                 C\r\nI saw her today at the reception\r\nG          	       C	\r\nA glass of wine in her hand\r\n  G		              C	\r\nI knew she was gonna meet her connection\r\nG		            C\r\nAt her feet was a footloose man\r\n            G                         C\r\n	You can´t always get what you want\r\n	    G		              C\r\n	You can´t always get what you want\r\n	    G		              C\r\n	You can´t always get what you want\r\n	           D                         C 	\r\n	But if you try sometimes - you might find\r\n		         G\r\n	You get what you need\r\n\r\nI went down to the Chelsea drugstore\r\nTo get your preciption filled\r\nI was standing in line with Mr. Jimmy\r\nA man, did he look pretty ill\r\n\r\n	You can´t always get  what you want..\r\n\r\nI saw her today at the reception\r\nIn her glass was a bleeding man\r\nShe was practised at the art of deception\r\nWell, I could tell at her bloodstained hands\r\n\r\n	You can´t always get what you want..\r\n\r\n \r\n',4,'2021-03-01 05:30:00',NULL),
	(116,'The man in me','The man in me will do nearly any task,\r\nAnd as for compensation, there\'s little he would ask.\r\nTake a woman like you\r\nTo get through to the man in me.\r\n\r\nStorm clouds are raging all around my door,\r\nI think to myself I might not take it any more.\r\nTake a woman like your kind\r\nTo find the man in me.\r\n\r\nBut, oh, what a wonderful feeling\r\nJust to know that you are near,\r\nSets my a heart a-reeling\r\nFrom my toes up to my ears.\r\n\r\nThe man in me will hide sometimes to keep from bein\' seen,\r\nBut that\'s just because he doesn\'t want to turn into some machine.\r\nTook a woman like you\r\nTo get through to the man in me.',7,'2021-03-01 18:00:00',NULL),
	(117,'Working class hero',' Am                           G             Am\r\nAs soon as you\'re born they make you feel small\r\n                         G          Am\r\nBy giving you no time instead of it all\r\n                                     G       Am\r\nTill the pain is so big you feel nothing at all\r\n    Am           (D)      G          Am\r\nA working class hero is something to be\r\n    Am           (D)      G          Am\r\nA working class hero is something to be\r\n\r\nThey hurt you at home and they hit you at school\r\nThey hate you if you\'re clever and they despise a fool\r\nTill you\'re so fucking crazy you can\'t follow their rules\r\nA working class hero is something to be\r\nA working class hero is something to be\r\n\r\nWhen they\'ve tortured and scared you for twenty odd years\r\nThen they expect you to pick a career\r\nWhen you can\'t really function you\'re so full of fear\r\nA working class hero is something to be\r\nA working class hero is something to be\r\n\r\nKeep you doped with religion and sex and T.V.\r\nAnd you think you\'re so clever and classless and free\r\nBut you\'re still fucking peasants as far as I can see\r\nA working class hero is something to be\r\nA working class hero is something to be\r\n\r\nThere\'s room at the top they are telling you still\r\nBut first you must learn how to smile as you kill\r\nIf you want to be like the folks on the hill\r\nA working class hero is something to be\r\nA working class hero is something to be\r\n\r\nIf you want to be a hero well just follow me\r\nIf you want to be a hero well just follow me\r\n',41,'2021-03-02 06:30:00',NULL),
	(118,'Youngstown','Dm\r\nHere in northeast Ohio, back in 1803\r\nCadd9                                                     Dm\r\nJames and Dan Heaton found the ore that was lining Yellow Creek.\r\nDm\r\nThey built a blast furnace here along the shore,\r\nCadd9                                                       Dm\r\nAnd they made the cannonballs that helped the Union win the war.\r\n\r\n        Cadd9\r\nHere in Youngstown\r\n        Dm\r\nHere in Youngstown\r\n         F                 C\r\nMy sweet Jenny I\'m sinkin\' down\r\n                Dm\r\nHere darlin\' in Youngstown\r\n\r\nWell my daddy worked the furnaces, kept \'em hotter than hell\r\nI come home from \'Nam, worked my way to scarfer,\r\nA job that\'d suit the devil as well.\r\nTaconite coke and limestone fed my children and made my pay\r\nThem smokestacks reachin\' like the arms of God\r\nInto a beautiful sky of soot and clay\r\n\r\nHere in Youngstown\r\nHere in Youngstown\r\nMy sweet Jenny I\'m sinkin\' down\r\nHere darlin\' in Youngstown\r\n\r\n         F                  C\r\nWell, my daddy come on the Ohio works\r\n                                 Dm\r\nWhen he come home from World War Two.\r\n        Cadd9\r\nNow the yard\'s just scrap and rubble\r\n                                       Dm\r\nHe said \"Them big boys did what Hitler couldn\'t do.\"\r\n      F                    C\r\nThese mills they built the tanks and bombs\r\n                        Dm\r\nThat won this country\'s wars.\r\n   Cadd9\r\nWe sent our sons to Korea and Vietnam.\r\n                                   Dm\r\nNow we\'re wondering what they were dying for.\r\n\r\n\r\nHere in Youngstown\r\nHere in Youngstown\r\nMy sweet Jenny I\'m sinkin\' down\r\nHere darlin\' in Youngstown\r\n\r\nFrom the Monongahela Valley to the Mesabi iron range\r\nTo the coal mines of Appalachia, the story\'s always the same.\r\nSeven hundred tons of metal a day,\r\nNow, sir, you tell me the world\'s changed.\r\nOnce I made you rich enough, rich enough to forget my name.\r\n\r\nAnd Youngstown\r\nAnd Youngstown\r\nMy sweet Jenny I\'m sinkin\' down\r\nHere darlin\' in Youngstown\r\n\r\n       F                           C\r\nWhen I die I don\'t want no part of heaven\r\n                             Dm\r\nI would not do heaven\'s work well\r\n           Cadd9\r\nI pray the devil comes and takes me to stand\r\n                  Dm\r\nIn the fiery furnaces of hell.',71,'2021-03-02 19:00:00',NULL),
	(119,'Dont think twice','G                  D              Em\r\nIt ain\'t no use to sit and wonder why, babe \r\nC                  G    D\r\nIt don\'t matter anyhow \r\nG                      D              Em\r\nAnd it ain\'t no use to sit and wonder why, babe \r\nA7                   D    D7\r\nIf you don\'t know by now. \r\nG                             G7\r\nWhen the rooster crows at the break of dawn \r\nC                        A7\r\nLook out your window and I\'ll be gone\r\nG          D          Em         C\r\nYou\'re the reason I\'m travellin\' on\r\nG           D            G        D\r\nDon\'t think twice, it\'s alright. \r\n\r\nIt ain\'t no use in turnin\' on you light, babe \r\nA light I never knowed \r\nIt ain\'t no use in turnin\' on your light, babe \r\nI\'m on the dark side of the road \r\nStill I wish there were something you would do or say \r\nTo try and make me change my mind and stay \r\nWe never did too much talkin\' anyway \r\nSo don\'t think twice, it\'s alright. \r\n\r\nI\'m walkin\' down that long lonesome road, babe \r\nWhere I\'m bound, I can\'t tell \r\nGoodbye is too good a word, gal \r\nSo I\'ll just say, fare thee well. \r\nI\'m not sayin\' you treated me unkind \r\nYou could have done better but I don\'t mind \r\nYou just kinda wasted my precious time \r\nBut don\'t think twice, it\'s alright. \r\n\r\nIt ain\'t no use in callin\' out my name, gal \r\nLike you never done before \r\nIt ain\'t no use in callin\' out my name, gal \r\nI can\'t hear you anymore \r\nI\'m a-thinkin\' and a-wonderin\' all the way down the road \r\nI once loved a woman, a child I am told \r\nI\'d give her my heart but she wanted my soul \r\nBut don\'t think twice, it\'s alright. ',7,'2021-03-03 07:30:00',NULL),
	(120,'Tangled up in blue','A  |  Asus4 sus2  |  A  |  Asus4 sus2\r\n\r\nA                        G\r\nEarly one morning the sun was shinin\'\r\n\r\nA                 G\r\nI was layin\' in bed.\r\n\r\nA                      G\r\nWondering if she\'d changed at all\r\n\r\n       D\r\nIf her hair was still red.\r\n\r\nA                                G\r\nHer folks they said that our lives together,\r\n\r\nA                     G\r\nSure was gonna be rough.\r\n\r\n     A                     G\r\nThey never did like Mama\'s home-made dress,\r\n\r\n        A\r\nPapa\'s bank book wasn\'t big enough.\r\n\r\n    E                     F#m\r\nAnd I was standing on the side of the road,\r\n\r\nA                     D\r\nRain falling on my shoes.\r\n\r\nE                           F#m\r\nHeading out for the old east coast,\r\n\r\n       A                   D\r\nLord knows I\'ve paid some dues,\r\n\r\n              E\r\nGetting through,\r\n\r\nG       D        A  |  Asus4 sus2  |  A  |  Asus4 sus2\r\nTangled up in blue.\r\n\r\n\r\nShe was married when we first met\r\nSoon to be divorced\r\nI helped her out of a jam I guess\r\nBut I used a little too much force\r\nWe drove that car as far as we could\r\nAbandoned it out west\r\nSplit up on a sad dark night\r\nBoth agreeing it was best\r\nShe turned around to look at me\r\nAs I was walking away\r\nI heard her say over her shoulder\r\nWe\'ll meet again some day\r\nOn the avenue\r\nTangled up in Blue\r\n\r\nI had a job in the great north woods\r\nWorking as a cook for a spell\r\nBut I never did like it all that  much\r\nAnd one day the axe just fell\r\nSo I drifted down to New Orleans\r\nWhere I was lucky to be employed\r\nWorkin\' for a while on a fishing boat\r\nRight outside of Delacroix\r\nBut all the while I was alone\r\nThe past was close behind\r\nI seen alot of women\r\nBut she never escaped my mind\r\nAnd I just grew\r\nTangled up in blue\r\n\r\nShe was working in topless place\r\nAnd I stopped in for a beer\r\nI just kept looking at the side of her face\r\nIn the spotlight so clear\r\nAnd later on when the crowd thinned out\r\nI was just about to do the same\r\nShe was standing there in back of my chair\r\nSaid to me Don\'t I know your name\r\nI muttered something undernaeth my breath\r\nShe studdied the lines on my face\r\nI must admit I felt a little uneasy\r\nWhen she bent down to tie the laces\r\nOf my shoe\r\nTangled up in blue\r\n\r\nShe lit a burner on the stove\r\nAnd offered me a pipe\r\nI thought you\'d never say hello she said\r\nYou look like the silent type\r\nThen open up a book of poems \r\nAnd handed it to me\r\nWritten by an Italian poet\r\n>From the thirteenth century\r\nAnd every one of them words rang true\r\nAnd glowed like burning coal\r\nPourin\' off of every page\r\nLike it was written in my soul\r\nFrom me to you\r\nTangled up in blue\r\n\r\nI lived with them on Montague Street\r\nIn a basement down the stairs\r\nThere was music in the cafes at night\r\nAnd revolution in the air\r\nThen he started dealing in slaves\r\nAnd something inside of died\r\nShe had to sell everything she owned\r\nAnd froze up inside.\r\nAnd when the bottom finally feel out\r\nI became withdrawn\r\nThe only thing I knew how to do\r\nWas to keep on keeping on\r\nLike a bird that flew\r\nTangled up in blue\r\n\r\nSo now I\'m going on back again\r\nI got to get to her some how\r\nAll the people we used to know\r\nThey\'re an illusion to me now\r\nSome are mathematicians\r\nSome are carpenters wives\r\nDon\'ty know how it all got started\r\nI don\'t know what they\'re doing with their lives\r\nBut me, I\'m still on the road\r\nHeadin\' for another joint\r\nWe always did feel the same\r\nWe just saw it from a different point of view\r\nTangled up in blue.',7,'2021-03-03 20:00:00',NULL),
	(121,'Mr. Tambourine Man','G        A               D               G\r\nHey, Mr. Tambourine Man, play a song for me,\r\n        D                G        Em        A\r\nI\'m not sleepy and there ain\'t no place I\'m going to.\r\nG        A               D               G\r\nHey, Mr. Tambourine Man, play a song for me,\r\n       D             G                 Em        D\r\nIn the jingle jangle morning I\'ll come following you.\r\n\r\nG                  A                   D             G \r\nThough I know that evenings empire has returned into sand,\r\nD                G\r\nVanished from my hand,\r\n        D               G         Em        A\r\nLeft me blindly here to stand but still not sleeping.\r\n   G          A             D             G\r\nMy weariness amazes me, I\'m branded on my feet,\r\n  D              G\r\nI have no one to meet,\r\n        D             G            Em       A\r\nAnd the ancient empty street\'s too dead for dreaming.\r\n\r\nTake me on a trip upon your magic swirling ship.\r\nMy senses have been stripped,\r\nMay hands can\'t feel to grip,\r\nMy toes too numb to step,\r\nWait only for my bootheels to be wandering.\r\nI\'m ready to go anywhere, I\'m ready for to fade,\r\nInto my own parade.\r\nCast your dancing spell my way, I promise to go under it.\r\n\r\nThough you might hear laughing, spinning, swinging madly across the sun,\r\nIt\'s not aimed at anyone,\r\nIt\'s just escaping on the run,\r\nAnd but for the sky there are no fences facing.\r\nAnd if you hear vague traces of skipping reels of rhyme,\r\nTo your tambourine in time.\r\nIt\'s just a ragged clown behind,\r\nI wouldn\'t pay it any mind,\r\nIt\'s just a shadow you\'re seeing that he\'s chasing.\r\n\r\nTake me disappearing through the smoke rings of my mind.\r\nDown the foggy ruins of time,\r\nfar past the frozen leaves,\r\nThe haunted frightened trees,\r\nOut to the windy bench,\r\nFar from the twisted reach of crazy sorrow.\r\nYes to dance beneath the diamond sky with on