	(134,'Det er i dag et vejr','A                        A \r\nDet er i dag et vejr, et solskinsvejr, \r\n   D                  A     E \r\noh søde vår, så er du atter nær. \r\n           A               Dm      A \r\nNu vil jeg glemme rent, at det var vinter. \r\n           A          D  E \r\nNu vil jeg gå og købe hyacinther, \r\n          D              A   E   A \r\nog bringe dem til en som jeg har kær.\r\n\r\nHun købte af de hvide og de blå,\r\nhun købte af de smukkeste hun så.\r\nDet er i dag et vejr! Og solen skinner!\r\nOg om mig svæver lutter lyse minder,\r\ndem ta\'r jeg med til den, jeg tænker på.\r\n\r\nHun kyssede dem alle, hver især,\r\nhun bragte dem til den, hun havde kær.\r\nMin ven, her kommer jeg med hyacinter!\r\nMin ven, nu glemmer vi, at det var vinter!\r\nDet er i dag et vejr, et solskinsvejr - !\r\n\r\n',79,'2021-03-11 03:00:00',NULL),
	(135,'1-2-3-4 fyre','Vi er 1-2-3-4 fyre uden en brik,\r\nI har øller og dram, vi har kun vor musik.\r\nLad os bytte engang,\r\nså I synger en sang.\r\nOg gi\' så musikken den næste omgang.\r\n\r\nDen første i rækken er gamle kong Gorm.\r\nDet\' en gæv, gammel gut, med en tørst så enorm.\r\nSom en drukkenbolt god,\r\nsom regent tværtimod,\r\ndet klared\' hans viv, Thyra Danebod.\r\n\r\n- Vi er 1-2-3-4..\r\n\r\nDen anden i rækken er Christian den fjerd\',\r\nsprut og søde skønjomfru\'r ku\' han ikke la\' vær\'.\r\nKolde snapse og pi\'r\r\ngjor\' hans liv til en svir,\r\nderfor bygged\' han Børsen med proptrækkerspir.\r\n\r\n- Vi er 1-2-3-4..\r\n\r\nDen tredie i rækken er såmænd Tordenskjold,\r\nhan gav altid en omgang, når han var på sold,\r\nog til svensken især,\r\ngav han tit op til fler\',\r\nfor så så de dobbelt, når han kom med sin hær.\r\n\r\n- Vi er 1-2-3-4..\r\n \r\nDen sidste i rækken, som skal stå for skud,\r\ndet\' en god, gammel kending, det er arveprins Knud.\r\nNår hans tørst blev for slem,\r\nTog han ølkassen frem.\r\nOg så holdt han HOF for sig selv i sit hjem.\r\n\r\nVi er 1-2-3-4 fyre uden en brik,\r\nI har øller og dram, vi har kun vor musik.\r\nLad os bytte engang,\r\nså I synger en sang.\r\nOg gi\' så musikken en sidste omgang!',81,'2021-03-11 15:30:00',NULL),
