	(156,'Fru Jensen fra Tolne','    D          G             D    A\r\nFru Jensen fra Tolne blev et nervebundt\r\n      D                         A\r\naf at se hvordan Kresten gik og flipped\' rundt\r\n        D      G              D      A\r\nmen hun syntes li\'som der var håb at se\r\n        D       A           D\r\ndengang knægten startede på AUC \r\n\r\n/:G       /D    /D  A  /D       :/\r\n\r\nHan fandt sig en pige af dem med lilla ble,\r\nrunde briller, Kalsø-sko og 2 CV,\r\nfik lidt hæklede lapper på sit cowboytøj,\r\nog lånte et par meninger fra venstre fløj \r\n\r\nSå gik de lidt og flippede rundt,\r\nrøg lidt pot og leved\' mikro-makro-sundt,\r\npå at læse brugt\' de ikke megen tid,\r\nfor de skulle jo også komm\' hinanden ved. \r\n\r\nSådan gik det nu i\'n 3-4 år\r\nog så gik det sådan som det ofte går:\r\nMed en studiegæld på en betragtelig sum\r\nstarted\' Kresten på Hjørring Seminarium! \r\n\r\nEfter fire år blev Kresten degn\r\nog sku\' til at skaffe sig til dag\'n og vej\'n\r\nog han søgte her og der og ned\' og opp\'\r\nmen hvorend han søgte var der ingen job. \r\n\r\nUden job og med en gæld så stor\r\nflytted\' Kresten så atter hjem til gamle mor.\r\nHan ka\' lig\' hold\' sig selv med tøj og kost\r\nfor han har en tjans i Tolne som reservepost. \r\n',81,'2021-03-22 01:30:00',NULL),
