	(169,'Susan Himmelblå','G                 Em           D   \r\nKære Susan med de himmelblå tillykke\r\nG                               Em                D\r\nmåske jeg bliver en smugle sentimental,når men tillykke\r\nAm         D               Am            D\r\nenglene de kyssede dig den dag du kom hertil\r\n    Am            D                   Am          D\r\ndet er jeg ganske sikker på,så kan du tro hva\' du vil\r\n\r\nG    F    G     F                   D\r\nÅh Susan, himmelblå ved du hvad jeg tænker på\r\nG        F                  G                         F\r\nhvis jeg ku\', så lovede jeg dig et langt og lykkeligt liv\r\n                 D\r\nmen jeg kan ikke spå\r\n\r\nHvis nogen siger det hele går ad helvedes til,så tro dem ikke\r\ndet har altid været sådan og det bli\'r det nok ved med,tror du ikke\r\nmen lov mig at du aldrig blir\' træt,af livet en skønne dag\r\nfor du er Susan himmelblå og det er dit fra nu af\r\n\r\nOMK\r\n\r\nJeg ved da godt du synes,at jeg er en gammel nar og hva\' så\r\njeg har prøvet mit nu skal du prøve dit,kom så\r\nhimmelen og stjernerne og fanden det store kvaj\r\nde står på hver sin side af dig,lige nu sig ja eller nej',79,'2021-03-28 21:00:00',NULL),
