	(174,'Play that funky music','Hey do it now      yeah hey\r\n\r\nVerse 1\r\nYeah, There was a funky singer\r\nPlayin\' in a rock & Roll Band\r\nAnd never had no problems yeah\r\nBurnin\' down one night stands\r\n\r\nAnd everything around me,  yeah\r\nGot to stop to feelin\' so low\r\nAnd I decided quickly, Yes I did\r\nTo disco down and check out the show\r\n\r\nYeah they was dancin\' and singin\'\r\nand movin\' to the groovin\'\r\nAnd just when it hit me \r\nsomebody turned around and shouted\r\n\r\nPlay that funky music white boy\r\nPlay that funky music right\r\nPlay that funky music white boy\r\nLay down that boogie and play that funky music till you die\r\nTill you die ,   oh till you die\r\n\r\nSpoken ( Gonna play that electified funky music ,, yeah )\r\n\r\nHey wait a minute\r\n\r\nNow first it wasn\'t easy\r\nChangin\' Rock & Roll and minds\r\nAnd things were getting shaky\r\nI thought I\'d have to leave it behind\r\nBut now its so much better    \r\n( spoken: its so much better )\r\nI\'m funking out in every way\r\nBut I\'ll never lose that feelin\' ( spoken: no I won\'t)\r\nOf how I learned my lesson that day\r\n\r\nWhen they were.....\r\n\r\nThey shouted play that funky music\r\nPlay that funky music\r\nPlay that funky music\r\nGotta keep on playin\' funky music',97,'2021-03-31 11:30:00',NULL),
	(175,'Angel of Harlem','          C             F\r\nIt was a cold and wet December day\r\n          C             F\r\nWhen we touched down at JFK\r\n   C             F\r\nSnow was melting on the ground\r\n   C         F                  C       F\r\nOn BLS I heard the sound (of an Angel)\r\n\r\n  C             F\r\nNew York like a Christmas tree\r\n          C                F            C       F\r\nI said tonight this city belongs to me (Angel)\r\n\r\nG    F    G                      F\r\nSoul love this love won\'t let me go\r\nG  F    G          C     F\r\nSo long...Angel of Harlem\r\n\r\nBirdland on 53, the street sounds like a symphony\r\nWe got John Coltrane and a love supreme\r\nMiles and she has to be an Angel\r\n\r\nLady Day got diamond eyes\r\nShe sees the truth behind the lies (Angel)\r\n\r\nSoul love this love won\'t let me go\r\nSo long...Angel of Harlem\r\n\r\nBridge:\r\nAm      G   F                  Am G             F\r\nooh ooh ooh ooh she sings with heart, heart and soul\r\n\r\nBlue light on the avenue\r\nGod knows they got to you\r\nAn empty glass, the lady sings\r\nEyes swollen like a bee sting\r\nBlinded you lost your way\r\nOn the side streets and the alleyways\r\nLike a star exploding in the night\r\nFilling up the city with broad daylight\r\nAn Angel in Devil\'s shoes\r\nSalvation in the blues\r\nYou never looked like an Angel\r\nSo long...Angel of Harlem\r\nAngel, Angel of Harlem (4 times and fade)\r\n',60,'2021-04-01 00:00:00',NULL),
	(176,'SOS','Dmin                  A7                           Dmin\r\nWhere are those happy times - they seem so hard to find.\r\n\r\nDmin               A7                           Dmin\r\nI try to reach for you but you have closed your mind.\r\n\r\nF                 C   \r\nWhatever happened to our love ?\r\n\r\nGmin          Dmin  \r\nI wish I understood.\r\n\r\nDmin             A7                     Dmin\r\nIt used to be so nice, it used to be so good.\r\n\r\n\r\nChorus:\r\n\r\nF              C        Gmin              Bb       F/Fsus4/F/Fsus4\r\nSo when you\'re near me, darling can\'t you hear me, SOS\r\n\r\nF            C        Gmin             Bb       F/Fsus4/F/Fsus4 \r\nThe love you gave me, nothing less can save me, SOS\r\n\r\n\r\nBb                        Db     Eb        F\r\nWhen you\'re gone, how can I even try to go on ?\r\n\r\nBb                         Db          Eb      F\r\nWhen you\'re gone, though I try how can I carry on ?\r\n\r\n\r\nVerse 2:\r\n\r\nYou seem so far away though you are standing near.\r\nYou make me feel alive but something died, I fear.\r\nI really tried to make it up - I wish I understood.\r\nWhat happened to our love, it used to be so good.',98,'2021-04-01 12:30:00',NULL),
	(177,'Stupid Man','F         C\r\nDying to please\r\nF         C\r\ndying to serve\r\nDm              Am\r\nI couldn\'t break out\r\nG                C\r\ndidn\'t have the nerve\r\nF     C\r\nloverman \r\nF              C\r\nat anyones command \r\n   Dm        Am\r\nI woke up lonely\r\nG                  C\r\nwith a glass in my hand\r\n         Bb               C            F C Dm\r\nAnd you found me when my circus was in town\r\n       Bb            C\r\nHallelujah for the singing clown\r\n\r\n\r\nOmkvæd:\r\n\r\n         Dm\r\nWalk with me \r\n         Bb\r\ntake my hand\r\n \r\nspend a night \r\n          C      F\r\nwith the stupid man\r\n       Dm          Bb\r\nI am yours if you can\r\n\r\nfall in love \r\n          C      F\r\nwith the stupid man\r\n\r\n\r\n2.vers:\r\n\r\nHelpless soul\r\nin a web of love\r\nI didn\'t get a thing\r\nI couldn\'t get enough\r\ndrunken tears \r\nfrom paranoid eyes\r\npromises came out lies\r\nAnd you found me \r\nwhen my ship was about to go down\r\nAnd you carried me back on solid ground\r\n\r\nOmkvæd\r\n\r\nBridge (samme akkorder som omkvæde)\r\n\r\nScrap book memories\r\nfrom a life that has been dead \r\ntells me there is no one to blame and therefore\r\nno one to forgive\r\n\r\nSolo\r\n\r\nOmkvæd\r\n\r\nOmkvæd\r\n\r\n',99,'2021-04-02 01:00:00',NULL);
