	(181,'I am a man of constant sorrow','       G               C\r\nI am a man of constant sorrow\r\n          D              G      /c-b D/a\r\nI\'ve seen trouble all my days\r\n      G               C\r\nI bid farewell to old Kentucky\r\n                D              G        C\r\nThe place where I was born and raised\r\n                 D               G       /b-c D/a\r\n(The place where he was born and raised)\r\n\r\n\r\nFor six long years I\'ve been in trouble\r\nNo pleasure here on earth I found\r\nFor in this world I\'m bound to ramble\r\nI have no friends to help me down\r\n(He has no friends to help him down)\r\n\r\nIt\'s fare thee well my only brother\r\nI merry expect to see you here\r\nFor I\'m bound to ride that mornin\' railroad\r\nPerhaps I\'ll die upon this train\r\n(Perhaps he\'ll die upon this train)\r\n\r\nYou can bury me in some deep valley\r\nFor many years... (sorry)\r\nAnd you may learn to love another\r\nWhile I am sleepin\' in my grave\r\n(While he is sleepin\' in his grave)\r\n\r\nMaybe your friends think I\'m just a stranger\r\nMy face you\'ll never see no more\r\nBut there is one promise that is given\r\nI\'ll meet you on God\'s golden shore\r\n(He\'ll meet you on God\'s golden shore)\r\n\r\n',103,'2021-04-04 03:00:00',NULL),
