	(192,'Nina kære Nina','C                         Dm           G7\r\nJeg er ingen krøsus i den store flotte stil\r\nDm         G7             C\r\nIngen kæmpevilla, hverken sejlbåd eller bil\r\nF                          C          A7\r\nMange vil vist mene at jeg bare er et nul\r\n    Dm       G7            Dm7  G7       C\r\nmen jeg ejer noget, der er mere værd end guld\r\nC             Dm         G7\r\nNina kære Nina, nu er du min\r\nDm   G7        C          C7\r\nNina kære Nina, og jeg er din\r\n   F \r\nDu fandt et træ i skoven\r\n    C\r\nsom langsomt sygned\' hen\r\n   Dm               G7\r\nDu kom som regn fra oven.\r\n   Dm     G7  C\r\nNu trives det igen. \r\n\r\nFørste gang vi mødtes var jeg sikker i min sag.\r\nDu var drømmepigen - det var dig jeg ville ha\'.\r\nMellem mange andre, som du li\'så nemt ku\' få\r\nvalgte du så mig, det vil jeg aldrig helt forstå\r\nNina, kære Nina.... \r\n\r\nJeg er intet særligt, det\' den barske virk\'lighed\r\nEt ka\' jeg dog gi\' dig, simpelthen min kærlighed.\r\nTa\' det som et løfte, og jeg si\'r det kun fordi\r\njeg ska\' værne om dig, indtil livet er forbi\r\nNina, kære Nina \r\n \r\n',83,'2021-04-09 20:30:00',NULL),
	(193,'Hjemmebrænderiet','    G                     C\r\nJeg bor her i Stenhøj i\'t skævt lille hus\r\n D                                G\r\nalene, rent bortset fra rotter og mus.\r\n                     C\r\nI gården et lokum og bagved et skur\r\n     D                            G\r\nog i det står mit brændevinsapparatur.\r\n    G                 C\r\nDet syder af fusel og bobler af gær\r\n    D                            G\r\ndin lever ta\'r skade og øjet får stær.\r\n                       C\r\nDet smager som rævepis og terpentin\r\n           D                                     G\r\n- men det\' billigt - og så bli\'r man fuld som et svin\r\n\r\nMin bedstemor brændte sin brændevin selv\r\ndet slog både hende og manden ihjeæ.\r\nDe drak aldrig selv, men for heden den dag\r\nbrænderiet røg i luften med et helvedes brag.\r\n\r\nDet syder af fusel.....\r\n\r\nMen far han brændte i syvogtres år\r\nmen så blev han snuppet af tolden igår\r\nSå mor har skaffet et nyt apparat\r\nog har sat produktionen i gang i en fart\r\n\r\nDet syder af fusel....\r\n\r\nDet hænder jeg selv ta\'r en ordentlig syp\r\nmens jeg lytter til dråbernes sagte dryp-dryp\r\nDet er som musik fra et fint instrument\r\n- for jeg ved det er sprit på omkring tres procent\r\n\r\nDet syder af fusel......\r\n\r\nHvis du har fået lyst til at smage det selv\r\nså kom kun til mig - helst når dag\'n går på hæld\r\nslå tre slag på ruden og stik mig en ti\'er\r\nså får du en sjat af min livseleksir\r\nDet syder af fusel....\r\n',81,'2021-04-10 09:00:00',NULL),
	(194,'Billetmrk.','C      F          C\r\nI en annonce i et dagblad i går,\r\nG              G7          C\r\nså jeg en dame søge sig en ven,\r\nC          F              C\r\nfuld diskretion, send mig blot et par ord,\r\n    G                               C\r\njeg håber du skriver, på lykken jeg tror.\r\nC     F       C\r\nEnsom dame 40 år,\r\nG                    G7               C\r\nlille og buttet, med mørkt og krøllet hår,\r\n    C    C7      F           C\r\nmin vægt tør jeg ikke skrive om,\r\n        Dm     G       Dm7       G7    C\r\nmen jeg savner dig, så skynd dig nu og kom.\r\n\r\nMit hjerte det banked\' og min mund blev så tør,\r\nbare jeg turde, for det har aldrig hændt mig før.\r\nJeg syn\'s, jeg kunne høre hende hviske til mig,\r\nskynd dig og skriv, for jeg længes efter dig.\r\n\r\nEnsom dame.....\r\n\r\nTyve år er gået, og vi har det stadig godt,\r\nbrunetten fra annoncen, ja, hun er blevet min maskot.\r\nMåske lidt mere buttet, men hun er glad og tilfreds,\r\nmen tit tænker jeg på denne triste tekst.\r\n\r\nEnsom dame......',110,'2021-04-10 21:30:00',NULL),
	(195,'Hanging by a moment','Desperate for changing, starving for truth  \r\nI\'m closer to where I started in chasing after you  \r\nCloser to where i started, in chasing after you... \r\n\r\nI\'m falling even more in love with you \r\nletting go of all i\'ve held onto \r\ni\'m standing here until you make me move, \r\ni\'m hanging by a moment here with you \r\n\r\nForgeting all I\'m lacking, completely incomplete  \r\nI\'ll take your invitation, you take all of me \r\n\r\n(chorus) \r\n\r\nI\'m falling even more in love with you \r\nLetting go of all i\'ve held onto \r\nI\'m standing here until you make me move, \r\nI\'m hanging by a moment here with you \r\nI\'m living for the only thing i know. \r\nI\'m running in a crash you where to go (?) \r\nAnd i don\'t know what right I\'ve been here too (?) \r\nJust hanging by a moment here with you \r\n\r\nThere\'s nothing else to loose, there\'s nothing else to find  \r\nThere\'s nothing in the world, that could change my mind  \r\nThere is nothing else.. \r\n\r\nDesperate for changing, starving for truth  \r\nI\'m closer to where I started in chasing after you  \r\nCloser to where i started, in chasing after you... ',111,'2021-04-11 10:00:00',NULL),
	(196,'Creep','                   G\r\nWhen you were here before\r\n                         B \r\nCouldn\'t look you in the eyes\r\n                 C\r\nYou look like an angel\r\n                   Cm\r\nYour skin makes me cry\r\n\r\n                 G\r\nYou float like a feather\r\n              B\r\nIn a beautiful weather\r\n             C\r\nI wish I was special\r\n                  Cm\r\nYou\'re so fucking special\r\n\r\nChorus:\r\n          G\r\nBut I\'m a creep\r\n      B\r\nI\'m a wierdo\r\n                         C\r\nWhat the hell am I doin\' here\r\n               Cm\r\nI don\'t belong here\r\n\r\n\r\nI don\'t care if it hurts\r\nI wanna have control\r\nI wanna perfect body\r\nI want a perfect soul\r\n\r\nI want you to notice\r\nWhen I\'m not around\r\n\r\nYou\'re so fuckin\' special\r\nI wish I was special....\r\n\r\n(then something like this...)\r\noooh... she\'s running away....she\'s running...run..run...run..ruuuuun\r\n\r\nWhatever makes you happy\r\nWhatever you want\r\nYou\'re so fucking special\r\nWish I was special...',90,'2021-04-11 22:30:00',NULL),
	(197,'Heroes','D              G\r\nI, - I will be king\r\n    D                G\r\nAnd you, you will be queen\r\n       C                        D\r\nThough nothing will drive them away\r\n       Am        Em             D\r\nWe can beat them - just for one day\r\n\r\n          C  G\r\nWe can be He-roes\r\n             D\r\njust for one day\r\n\r\nAnd you, you can be mean\r\nAnd I, I\'ll drink all the time\r\n\'Cause we\'re lovers and that is a fact\r\nYes we\'re lovers and that is that\r\n\r\nThough nothing will keep us together\r\nWe could steal time just for one day\r\nWe can be Heroes for ever and ever\r\nWhat do you say?\r\n\r\nI, I wish you could swim\r\nLike the dolphins, like dolphins can swim\r\nThough nothing will keep us together\r\nWe can beat them for ever and ever\r\n\r\nOh we can be Heroes just for one day\r\n\r\nREPEAT 1st verse (sing an octave higher, sound desperate)\r\n\r\nI, I can remember \r\nStanding by the wall\r\nAnd the guards shot above our heads\r\nAnd we kissed as though nothing could fall\r\nAnd the Seine was on the other side\r\nOh we can beat them forever and ever\r\n\r\nThen we can be Heroes just for one day',46,'2021-04-12 11:00:00',NULL),
	(198,'Keep on the sunny side','There\'s a dark and a trouble side of life\r\nThere\'s a bright and a sunny side too\r\nThough you meet with the darkness and strife\r\nThe sunny side may also find you\r\n\r\n    Keep on the sunny side\r\n    Always on the sunny side\r\n    Keep on the sunny side of life\r\n    It will help us every day\r\n    It will brighten all the way\r\n    If we keep on the sunny side of life\r\n\r\nOh, the storm and its fury broke today\r\nCrushing hopes that we cherish so dear\r\nClouds and storms will in time pass away\r\nThe sun again will shine bright and clear\r\n\r\nRefrain\r\n\r\nLet us green with a song of hope each day\r\nThough the moment be cloudy or fair\r\nLet us trust in our Savior away\r\nWho keepeth every one in his care\r\n\r\nRefrain\r\n\r\n',112,'2021-04-12 23:30:00',NULL),
	(199,'You are my sunshine','The other night, dear\r\nAs I lay sleeping\r\nI dreamed I held you in my arms.\r\nWhen I awoke, dear\r\nI was mistaken\r\nAnd I hung my head and cried;\r\n\r\nCHORUS:\r\nYou are my sunshine\r\nMy only sunshine\r\nYou make me happy\r\nWhen skies are grey\r\nYou\'ll never know dear\r\nHow much I love you\r\nPlease don\'t take my sunshine away.\r\n\r\nI\'ll always love you\r\nAnd make you happy\r\nIf you will only say the same\r\nBut if you leave me\r\nTo love another\r\nYou\'ll regret it all some day;\r\n\r\nCHORUS\r\nYou told me once, dear\r\nYou really loved me\r\nAnd no one else could come between\r\nBut now you\'ve left me\r\nAnd love another\r\nYou have shattered all my dreams;\r\n\r\nCHORUS\r\nLouisiana my Louisiana\r\nthe place where I was borne.\r\nWhite fields of cotton\r\n-- green fields clover,\r\nthe best fishing\r\nand long tall corn;\r\n\r\nCHORUS\r\nCrawfish gumbo and jambalaya\r\nthe biggest shrimp and sugar cane,\r\nthe finest oysters\r\nand sweet strawberries\r\nfrom Toledo Bend to New Orleans;\r\n\r\n',112,'2021-04-13 12:00:00',NULL),
	(200,'First we take Manhattan','        Dm                             Am\r\nThey sentenced me to twenty years of boredom\r\n       Dm                              Am\r\nFor trying to change the system from within\r\n       Dm                       Am\r\nI\'m coming now I\'m coming to reward   them\r\n  G                  F  E                 Am\r\nFirst we take Manhattan, then we take Berlin\r\n\r\n       Dm                        Am\r\nI\'m guided by a signal in the heavens\r\n       Dm                         Am\r\nI\'m guided by this birthmark on my skin\r\n       Dm                         Am\r\nI\'m guided by the beauty of our weapons\r\n  G                  F  E                 Am\r\nFirst we take Manhattan, then we take Berlin\r\n\r\n    C                                G    F\r\nI\'d really like to live beside you, baby\r\n              C                             Am\r\nI love your body and your spirit and your clothes\r\n         C                                       Am\r\nBut you see that line there moving through the station\r\n    G          F          E                      Am\r\nI told you I told you I told you I was one of those\r\n\r\n       Dm                              Am\r\nYou loved me as a loser but now your worried that I just might win\r\n     Dm                             Am\r\nYou know the way to stop me but you don\'t have the discipline\r\n     Dm                                Am\r\nHow many nights I prayed for this: to let my work begin\r\n  G                  F  E                 Am\r\nFirst we take Manhattan, then we take Berlin\r\n\r\nDm                                   Am\r\nI don\'t like your fashion business, mister\r\nDm                                      Am\r\nI don\'t like these drugs that keep you thin\r\nDm                                  Am\r\nI don\'t like what happened to your sister\r\n  G                  F  E                 Am\r\nFirst we take Manhattan, then we take Berlin  (chorus)\r\n\r\n       Dm       