	(201,'Konny & Joyce','Konny tar sit Rizzla og ruller sig en smøg\r\nJoyce hun får en lunge og blir usandsynligt høj\r\nDe skal i byen - ud at føre sig frem\r\nKlokken den blir mange inden de kommer hjem\r\n\r\nJoyce hun er bedrøvet hun har fået en bums\r\nKonny står og klemmer med Yvonne fra kons\r\nHun spiller banjo til en topkarakter\r\nNogen gange spiller hun os på klaver\r\n\r\nOmkvæd:\r\nDet ring i navlen - det er gamacher med skørt\r\nOg det er fredag - det er den vildeste flirt\r\nOg når de kommer - så der lolita på fad\r\n\r\nDansegulvet rykker og folk de danser tæt\r\nKonny hun har scoret en backstage billet\r\nHun får en kontra med en gæstesolist\r\nHva der var i smøgen sku hun nok ha vidst\r\n\r\nOmkvæd\r\n',113,'2021-04-14 13:00:00',NULL),
	(202,'JZ Superstar','Koncentreret cool i mit kongepalads\r\nLytter jeg til Bebop & Acid Jazz\r\nOg henter nøgne pir med min ISDN\r\n\r\nAltid brun og bleget i en bimmer på klods\r\nPakket og poleret i min Hugo Boss\r\nJa det er mig der er vejen til en sikker succes\r\n\r\nOmkvæd:\r\nJeg har det hele her\r\nJZ superstar\r\nFunky og fornøjet udenpå\r\nJeg har det hele her\r\n\r\nTelelingelater fra min 4210\r\nMobiltelefonernes sidste skrig\r\nDen vejer 11 gram og den er mindre end jeres\r\n\r\nBabes og Barbiedukker jeg er fuldkommen fed\r\nnår jeg går i byen er mit harem med\r\nDe siger ingenting og det er mig der er gud\r\n\r\nOmkvæd\r\n\r\nTyve år er gået og jeg trykker den af\r\nvælter mig i deller og bollehåndtag\r\nmen der er da pandehår for jeg har fået toupé\r\n\r\nGift er noget man tar jeg er single endnu\r\nmen jeg scorer stadig på højt nivaeu\r\ngi mig en cardigan og så er der Damhus tonight\r\n\r\nOmkvæd',113,'2021-04-15 01:30:00',NULL),
	(203,'I\'ll fly away','Some glad morning when this life is o\'er, I\'ll fly away\r\nTo a home on God\'s celestial shore, I\'ll fly away. \r\n\r\nI\'ll fly away, O glory, I\'ll fly away\r\nWhen I die, Hallelujah, by and by, I\'ll fly away. \r\n\r\nWhen the shadows of this life is gone, I\'ll fly away\r\nLike a bird from prison bars have flown, I\'ll fly away.\r\n\r\nI\'ll fly away, O glory, I\'ll fly away\r\nWhen I die, Hallelujah, by and by, I\'ll fly away. \r\n\r\nJust a few more weary days and then, I\'ll fly away\r\nTo a land where joys shall never end, I\'ll fly away. \r\n\r\nI\'ll fly away, O glory, I\'ll fly away\r\nWhen I die, Hallelujah, by and by, I\'ll fly away. ',112,'2021-04-15 14:00:00',NULL),
