	(237,'Drops of jupiter','|G	|D	|F	|C	|\r\n\r\nNow that she\'s back in the atmosphere\r\nWith drops of Jupiter in her hair, hey, hey\r\nShe acts like summer and walks like rain\r\nReminds me that there\'s time to change, hey, hey\r\nSince the return from her stay on the moon\r\nShe listens like spring and she talks like June, hey, hey \r\n \r\nTell me did you sail across the sun\r\nDid you make it to the Milky Way to see the lights all faded\r\nAnd that heaven is overrated\r\n \r\nTell me, did you fall for a shooting star\r\nOne without a permanent scar\r\nAnd did you miss me while you were looking at yourself out there \r\n \r\nNow that she\'s back from that soul vacation\r\nTracing her way through the constellation, hey, hey\r\nShe checks out Mozart while she does tae-bo\r\nReminds me that there\'s time to grow, hey, hey \r\n \r\nNow that she\'s back in the atmosphere\r\nI\'m afraid that she might think of me as plain ol\' Jane\r\nTold a story about a man who is too afraid to fly so he never did land \r\n \r\nTell me did the wind sweep you off your feet\r\nDid you finally get the chance to dance along the light of day\r\nAnd head back to the Milky Way\r\nAnd tell me, did Venus blow your mind\r\nWas it everything you wanted to find\r\nAnd did you miss me while you were looking for yourself out there \r\n \r\nCan you imagine no love, pride, deep-fried chicken\r\nYour best friend always sticking up for you even when I know you\'re wrong\r\nCan you imagine no first dance, freeze dried romance five-hour phone conversation\r\nThe best soy latte that you ever had . . . and me \r\n \r\nTell me did the wind sweep you off your feet\r\nDid you finally get the chance to dance along the light of day\r\nAnd head back toward the Milky Way',140,'2021-05-03 07:00:00',NULL),
	(238,'All over now','INTRO:    F   Eb   Bb   C  -- 2x\'s\r\n\r\n      F\r\nWell, baby used to stay out all night long\r\nShe made me cry, she done me wrong\r\nShe hurt my eyes open, that\'s no lie\r\nTables turning, now it\'s her turn to cry\r\n\r\n          C\r\nBecause I used to love her\r\nBb                   F\r\nBut it\'s all over now\r\n          C\r\nBecause I used to love her \r\nBb                   F\r\nBut it\'s all over now\r\n\r\n\r\nWell, she used to run around with every man in town\r\nSpent all my money playin\' a high-class game\r\nShe put me out, it was a pity how I cried\r\nThe tables turning, now it\'s her turn to cry\r\n \r\nBecause I used to love her\r\nBut it\'s all over now\r\nBecause I used to love her\r\nBut it\'s all over now\r\n\r\n\r\nINSTRUMENTAL:  SOLO OVER CHORUS CHORDS -- 3x\'s\r\n\r\n\r\nWell, I used to wake up in the morning\r\nGet my breakfast in bed\r\nWhen I gotten worried\r\nShe could ease my aching head\r\nBut now she\'s here and there \r\nWith every man in town\r\nInstead of trying to take me\r\nFor that same old clown\r\n     \r\nBecause I used to love her\r\nBut it\'s all over now\r\n\r\nBecause I used to love her\r\nBut it\'s all over now\r\n\r\nBecause I used to love her\r\nBut it\'s all over now\r\n\r\nOUTRO:   C   Bb   F  -- 4x\'s TO FADE',141,'2021-05-03 19:30:00',NULL),
	(239,'Into my arms','Intro:	F  C  F  C\r\n\r\nF                                      C\r\nI don\'t believe in an interventionist God\r\nF                             C\r\nBut I know, darling, that you do\r\n          F                              C\r\nBut if I did I would kneel down and ask Him\r\n              F                   C\r\nNot to intervene when it came to you\r\n                              F\r\nNot to touch a hair on your head\r\n                     Dm\r\nTo leave you as you are\r\n                            G\r\nAnd if He felt He had to direct you\r\n       Em                G\r\nThen direct you into my arms\r\n\r\nChorus:\r\n              Dm\r\n     Into my arms, O Lord\r\n              C\r\n     Into my arms, O Lord\r\n              Dm\r\n     Into my arms, O Lord\r\n              C\r\n     Into my arms\r\n\r\nAnd I don\'t believe in the existence of Angels\r\nBut looking at you I wonder if that\'s true\r\nBut if I did I would summon them together\r\nAnd ask them to watch over you\r\nTo each burn a candle fr you\r\nTo make bright and clear your path\r\nAnd to walk, like Christ, in grace and love\r\nAnd guide you into my arms\r\n\r\nChorus\r\n\r\nBut I believe in Love\r\nAnd I know that you do too\r\nAnd I believe in some kind of path\r\nThat we can walk down, me and you\r\nSo keep your candles burning\r\nAnd make her journey bright and pure\r\nThat she will keep returning\r\nAlways and evermore\r\n\r\nChorus',56,'2021-05-04 08:00:00',NULL),
