	(251,'Lullaby','she grew up with \r\nthe children of the stars \r\nin the hollywood hills and the boulevard \r\nher parents threw big parties \r\neveryone was there \r\nthey hung out with folks like \r\ndennis hopper, bob seger, and sonny and cher \r\nshe feels safe now \r\nin this bar on fairfax \r\nand from the stage I can tell that \r\nshe can\'t let go and she can\'t relax \r\nand just before \r\nshe hangs her head to cry \r\nI sing to her a lullaby, I sing \r\n\r\neverything\'s gonna be all right \r\nrockabye, rockabye \r\neverything\'s gonna be all right \r\nrockabye, rockabye \r\nrockabye \r\n\r\nshe still lives with her mom \r\noutside the city \r\ndown that street about a half a mile \r\nand all her friends tell her \r\nshe\'s so pretty \r\nbut she\'d be a whole lot prettier \r\nif she smiled once in a while \r\n`cause even her smile \r\nlooks like a frown \r\nshe\'s seen her share of devils \r\nin this angel town \r\n\r\nBut, everything\'s gonna be all right \r\nrockabye, rockabye \r\neverything\'s gonna be all right \r\nrockabye, rockabye \r\nrockabye \r\n\r\nI told her I ain\'t so sure \r\nabout this place \r\nit\'s hard to play a gig in this town \r\nand keep a straight face \r\nseems like everyone here\'s got a plan \r\nit\'s kind of like nashville with a tan, but, \r\n\r\neverything\'s gonna be all right \r\nrockabye, rockabye \r\neverything\'s gonna be all right \r\nrockabye, rockabye \r\neverything\'s gonna be all right \r\nrockabye, rockabye \r\neverything\'s gonna be all right \r\nrockabye, rockabye,rockabye, bye, bye, \r\nbye, bye',146,'2021-05-08 12:00:00',NULL),
	(252,'Minnie The Moocher','Folks,  here´s a story about Minnie the Moocher\r\nShe was a real live hoochie-koocher\r\nShe was the roughest, toughest frail\r\nbut Minnie had a heart as big as a wha-a-le\r\n\r\nHidee-Hidee-Hidee-hi()\r\nHodee-hodee-hodee-ho()\r\nHeedey-hee-dee-hee-dee hee ()\r\nHidee-hidee-hidee-ho()\r\n\r\nShe hung around with a bloke named Smoky\r\nShe loved him though he was cokey\r\nHe took her down to Chinatown\r\nWhere he showed her how to kick the gong around ()\r\n\r\nHidee-Hidee-Hidee-hi()\r\nWooooooh()\r\nHeedey-hee-dee-hee-dee hee ()\r\nHidee-hidee-hidee-ho()\r\n\r\nshe had a dream about the King of Sweden\r\nHe gave her things that she was needin´\r\nA palace home built of gold and steel\r\nA diamond car with platinum wheels\r\n\r\nhidee-hidee-hidee-hidee-hidee-hidee-hi()\r\nhodee-hodee-hodee-hodee-hodee-hodee-ho()\r\nscoodley-woo-scoodley-woo-scoodley-woodley-woodley-woo()\r\nzit-dit-dit-dit-dittle-but-dut-duttleoo-skit-dit-skittle-but-dit-zoy()\r\n\r\nhe gave her his townhouse and his racing horses\r\nEach meal she ate was a dozen courses\r\nShe had a million dollars worth of nickels and dimes\r\nshe sat around and counted them a million times\r\n\r\nHidee-Hidee-Hidee-hi()\r\nHodee-hodee-hodee-ho()\r\nHeedey-hee-dee-hee-dee hee ()\r\nHidee-hidee-hidee-ho()\r\n\r\nPoor Min, Poor Min, Poor Min.',147,'2021-05-09 00:30:00',NULL),
