	(280,'Arh dér!','Min mormor har sagt, at jeg ska\' opfør\' mig pænt\r\nman rider, som man sadler, man får som fortjent\r\nog det gør man vel, man skal være reel\r\nman skal elske sin næste, som man elsker sig selv\r\nOkay, det har jeg lært, men jeg har altid haft svært\r\nved at elske min aggressive vicevært\r\nhver dag jeg kommer ned så står han der med sin kost\r\nog lugter som en mellemlagret blåskimmelost\r\nden sure idiot, jeg hader hans klamme\r\nmåde at sige: \"Brug måtten den er til for det samme!\"\r\nog hans evige præg om mit stereoanlæg\r\nder skal byttes til en walkman eller bare smides væk\r\nDen nar!\r\n\r\nArh der!\r\nJeg siger fra her\r\nfordi far her\r\nka\' ikke klar\' mer\'\r\njeg syn\'s jeg vader i pladder\r\njeg er ved at blive skør\r\nog jeg hader all\' de padder\r\nder skader mit humør\r\nArh dér!\r\n\r\n\r\nEn rigtig plat lørdag nat tre kvarter i fem\r\njeg var fuld og skæv og træt og ville hurtigt hjem\r\nog jeg hader stå i kø\'r med folk i lidt for godt humør\r\nog jeg hader de der nævenyttige natbuschauffører\r\njeg når halvt ind i bussen før han kalder mig hen\r\nfor at se mit våde, fundne, brugte, gamle klippekort igen\r\nflere feststemte aber syn\'s det\' mægtig skægt\r\nmen chaufføren kæfter op om snyd og natbustillæger\r\nog jeg roder, selv om jeg udmærket ved\r\nat jeg har li\'så lidt penge som chaufføren har tålmodighed\r\njeg skynder mig at kalde ham et fedladent kvaj\r\njeg bli\'r smidt ud, døren smækker, bussen kører sin vej\r\n- uden mig\r\n\r\n\r\nArh der!\r\nJeg siger fra her\r\nfordi far her\r\nka\' ikke klar\' mer\'\r\njeg syn\'s jeg vader i pladder\r\njeg er ved at blive skør\r\nog jeg hader all\' de padder\r\nder skader mit humør\r\nArh dér!\r\n\r\n\r\nSofie var en pige som jeg lige havde mødt\r\nder var sød musik i luften, det hele var så sødt\r\nså en dag da jeg dyrked\' noget deft cruzeri\r\nså tænkte jeg, jeg lige ville smutte forbi\r\nmen det var åbenbart ikke særlig smart\r\nfor det blik som jeg fik, det var ikke så rart\r\nda hun stod der bag døren med kæden på\r\nsagde hun: \"Min mor er på besøg, du bli\'r nødt til at gå\"\r\ndet\' da okay, det havde jeg intet imod\r\nmen hendes hår det var uglet, hendes tøj var noget rod\r\nhvad hun lavede med sin mor var enten helt unormalt\r\neller også var der virkelig et eller andet galt\r\nhvad ved jeg\r\n\r\n\r\nArh der!\r\nJeg siger fra her\r\nfordi far her\r\nka\' ikke klar\' mer\'\r\njeg syn\'s jeg vader i pladder\r\njeg er ved at blive skør\r\nog jeg hader all\' de padder\r\nder skader mit humør\r\nArh dér!\r\n',166,'2021-05-23 14:30:00',NULL),
	(281,'Sleeping my day away','(Eb)             Bb                    Db\r\nMumbling goodmornig and raising my head \r\n             Eb                 Bb\r\nA bad breath kiss to my pillow pet\r\n         Db                  Eb                Bb\r\nI take a look at the day and turns and stay in bed\r\n        Bb                     Db\r\nOpen my eyes when the day have died\r\n             Eb                Bb\r\nI turned the world and I slept allright\r\n       Db                Eb\r\nNow my game is over I zip my jeans tight \r\n       \r\nOh Lord wont you bless this night.\r\n\r\n\r\n         Bb\r\nFrom the pale lips of the youth who lay\r\nDb               Eb\r\nI\'m sleeping my day away\r\n             Bb\r\nAnd when the night comes to the city I say\r\nDb              Eb\r\nI\'m sleeping my day away\r\n              Bb\r\nYahh, with my pale lips in my pillow I say\r\nDb               Eb\r\n I\'m sleeping my day away\r\nBb\r\nAfter dark is the game I play\r\nDb               Eb      Bb / Db / Eb\r\n I\'m sleeping my day....away\r\n\r\n\r\nWhen my dreams begin \r\nIll be proud to be letting you in\r\nWith a smile on my face I guide our dream boat in\r\nSo if you wanna travel along with me\r\nYou\'d better sleep tight the rest of the day\r\nYou see I couldt be a sleeper Its not the rest I last\r\nCos\' I hit the sack when the suns comming back\r\n\r\nChor.\r\n        \r\nSolo\r\n        \r\nYah now I turned the world around Yah I did it again\r\nI\'m sleeping my day away\r\nAnd now I have to wear my shades down sleepers lane\r\nI\'m sleeping my day away\r\nYah all good people have gone to bed again\r\nI\'m sleeping my day away\r\nBecause the devil\'s at work inside my brain\r\nI\'m sleeping my day away\r\nI\'m sleeping my day away\r\nI\'m sleeping my day away\r\nI\'m sleeping my day away\r\naway away........',167,'2021-05-24 03:00:00',NULL),
	(282,'Summer Of \'69','A\r\nI got my first real six-string\r\nE\r\nBought it at the five-and-dime\r\nA\r\nPlayed it till my fingers bled\r\nE\r\nIt was the summer of \'69\r\n\r\nMe and some guys from school\r\nHad a band and we tried real hard\r\nJimmy quit and Jody got married\r\nI shoulda known we\'d never get far\r\n\r\nF#m       D\r\nOh when I look back now\r\nA                     D\r\nThat summer seemed to last forever\r\nF#m      D \r\nAnd if I had the choice\r\nA             D\r\nYa I\'d always wanna be there\r\nF#m            E               A\r\nThose were the best days of my life\r\n\r\nAin\'t no use in complainin\'\r\nWhen you got a job to do\r\nSpent my evenin\'s down at the drive-in\r\nAnd that\'s when I met you\r\n\r\nStandin\' on your Mama\'s porch\r\nYou told me that you\'d wait forever\r\nOh and when you held my hand\r\nI knew that it was now or never\r\nThose were the best days of my life\r\nBack in the summer of \'69\r\n\r\nC           F\r\nMan we were killin\' time\r\n        G\r\nWe were young and restless\r\n   F           C\r\nWe needed to unwind\r\n        F                   G\r\nI guess nothin\' can last forever - forever, no\r\n\r\nAnd now the times are changin\'\r\nLook at everything that\'s come and gone\r\nSometimes when I play that old six-string\r\nI think about ya wonder what went wrong',156,'2021-05-24 15:30:00',NULL),
	(283,'Amazing','Intro: Am - G - Am - G\r\n\r\n           Am                         G\r\nI kept the right ones out and let the wrong ones in\r\n       C                                       F\r\nHad an angel of mercy to see me through all my sins\r\n           Fm/G#                       C/G\r\nThere were times in my life when I was goin\' insane\r\n               D/F#        F\r\nTryin\' to walk through the pain\r\n       Am                 G\r\nWhen I lost my grip and I hit the floor\r\n        C                                              F\r\nYeah, I thought I could leave but couldn\'t get out the door\r\n      Fm/G#                C/G\r\nI was so sick and tired of livin\' a lie\r\n      D/F#                 F\r\nI was wishin\' that I would die\r\n\r\nChorus:\r\n       C Em            F                   Em              G\r\nIt\'s amazing, with the blink of an eye you finally see the light\r\n       C Em           F                       Em               G\r\nIt\'s amazing when the moment arrives that you know you\'ll be alright\r\n       F Em          D                       G                  C\r\nIt\'s amazing and I\'m sayin\' a prayer for the desperate hearts tonight\r\n\r\n     Am                D\r\nThat one last shot\'s a permanent vacation\r\n    F                         C\r\nAnd how high can you fly with broken wings?\r\n         Am                  D\r\nLife\'s a journey not a destination\r\n      F                            G\r\nAnd I just can\'t tell just what tomorrow brings\r\n\r\n            Am                        G\r\nYou have to learn to crawl before you learn to walk\r\n      C                                          F\r\nBut I just couldn\'t listen to all that righteous talk\r\n      Fm/G#                    C/G\r\nI was out on the street, just tryin\' to survive\r\nD/F#                 F\r\nScratchin\' to stay alive\r\n\r\nChorus:\r\n       C Em            F                   Em              G\r\nIt\'s amazing, with the blink of an eye you finally see the light\r\n       C Em           F                       Em               G\r\nIt\'s amazing when the moment arrives that you know you\'ll be alright\r\n       Am Em         D                       G                  C\r\nIt\'s amazing and I\'m sayin\' a prayer for the desperate hearts tonight\r\n\r\nC D\r\n    Desperate hearts, desperate hearts\r\nD Em\r\n    Did you wanna see without and give it out now (or whatever...)\r\nEm F\r\n    Ow, oh yeah yeah, oh yeah yeah, ya ka kow, ya ka ka ka kow\r\n\r\nOutro...\r\nC - D - Em - F\r\nG - Am - G - F\r\nC - D - Em - F\r\nG - Am - G - F\r\netc...\r\n\r\n',168,'2021-05-25 04:00:00',NULL),
	(284,'Cats in the craddle','E                 G\r\nA child arrived just the other day\r\n A                         E             \r\nCame to the world in the usual way\r\nE                            G\r\nThere were planes to catch, bills to pay\r\n A                       E\r\nHe learned to walk while I was away\r\nD                           \r\nHe was talking \'fore I knew it and when he could, he said\r\n G                  E\r\n\"I\'m gonna be like you, dad,\r\n G                          E\r\nYou know I\'m gonna be like you\"\r\n\r\n\r\nCHORUS\r\n\r\nE                           G     \r\nThe cats in the cradle and the silver spoon\r\n G                     A\r\nLittle boy blue and a man on the moon\r\nE                         G\r\nWhen you comin\' home son, I don\'t know when\r\nD                    E\r\nWe\'ll get together then,\r\nG                                E\r\nYou know we\'ll have a good time then\r\n\r\n\r\nVERSE 2\r\n\r\nE                       G\r\nMy son turned ten just the other day\r\nA                                  E\r\nHe said \"Thanks for the ball dad, come on, let\'s play\r\nE                                       G\r\nCould you teach me to throw?\", I said \"Not today\r\nA                             E\r\nI got a lot to do\", he said \"That\'s OK\"\r\nD                                        G\r\nHe walked away with a smile on his face, he said\r\n               E\r\n\"I\'m gonna be like him, yeah,\r\nG                           E\r\nyou know I\'m gonna be like him\"\r\n\r\n\r\nCHORUS\r\n\r\nE                           G     \r\nThe cats in the cradle and the silver spoon\r\n G                     A\r\nLittle boy blue and a man on the moon\r\nE                         G\r\nWhen you comin\' home son, I don\'t know when\r\nD                    E\r\nWe\'ll get together then,\r\nG                                E\r\nYou know we\'ll have a good time then\r\n\r\n\r\nVERSE 3\r\n\r\nE                          G\r\nWell he came from college just the other day\r\nA                              E\r\nSo much like a man I just have to say\r\n E                           G\r\nI\'m proud of you, could you sit for a while\r\nA                         E\r\nHe shook his head and he said with a smile\r\n  D\r\nWhat I\'m feeling like, dad, is to borrow the car keys\r\nG                  E\r\nsee you later, can I have them please \r\n\r\n\r\nCHORUS\r\n\r\nE                           G     \r\nThe cats in the cradle and the silver spoon\r\n G                     A\r\nLittle boy blue and a man on the moon\r\nE                         G\r\nWhen you comin\' home son, I don\'t know when\r\nD                    E\r\nWe\'ll get together then,\r\nG                                E\r\nYou know we\'ll have a good time then\r\n\r\n\r\nBRIDGE - Three parts simultaneously \r\n\r\nElectrical guitar\r\n\r\n\r\nVERSE 4\r\n\r\nE                            G\r\nI\'ve long since retired, my son moved away\r\nA                  E\r\nI called him up just the other day\r\nE                     G\r\nI\'d like to see you, if you don\'t mind\r\n A                          E\r\nHe said: I\'d love to, dad, if I could find the time.\r\n         D\r\nYou see, my new job\'s hassle and the kids got the flu,\r\n G                             E\r\nbut it\'s sure nice talking to you dad, \r\nG                     E\r\nit was sure nice talking to you.\r\n\r\n\r\nVERSE 5\r\n\r\n       D\r\nAnd as I hung up the phone is occurred to me\r\n G                      E\r\nHe\'d grown up just like me\r\nG                     E\r\nMy boy was just like me!',169,'2021-05-25 16:30:00',NULL),
	(285,'Dude Looks Like a Lady','Cruised into a bar on the shore\r\n\r\nHer picture graced the grime on the door\r\n\r\nShe a long lost love at first bite\r\n\r\nBaby maybe you\'re wrong but you know that\'s alright\r\n\r\nThat\'s right\r\n\r\n \r\n\r\nBackstage we\'re havin the time\r\n\r\nOf our lives until somebody say\r\n\r\nForgive me if I seem out of line\r\n\r\nThen she whipped out her gun\r\n\r\nTried to blow me away\r\n\r\n \r\n\r\nDude looks like a lady\r\n\r\nDude looks like a lady\r\n\r\nDude looks like a lady\r\n\r\nDude looks like a lady\r\n\r\n \r\n\r\nSo never judge a book by its cover\r\n\r\nOr who you gonna love by your lover\r\n\r\nLove put me wise to her love in disguise\r\n\r\nShe had the body of a venus\r\n\r\nLord, imagine my surprise\r\n\r\n \r\n\r\nDude looks like a lady\r\n\r\nDude looks like a lady\r\n\r\nDude looks like a lady\r\n\r\nDude looks like a lady\r\n\r\n \r\n\r\nBaby let me follow you down\r\n\r\nLet me take a peek dear\r\n\r\nBaby let me follow you down\r\n\r\nDo me, do me, do me, all night\r\n\r\nBaby let me follow you down\r\n\r\nTurn the other cheek dear\r\n\r\nBaby let me follow you down\r\n\r\nDo me, do me, do me, sue me\r\n\r\n \r\n\r\nWhat a funky lady\r\n\r\nShe like it like it like it like that\r\n\r\nHe was a lady\r\n',168,'2021-05-26 05:00:00',NULL),
	(286,'A girl like you','INTRO:  \r\nCm,Fm,Gm \r\nCm,Fm,Cm\r\nCm,Fm,Gm   \r\nCm,Fm,Cm\r\n\r\nVERSE1\r\n\r\nCm                           Fm    Gm           Cm, Fm, Cm     \r\nI\'VE NEVER KNOWN A GIRL LIKE YOU BEFORE\r\n    Cm                       Fm      Gm         Cm, Fm, Cm   \r\nNOW JUST LIKE IN A SONG FROM DAYS OF YORE        \r\nCm                              Fm    Gm        Cm, Fm, Cm   \r\nHERE YOU COME KNOCKIN\' KNOCKIN\' ON MY DOOR       \r\n         Cm                    Fm    Gm         Cm, Fm, Cm   \r\nAND I\'VE NEVER MET A GIRL LIKE YOU BEFORE    \r\n\r\n\r\n\r\nYOU GIVE ME JUST A TASTE SO I WANT MORE\r\nNOW MY HANDS ARE BLEEDING AND MY KNEES ARE RAW\r\nNOW YOU GOT ME CRAWLIN\' CRAWLIN\' ON THE FLOOR\r\nAND I\'VE NEVER KNOWN A GIRL LIKE YOU BEFORE\r\n\r\n\r\nBRIDGE1 (OR WHATEVER)       \r\n\r\n       Cm                     Gm\r\nYOU\'VE MADE ME ACKNOWLDGE THE DEVIL IN ME\r\n  Cm                          Gm\r\nI HOPE TO GOD I\'M TALKING METAPHORICALLY\r\n  Cm                        Gm\r\nI HOPE THAT I\'M TALKING ALLEGORICALLY\r\nCm                              Gm\r\nKNOW THAT I\'M TALKING `BOUT THE WAY I FEEL\r\n         Cm                      Fm    Gm       Cm, Fm, Cm  \r\nAND I\'VE NEVER KNOWN A GIRL LIKE YOU BEFORE\r\nCm            Fm     Gm\r\nNEVER, NEVER ,NEVER ,NEVER\r\nCm                      Fm    Gm                Cm, Fm, Cm  \r\nNEVER KNOWN A GIRL LIKE YOU BEFORE\r\n\r\n\r\nBRIDGE\r\n\r\n\r\nTHIS OLD TOWN HAS CHANGED SO MUCH\r\nDON\'T FEEL LIKE I BELONG\r\nTOO MANY PROTEST SINGERS\r\nNOT ENOUGH PROTEST SONGS\r\nAND NOW YOU\'VE COME ALONG\r\nYES YOU\'VE COME ALONG\r\nAND I\'VE NEVER KNOWN A GIRL LIKE YOU BEFORE\r\n\r\n\r\nCm       Fm     Gm     Cm\r\n  YES ALLRIGHT, YES ALLRIGHT  \r\nCm       Fm     Gm     Cm     \r\n  YES ALLRIGHT, YES ALLRIGHT  ',170,'2021-05-26 17:30:00',NULL),
	(287,'Wherever you will go','So lately, been wondering,\r\nWho will be there to take my place\r\nWhen I\'m gone, you\'ll need love\r\nTo light the shadows on your face\r\nIf a great wave shall fall\r\nIt would fall upon us all\r\nAnd between the sand and stone\r\nCould you make it on your own\r\n\r\nIf I could, then I would\r\nI\'ll go wherever you will go\r\nWay up high, or down low\r\nI\'ll go wherever you will go\r\n\r\nAnd maybe, I\'ll find out\r\nThe way to make it back someday\r\nTo watch you, to guide you\r\nThrough the darkest of your days\r\nIf a great wave shall fall\r\nIt would fall upon us all\r\nWell then I hope there\'s someone out there\r\nWho can bring me back to you\r\n\r\nIf I could, then I would\r\nI\'ll go wherever you will go\r\nWay up high, or down low\r\nI\'ll go wherever you will go\r\n\r\nRunaway with my heart\r\nRunaway with my hope\r\nRunaway with my love\r\n\r\nI know now, just quite how\r\nMy life and love might still go on\r\nIn your heart, in your mind\r\nI\'ll stay with you for all of time\r\n\r\nIf I could, then I would\r\nI\'ll go wherever you will go\r\nWay up high, or down low\r\nI\'ll go wherever you will go\r\n\r\nIf I could turn back time\r\nI\'ll go wherever you will go\r\nIf I could make you mine\r\nI\'ll go wherever you will go\r\nI\'ll go wherever you will go',171,'2021-05-27 06:00:00',NULL),
	(288,'Like a Prayer','Dm-C-Gm\r\n \r\nLife is a mystery\r\n \r\nEveryone must stand alone\r\n \r\nI hear you call my name\r\n \r\nAnd it feels like home\r\n \r\n \r\nF                C\r\n \r\nWhen you call my name\r\n                   Bb  \r\nIt\'s like a little prayer\r\n               F\r\nI\'m down on my knees\r\n \r\nI wanna take you there\r\n \r\nIn the midnight hour\r\nI can feel your power\r\nJust like a prayer\r\nYou know I\'ll take you there\r\n \r\nBb          F \r\nI hear your voice\r\nC            Dm\r\nIt\'s like an angel sighing\r\nBb        F                  C       \r\nI have no choice I hear your voice\r\n \r\nFeels like flying\r\n \r\nI close my eyes\r\nOh God I think I\'m falling\r\nOut of the sky I close my eyes\r\nHeaven help me\r\n \r\nWhen you call my name...\r\n \r\nLike a child\r\nYou whisper softly to me\r\nYou\'re in control just like a child\r\nNow I\'m dancing\r\nIt\'s like a dream\r\nNo end and no beginning\r\nYou\'re here with me it\'s like a dream\r\nLet the choir sing\r\n \r\nWhen you call my name... ',172,'2021-05-27 18:30:00',NULL),
