	(291,'Use Me','Em7       A7                    Em7  A7\r\nMy friends, feel it?s their appointed duty\r\nEm7                        Am7                       Em7 A7\r\nThey keep trying to tell me, all you want to do is use me\r\nEm7                 Am7                          Em7 A7\r\nUh huh but my answer, about all that use me stuff\r\n \r\n<Break>\r\nI want to spread the news that if it feels this good getting used\r\nYou can keep on using me\r\nUntil you use me up\r\nUntil you use me up\r\n \r\nMy brother, sit me right down and he talked to me\r\nHe told me, that I ought to not let you just walk on me\r\nWell I?m sure that he meant well, yeah but when out talk was through\r\n \r\nI said brother if you only knew, you?d wish you were in my shoes\r\nYou could keep on using me\r\nUntil you use me up\r\nUntil you use me up\r\n \r\nSometimes it?s true, you really do abuse me\r\nOh you get me in a crowd of high-class people, And you act real nasty to me\r\nI said oh baby, baby, baby, baby, When you love me I can?t get enough\r\n \r\nI want to spread the news that if it feels this good getting used\r\nYou can keep on using me\r\nUntil you use me up\r\nUntil you use me up',173,'2021-05-29 08:00:00',NULL),
	(292,'Nede i møget','D\r\nNede i møget, laset i tøjet,\r\n\r\nsulten, tørstig og fallit.\r\n\r\nVinteren kommer,\r\n       G\r\nmen en dag bli\'r det sommer\r\n    D           A7        D\r\nDet her har jeg prøvet så tit.\r\n\r\nD\r\nSæt dig ned, hvis du har tid,\r\n                   A7        D\r\njeg har noget at berette for dig\r\n     D\r\nDu begriber jo ikke\r\n   G\r\nen pind om det liv,\r\n          D        A7         D\r\nder bli\'r levet af bumser som mig. \r\n\r\n\r\njeg er jo\r\n\r\nNede i møget\r\nlaset i tøjet,\r\nsulten, tørstig og fallit.\r\nØllet er drukket;\r\nKlodsen er lukket.\r\nmen Det her har jeg prøvet så tit.\r\n\r\nHør nu her\r\ndu fine mand;\r\nDu præker for meget, min ven\r\nSpring med en femmer\r\ntil lidt mad og en øl,\r\nså ka\' det være, vi ku\' snakke igen. \r\n\r\nFor jeg er\r\n\r\nNede i møget\r\nlaset i tøjet,\r\nsulten, tørstig og fallit.\r\nFrakken er stampet;\r\nSprutten fordampet,.\r\nMen det her har jeg prøvet så tit.\r\n\r\nJeg ka\' gå\r\nhvorhen jeg vil;\r\nikke bar\' følge med li\'som du.\r\nJeg er bums for Vorherre\r\nmen ikke for dig,\r\nog min guitar-den har jeg endnu. \r\n\r\nFor jeg er\r\n\r\nNede i møget\r\nlaset i tøjet,\r\nsulten, tørstig og fallit.\r\nVinteren kommer,\r\nmen en dag bli\'r det sommer.\r\nDet her har jeg prøvet så tit.',83,'2021-05-29 20:30:00',NULL),
	(293,'Der er noget galt i Danmark','       G\r\nDer er noget galt i Danmark\r\n                                   C\r\nDybbøl Mølle maler helt ad helved\' til\r\nD7\r\nBare tegnedrengen er i orden\r\n                       G\r\nkan man få det som man vil\r\nG\r\nBlæse vær\' med andres mening\r\n                                C\r\nselv om det er dem der står for skud\r\nD7\r\nDer er noget skævt i toppen\r\n                                 G     D7\r\nno\'et der trænger til at skiftes ud.     \r\n\r\nG                                           C\r\nJensen går ned til en å for at fange sig en fisk,\r\n                  A7\r\nhvad han ofte har gjort,\r\nD7\r\nmen der er ingenting at hente\r\n                G                         D7\r\nen industri har fyldt åen op med skidt og lort.\r\nG\r\nFør gik han tur langs med stranden\r\n                C                A\r\nog nød de vilde fugle i titusind-vis\r\nD7\r\nNu kan han få dem i olie\r\n                   G\r\nmen til for høj en pris\r\n\r\nDer er noget galt i Danmark...\r\n\r\nPrøv blot at se hvad der sker i de gamle gader\r\nmidt i vor by København.\r\nHæslige kasser skyder op -\r\nnu er turen også kommet til det kære Christianshavn.\r\nLastbil på lastbil ska\' larme og ose\r\nlangs kanalen hvert andet minut.\r\nDem må vi standse i tide\r\nnu må det være slut.\r\n\r\nDer er noget galt i Danmark...',83,'2021-05-30 09:00:00',NULL),
	(295,'Karl Herman og jeg','C                          G\r\nBørge og lille Lasse, Karl Herman og jeg \r\n                             C\r\nspilled´ i Cafe \"Skuden\"- en dødssyg galej. \r\n                                 G\r\nHver gang den fik lidt Mozart og den slags musik \r\n                            C\r\nskred publikum på stedet og sa´ da de gik : \r\n\r\nF\r\nEl-guitar og saxofon vil vi ha´ \r\n                      C\r\nRock and roll og ikke andet\r\nC\r\nEl-guitar og saxofon vil vi ha? \r\n                      F\r\nRock and roll og ikke andet\r\n\r\n\r\nBørge og lille Lasse, Karl Herman og jeg \r\nslutted´ i Cafe \"Skuden\" og bytted´ vort grej. \r\nBørge han valgte guitar og jeg klarinet, \r\nLasse en saxofon, Karl et brugt vaskebræt. \r\n\r\n\"El-guitar og saxofon ska´ de ha´. \r\nRock and roll og ikke andet. \r\nEl-guitar og saxofon vil vi ha?. \r\nRock and roll og ikke andet.\"\r\n\r\nBørge og lille Lasse, Karl Herman og jeg \r\nvar på turne et år, og det gik som en leg. \r\nVi tjente kasse nok til et godt lille sted. \r\nOg der drøned´ vi deruda´, og folk skråled´ med : \r\n\r\n\"El-guitar og saxofon vil vi ha´. \r\nRock and roll og ikke andet. \r\nEl-guitar og saxofon vil vi ha?. \r\nRock and roll og ikke andet.\"\r\n\r\nBørge og lille Lasse, Karl Herman og jeg \r\nvar ble´t lidt grå i toppen, så vi gik hver sin vej. \r\nLasse har købt et slot, men han åbner sin dør, \r\nså spiller vi lidt Mozart præcis li´som før. \r\n\r\nMen på søndag ska´ vi på den igen. \r\nBørges dreng han fylder atten. \r\nVi tre andre stiller op med vor ven, \r\nog så får den ´en på hatten. \r\n\r\n\"El-guitar og saxofon ska´ de ha´. \r\nRock and roll og ikke andet. \r\nEl-guitar og saxofon vil vi ha?. \r\nRock and roll og ikke andet.\"',83,'2021-05-30 21:30:00',NULL),
