	(297,'Mennesker bliver spist i Polynesien','G               C           G\r\nMen\'sker bliver spist i Polynesien\r\n    D            G\r\nhulalulalej, hulalulalej.\r\n              C        G\r\nNatten falder på i Polynesien\r\n    D7      G\r\nhulalulalulalej\r\n\r\nG\r\nPalmeblade hvisker\r\n       C\r\nstille i den lune vind\r\nG                     C\r\nlæg konkylien mod din kind\r\nAm\r\nstillehavet bruser\r\n        D7\r\nhvilken dejlig vuggesang\r\nAm                     D7\r\ner det blot en harmløs klang\r\n\r\nMen\'sker bliver spist i Polynesien\r\nhulalulalej, hulalulalej.\r\nNatten falder på i Polynesien\r\nhulalulalulalej\r\n\r\nSe korallen gløder\r\nog lagunens klare vand \r\nbølger mod den hvide strand\r\nkokosnøddern, brun og lodden\r\nslipper, falder ned\r\ner det en tilfældighed\r\n\r\nMen\'sker bliver spist i Polynesien\r\nhulalulalej, hulalulalej.\r\nNatten falder på i Polynesien\r\nhulalulalulalej\r\n\r\nAlting ånder fred og ro\r\nog månen stiger op\r\nbag vulkanens fjerne top\r\nslanke piger danser \r\nhvilket herligt skuespil\r\ner det dig de smiler til\r\n\r\nMen\'sker bliver spist i Polynesien\r\nhulalulalej, hulalulalej.\r\nNatten falder på i Polynesien\r\nhulalulalulalej',83,'2021-05-31 22:30:00',NULL),
	(298,'Ursula','URSULA!\r\nBlot et enkelt blik var nok.\r\nURSULA!\r\nHun virked\' på mig som et chok.\r\nDejlige reps.\r\nTing og nips\r\nURSULA!\r\nHvilken stemme; hvilket smil\r\nURSULA!\r\nHun har klasse; hun har stil.\r\nsuveræn.\r\nSimpelthen:\r\nURSULA!\r\n\r\nJeg var med som gæst\r\ntil en abefest;\r\nhavde høvlet omkring med en pige,\r\nder dansed\' som en hest.\r\nPluds\'lig stod hun der.\r\nBlemt var de ømme tæ\'r\r\nJeg tog mig sammen, gik hen sa\':\r\nDav\', jeg er Kaj, og så ringede klokken,\r\nda hun svarede\';\r\n\r\nURSULA!\r\nDenne stemme og dette smil.\r\nAv min arm.\r\nsikken\' klasse,sikken\' stil.\r\nhun var pæn.\r\nSuveræn.\r\nSimpelthen.\r\n\r\nVarm som en vulkan\r\ngik jeg li\' til sag\'n;\r\nfyred op under kedlen og\r\ncharmede løs som bare fa\'n.\r\nHun var med på spøge\'n.\r\njeg tænkte:det løgn.\r\nDet gjorde FREDE, KARL, BØRGE,\r\nNIELS VIGGO og HOLGER sgu ose\r\nda jeg dampede\' hjemad med:\r\n\r\nURSULA!\r\njeg forstår den egnt\'lig godt;\r\nærligt talt;\r\nså\' jeg ikke sådan særlig flot;\r\nmen det\' nu mig:\r\nHam lill Kaj,\r\nhun vil ha\'\r\nURSULA!',83,'2021-06-01 11:00:00',NULL),
