	(300,'Du ser mig når jeg kommer','C           Cmaj7          F    Fm    C\r\nKære Kaj en hilsen fra din kone Ann-Mari´\r\n                            D7             G7\r\nHvordan har du haft det, er turne´en nu forbi,\r\nC             Cmaj7         F       Fm    C \r\ndet´ jo længe siden jeg har set dit kontrafej, \r\n   F            C                G              C\r\ndu har vel ikke glemt, at det er her du bor hos mig. \r\nF                             C\r\nRygterne har svirret, man har set dig på en kro \r\n  D7                                             G7\r\ni selskab med en flot blondine, hvad skal jeg så tro,\r\n    C                            C7          F \r\nmen et? er sikkert, nu er min tålmodighed forbi, \r\n   F                C\r\ndu ser mig, når jeg kommer\r\nA7     D7     G7    C\r\nKærlig hilsen Ann-Mari´. \r\n\r\n\r\nDu gik ned i søndags for at hente morgenbrød, \r\njeg sku´ lave kaffe, ha- go´morn´ du er sød. \r\nNu? det blevet fredag, og du er ikke vendt retur, \r\nså nu er kaffen kold min ven og fløden den er sur. \r\nNår du læser dette er jeg milevidt herfra, \r\nfor jeg er ikke mere kun dit faste inventar. \r\nNu rejser jeg på ferie, jeg skal flyve klokken ti. \r\nDu ser mig når kommer. \r\nKærlig hilsen Ann-Mari´. \r\n\r\n\r\nSæt dig ned og hyg dig slap nu af med din avis, \r\nog tænk så på, hvor morsomt man kan ha´ det i Paris. \r\nHusk at vande blomsterne, men det er ikke alt \r\nder ligger fjorten regninger, som ikke er betalt. \r\nJa der er lukket af for både lys og telefon, \r\nså du kan nok forstå, jeg trænger til rekreation. \r\nJo der er nok at se til kære Kaj hæng bare i. \r\nDu ser mig når jeg kommer. \r\nKærlig hilsen Ann-Mari´.',83,'2021-06-02 12:00:00',NULL),
	(301,'Karl & Ann-Cathrin´','      C\r\nPå en bænk i Christiania sidder Karl og Ann-Cathrin´. \r\n                                              C7\r\nDen er helt gal med humøret, deres drøm er en ruin. \r\n        F\r\nDe ska´ flytte inden længe ud a´ vagten, ud igen \r\n       C                                G                 C\r\ntil en fremtid tem´lig håbløs, for hvor fa´en ska´ de ta´ hen ? \r\n\r\n       F             G             C\r\nSat på gaden, hvem bekymrer sig om Karl og Ann-Cathrin? \r\nG                    C\r\nKarl og Ann-Cathrin´ Karl og Ann-Cathrin´. \r\n      F              G           C\r\nUd a´ staden hvor de netop havde fundet melodi´n.\r\n             G \r\nPorten i for Karl og Ann-Cathrin´. \r\n\r\nDa de mødtes var de nede, hver for sig og han især, \r\nmen i staden fandt de sammen, det var tyd´ligt for enhver. \r\nDe blev glade for hinanden, og for livet ikke mindst. \r\nEnd´lig var der noget at slås for med en chance for gevinst. \r\n\r\nSat på gaden .... \r\n\r\nSå´ det ud, kære venner, klar jer selv? og find et job. \r\nDen besked er svær at snuppe, når man just er kommet op \r\nOg de stirrer blot på manden, han er ikke særlig stor \r\nMen de tænker inderst inde : Mon han får det sidste ord ? \r\n\r\nSat på gaden .....',83,'2021-06-03 00:30:00',NULL),
	(302,'Always look on the bright side of Life','     Am                 D            G               Em\r\nSome things in life are bad they can really make you mad\r\n      Am                   D         G\r\nOther things just make you swear and curse\r\n            Am                D\r\nWhen you\'ve chewing an life\'s gristle\r\n      G              Em\r\nDon\'t grumble give a whistle\r\n    Am                                   D7\r\nAnd this\'ll help things turn out for the best\r\n\r\n    G      Em          Am     D7      G      Em    Am    D7\r\nAnd always look on the bright side of life\r\n   G   Em          Am    D7      G     Em    Am    D7\r\nAlways look on the light side of life\r\n\r\n   Am               D              G                Em\r\nIf life seems jolly rotten there\'s something you\'ve forgotten\r\n              Am                  D         G\r\nand that\'s to laugh and smile and dance and sing.\r\n            Am             D              G     Em\r\nWhen you\'ve feeling in the dumps don\'t be silly chumps\r\n     Am                                       D7\r\nJust purse your lips and whistle - that\'s the thing\r\n\r\n    G      Em          Am     D7      G      Em    Am    D7\r\nAnd always look on the bright side of life\r\n           G   Em          Am    D7        G     Em    Am    D7\r\nCome on always look on the bright side of life\r\n\r\n\r\n     Am               D        G               Em\r\nFor life is quite absurd and death\'s the final word\r\n         Am              D              G\r\nyou must always face the curtain with a bow\r\n   Am             D              G          Em\r\nForget about your sin - give the audience a grin\r\n  Am                                D7\r\nEnjoy it - it\'s your last chance anyhow.\r\n\r\n    G      Em          Am     D7      G      Em    Am    D7\r\nSo always look on the bright side of death\r\nG      Em       Am           D7    G         Em    Am    D7\r\njust before you draw your terminal breath\r\n\r\nAm               D    G                Em\r\nLife\'s a pice if shit when you look at it\r\nAm                 D                   G\r\nLife\'s a laugh and death\'s a joke it\'s true\r\n       Am             D\r\nYou\'ll see it\'s all a show\r\n        G               Em\r\nkeep\'em laughing as you go\r\n       Am                               D7\r\njust remember that the last laugh is on you\r\n\r\n    G      Em          Am     D7      G     Em    Am    D7\r\nAnd always look on the bright side of life\r\nG      Em          Am    D7      G      Em    Am    D7\r\nAlways look on the right side of life\r\n(Come on guys, cheer up)\r\nA      F#          Bm    E7      A     F#    Bm    E7\r\nAlways look on the right side of life\r\nA      F#          Bm    E7      A     F#    Bm    E7\r\nAlways look on the right side of life ....',176,'2021-06-03 13:00:00',NULL),
	(303,'Du skriver og spør','   E               G\r\nDu skriver og spør - Hvad der er sket\r\n       C                  Em          D\r\nJeg er blevet så underlig tør - og konkret\r\nEm                                        C\r\nHvor er den glade som sang sine sange til solens pris\r\nA7                                       D7\r\nVar han uheldig at se - eller så han mon heldigvis\r\n G                  A7 D7\r\nOk du skal få en forklaring\r\n   Em                               A7 D7\r\nDe blå øjne faldt - for en bitter erfa-ring\r\n        G\r\nJeg har prøvet alt\r\n\r\n    C                                                        E\r\nFra maltøl, vin og sodavand med whisky og tequilla, snaps og gin i\r\n      G\r\nOg martini\r\nD\r\nAlt fra apoteket, vitaminer, caroxin og ketoganer og albyler, \r\n                              G\r\nkalk og sovemedicin - og preludiner\r\nD    C   G\r\nKøbt mig gul og grøn\r\n  C                                                      E\r\nI dyre ting og tøj med svaj - og uden svag til vinter og sommer\r\n     G\r\nUden lommer\r\nD\r\nJeg har bladet blade bare for at bo lidt bedre,\r\n \r\nkøbt den smag de sagde de vidste lige var sidste nye nummer\r\n        G\r\nTil mit hummer\r\n\r\nAm7                                                  D\r\nSådan har jeg set os alle sammen prøve lykken for os selv\r\nAm7                                                      D7\r\nSet os tabe gang på gang og dog bli\' ved at spille med alligevel\r\n\r\nDu skriver og spør...\r\n\r\nJeg har siddet pænt\r\nOg kedet mig og fedtet med en finger og en pinlig pudsig glorie\r\nI historie\r\nDansk og tysk og hvabehar og spurgt for samme dumme svar: \r\nHold kæft og du skal se vi gi\'r dig alt hvad du skal ha\' ven\r\nTil eksamen\r\nSøgt og fået job \r\nOg knoklet mere end jeg sku\' det ska man da hvis ikke man vil forstyrrres\r\nEller fyres\r\nJeg har set hvordan man slides ned og smides ud \r\nnår man er blevet lidt for gammel og for langsom til teknikken\r\nPå