	(312,'Mormors kolonihavehus','Bag på cyklen hjulet snurrer \r\nFar han griner og mor hun kurer \r\nDet er fridag og vi er sammen \r\nSolen skinner over sortedammen \r\n\r\nDet var et liv i sus og dus \r\nI mormors kolonihavehus \r\nI mormors kolonihavehus \r\n\r\nHuset det er grønt, det hedder Bella Vista \r\nVandet det koger og primusen den gnistrer\r\nHaven og tapetet blomstrer rødt og grønt \r\nHim\'len er blå og livet det er skønt \r\n\r\nDet var et liv i sus og dus \r\nI mormors kolonihavehus \r\nI mormors kolonihavehus \r\n\r\nFætter Frede viser Frida, han ka\' stå på hænder \r\nValde vil også, men han taber sine tænder \r\nMormor si\'r, musik skal vi ha\' \r\nOg hun henter sin hamonika \r\n\r\n(instrumental:)\r\n\r\nSolen går ned og vi kører hjem \r\nBag byens silhuet titter stjernerne frem \r\nRådhus urits klokker slår,til tiden \r\nOg det har!e gjort mange gange sidin \r\n\r\nDet var et liv i qus og dus \r\nI mormors kolonihavehus \r\nI mormors kolonihavehus \r\n\r\nDet var et liv i sus og dus\r\nI mormors kolonihavehus \r\nI mormors kolonihavehus',183,'2021-06-08 18:00:00',NULL),
