	(314,'Rock \'n\' Roll Is King','Well, listen everybody let me tell you \'bout the Rock and Roll\r\nOh, feel that rhythm and it\'s really gonna thrill your soul\r\nCome along with me to a land of make believe\r\nShe said... Rock and Roll is king\r\n\r\nShe loves that Rock and Roll and she plays it all night long\r\nOh, that\'s all she ever tells me when I call her on the telephone\r\nShe says feel that jumpin\' beat and get up on your feet\r\nShe says... Rock and Roll is king\r\n\r\nOh let those guitars play, play for me, play for me\r\nOh let that song ring out, that\'s how it\'s meant to be\r\n\r\nWell, it rolls like a train that\'s comin\' on down the track\r\nShe rolled over Beethoven and she gave Tchaikovsky back\r\nOh, she loves that drivin\' beat, she goes dancin\' on down the street\r\nShe said... Rock and Roll is king\r\n\r\nOh, rock on\r\n\r\nOh let those guitars play, play for me, play for me\r\nOh let that song ring out, that\'s how it\'s meant to be\r\n\r\nWell, when she comes around and I\'m listenin\' to the radio\r\nShe says you can\'t do that \'cause all I wanna do is Rock and Roll\r\nNow here I\'m gonna stay where that music starts to play\r\nShe says... Rock and Roll is king\r\n\r\nOh yeah... Rock and Roll is king\r\nOoh oh... Rock and Roll is king\r\nOh yeah... Rock and Roll is king\r\nShe said... Rock and Roll is king',185,'2021-06-09 19:00:00',NULL),
	(315,'Drift Away','C                         G\r\nDay after day I\'m more confused\r\nC                 D                    G\r\nSo I look for the light in the pouring rain\r\nC                                     G\r\nYou know that\'s a game that I hate to lose\r\nAm                      C\r\nI\'m feelin\' the strain, ain\'t it a shame\r\n\r\nChorus:\r\n    G                 \r\nOh, give me the beat, boys, and free my soul\r\n  D/F#                                     C/E\r\nI wanna get lost in your rock and roll and drift away\r\n    G                 \r\nOh, give me the beat, boys, and free my soul\r\n  D                                        G\r\nI wanna get lost in your rock and roll and drift away\r\n\r\n\r\nVerse 2:\r\nBeginning to think that I\'m wastin\' time\r\nI don\'t understand the things I do\r\nThe world outside looks so unkind\r\nI\'m countin\' on you   to carry me through\r\n\r\n\r\n[repeat chorus]\r\n\r\nBridge:\r\nAm     \r\nAnd when my mind is free\r\nC                     G\r\nYou know a melody can move me\r\nAm\r\nAnd when I\'m feelin\' blue\r\nC                              D\r\nThe guitar\'s comin\' through to soothe me\r\n\r\nThanks for the joy that you\'ve given me\r\nI want you to know I believe in your song\r\nRhythm and rhyme and harmony\r\nYou help me along   makin\' me strong\r\n\r\nChorus',186,'2021-06-10 07:30:00',NULL),
	(316,'Hva´ pokker ska´ jeg gøre ?','Jeg sidder på mit kammer \r\nalt er stille og tyst, \r\nuden for begynder det \r\nså småt at blive lyst. \r\nJeg har prøvet otte timer \r\npå at skrive en sang \r\nmelodien har jeg fundet \r\nmen med teksten \r\nhar jeg kvaler gang \r\npå gang jeg bare prøver. \r\nJeg vandrer op og ned af gulvet, \r\nså det støver. \r\nHVA´ POKKER SKA´ JEG GØRE \r\nfor at løse den forbandede tekst ? \r\n\r\n \r\nMindst fyrre cigaretter \r\nhar jeg røget til nu, \r\nog fire kander kaffe \r\nhar jeg drukket, for jeg sku´ \r\ngerne finde et refrain, der \r\nslår og gi´r mig et hit, \r\nsom går lige ind i folk med \r\ntræsko på, men jeg går \r\nhelt stå hver gang, \r\njeg bare prøver \r\nJeg vandrer op og ned ad gulvet, \r\nså det støver. \r\nHVA´ POKKER SKA´ JEG GØRE \r\nfor at løse den forbandede tekst ? \r\n\r\n \r\nJeg står og mangler penge, \r\nfor min leje er høj, \r\nsnart ska´ hyren falde \r\nellers bli´r der halløj. \r\nSå´ det med at pakke klunset \r\nog få tandbørsten med. \r\nJeg må se at ta´ mig sammen \r\nog så håbe på, jeg rammer denne gang, \r\njeg bare prøver. \r\nJeg vandrer op og ned af gulvet, \r\nså det støver. \r\nHVA´ POKKER SKA´ JEG GØRE \r\nfor at løse den forbandede tekst ? \r\n\r\n \r\nNu vågner de ved siden af, \r\nså jeg går i seng. \r\nMåske ka´ jeg i drømme \r\nfinde på et refrain. \r\nJeg vil håbe, når jeg vågner, \r\nat jeg har en ide, \r\nder ka´ bruges, så jeg end´lig \r\nlangt om længe ka´ få noget sat i gang, \r\njeg bare prøver. \r\nJeg vandrer op og ned af gulvet, \r\nså det støver. \r\nHVA´ POKKER SKA´ JEG GØRE \r\nfor at løse den forbandede tekst ?',83,'2021-06-10 20:00:00',NULL),
	(317,'All I want is you','You say you want diamonds on a ring of gold\r\nYou say you want your story to remain untold.\r\nAll the promises we make\r\nFrom the cradle to the grave\r\nWhen all I want is you.\r\n\r\nYou say you\'ll give me a highway with no-one on it\r\nTreasure, just to look upon it\r\nAll the riches in the night.\r\n\r\nYou say you\'ll give me eyes in the moon of blindness\r\nA river in a time of dryness\r\nA harbour in the tempest.\r\nAll the promises we make, from the cradle to the grave\r\nWhen all I need is you.\r\n\r\nYou say you want your love to work out right\r\nTo last with me through the night.\r\n\r\nYou say you want diamonds on a ring of gold\r\nYour story to remain untold\r\nYour love not to grow cold.\r\nAll the promises we break, from the cradle to the grave\r\nWhen all I want is you.',60,'2021-06-11 08:30:00',NULL),
