	(319,'It\'s After Dark','I\'m looking at the sky, I\'m trying \r\nNot to cry, coz\' it\'s over \r\nThe\'re turning down the light \r\nIt\'s late now \r\nWave the last \r\nGoodbye... \r\n\r\nCoz it\'s after dark now \r\nAnd Disneyland is closed \r\nWe\'ve been served \r\nIcecold beer \r\nAnd Walt is our host \r\n\r\nIt\'s after dark now \r\nAnd Disneyland is closed... \r\nThe party is over \r\nThe night is here \r\nLet\'s bring out a toast... ',167,'2021-06-12 09:30:00',NULL),
	(320,'Coffee Ville','Vers 1:\r\nTexas solen brænder \r\npå Johnsons varme colt\r\nHan har kun den ene \r\nden anden har han solgt\r\n\r\nHan køber et partroner\r\nog tar til Coffee Ville\r\nfor at møde Molly\r\npræriens bedste sild\r\n\r\nMen hun er skudt i Stetson\r\nog han er ikke kold\r\nI coffee Ville er klokken blevet 12\r\n\r\nVers 2:\r\nInde i salonen\r\nved et poker bord\r\nSer man Dusty Johnson\r\nsidde og spille stor\r\n\r\nHan kan drikke Whiskey\r\nmed den ene hånd\r\nMens han drikker Whiskey\r\nmed den anden hånd\r\n\r\nMen en regning skal betales\r\nog han er klar om lidt\r\nI coffee Ville er klokken blevet 1\r\n\r\nBridge:\r\nFørhen var de venner \r\nog gik med samme hat\r\nholdt hinandens hænder \r\ni den mørke nat\r\nMen Molly kom imellem\r\nfor det lever hun af\r\nog derfor skal de mødes i Coffee Ville i dag\r\n\r\nVers 3:\r\nPludselig siger Molly\r\nsikke noget pjat\r\nHer er en hånd at holde i\r\nog på med jeres hat\r\n\r\nDe sætter sig i haven\r\nved et lejrbål\r\nog hullerne i maven \r\nblir fyldt med stegte ål\r\n\r\nSå fik de begge Molly\r\nog enden den var go\r\nI coffee Ville er klokken blevet 2',77,'2021-06-12 22:00:00',NULL),
	(321,'Vågner i natten','Ligger du alene nu\r\ndet håber jeg du gør\r\ndrømmer et par drømme\r\njeg ka li\'.\r\n\r\nGlemmer jeg dig aldrig mer\'\r\nglemmer du mon mig\r\nvar vi fra de tider\r\nog alt nu helt forbi.     \r\n\r\nDu sidder på min sengekant\r\ndu sidder i min krop\r\nmærker at du banker\r\nbanker i mit blod\r\nmon du har det lissom mig?\r\n\r\nVågner i natten\r\nvågner af en drøm           \r\njeg savner dig at snakke med og dig at holde om\r\nfor det har regnet på mit vindue\r\ndryppet på min kind\r\nuh, jeg ville gøre alt\r\nom igen\r\nog om og om igen.\r\n\r\nDu gav mig al din kærlighed\r\ngav mig dine håb\r\nlængsler der var inde\r\ni din krop.\r\n\r\nOg du kom altid hen til mig\r\nnår du havde lyst\r\nstilled\' du mon sulten\r\nmens jeg fik slukket tørst\r\nmon du har det lissom mig?\r\n\r\nVågner i natten.....\r\n\r\nHold mig til regnen holder op\r\ndu ved det bedste her i verden\r\nsker med dig\r\nog kun dig.\r\n\r\nFinder jeg dig aldrig mer\'\r\nfinder du mon mig\r\nlænges efter tider\r\nhvor tiden gik med dig\r\nmon du har det lissom mig?\r\n\r\nVågner i natten......\r\n',188,'2021-06-13 10:30:00',NULL),
	(322,'Bag Duggede Ruder','           C\r\nFør jeg ku gi \r\n                         F\r\nFør jeg ku skænke dig en tanke\r\n      Dm \r\nog en krop som langt om længe \r\n                                     G\r\ntog sig sammen til at elske lidt med livet \r\n\r\n          C\r\nKunne jeg se\r\n                        F\r\nKunne jeg se dit hjerte banke\r\n      Dm\r\nunder bryster som forlængst var blevet taget \r\n                   G\r\naf alle mulige for givet \r\n\r\n    C\r\nJeg vented lange nætter \r\n       G\r\ni dine kolde stuer \r\n       Eb\r\nbrændt varm i hvert et blik \r\n         Bb\r\nfra dine duggede ruder \r\n          F\r\nfra altid duggede ruder\r\n\r\n\r\nFør jeg ku tro \r\nFør jeg ku tro på mine løgne \r\nog en sandsynligvis korrekt beregning \r\nover livets gang før det var gået \r\nSå jeg ind, helt ind i dine øjne \r\nog forsvandt i et svimlende styrt \r\nhvor bunden endnu ikke er nået \r\n\r\nJeg varmer stadig kroppen \r\ni dine kolde stuer \r\nbrændt fast af frygt for udsynet \r\nbag duggede ruder\r\n\r\n',189,'2021-06-13 23:00:00',NULL),
	(323,'Be bab a lu la','Be Babalula\r\nVi elsker disse kolde københavnske nætter \r\nså højt som vi elsker os selv \r\nse hvor venlige alle smiler \r\nse hvor følsomt vi sammen slår tiden ihjel \r\n\r\nOg nogen brækker sig af glæde over livet \r\ni det nærmeste havnebassin \r\nmens andre morer sig lidt mere diskret \r\nsnakker verdensfjernt om det rene ingenting \r\n\r\nInd til byen, hjem igen og tra la la la \r\nop til baren, ned igen og hva vil du ha? \r\nhen til dig og væk igen og tra la la la \r\nbegejstringen vil ingen ende ta \r\n\r\nBe bab a lu la (she´s my baby?) \r\nop og ned af strøget og hva var det, du sagde? \r\nDet er fuld fart frem uden at se sig tilbage \r\ndet er bevægelse på stedet det er be bab a lu la \r\nDet er spil for galleriet, det er utrolig godt gået \r\ndet er film for millioner og hva vil du ha! \r\n\r\nInd til byen, hjem igen og tra la la la \r\nop til baren, ned igen og hva vil du ha? \r\nhen til dig og væk igen og tra la la la \r\nbegejstringen vil ingen ende ta \r\n\r\nOg der står du og ser dig selv i øjnene \r\ndrømmer om den helt store kærlighed \r\nmens andre veloplagte og med stor rutine \r\nkeder sig, og gaber kæben af led \r\n\r\nBe bab a lu la (she´s my baby?) \r\nop og ned af strøget og hva var det, du sagde? \r\nDet er fuld fart frem uden at se sig tilbage \r\ndet er bevægelse på stedet det er be bab a lu la \r\nDet er spil for galleriet, det er utrolig godt gået \r\ndet er film for millioner og hva vil du ha! \r\nDet er billed uden lyd, det er lyd uden ord \r\ndet er ord uden mening, det er be bab a lu la\r\n',189,'2021-06-14 11:30:00',NULL),
	(324,'Beautyfull ones','Verse 1:\r\nC                   D7\r\nHigh on diesel and gasoline,\r\n           Fmaj7\r\nPsycho for drum machine\r\n              E           G\r\nShaking their bits to the hits\r\n\r\n\r\nVerse 2:\r\nDrag acts, drugs and suicudes\r\nIn your dad\'s suits you hide\r\nStaining his name again\r\n\r\n\r\nVerse 3:\r\nCracked up, shacked up, 22\r\nPsycho for sex and glue\r\nLost it Bostick, yeah\r\n\r\n\r\nVerse 4:\r\nShaved heads, raves heads, on the pill\r\nGot too much time to kill\r\nGet into bands and gangs\r\n\r\n\r\nChorus:\r\nC                   Em\r\nHere they come, the beautiful ones\r\n    F               G\r\nThe beautiful ones\r\n\r\n\r\nVerse 5:\r\nLoved up, doved up, hung around,\r\nStoned in a lonely town\r\nShaking their meat to the beat\r\n\r\n   [verse 1]\r\n   [chorus]\r\n\r\n\r\nBridge:\r\n                 C\r\nYou don\'t think about it\r\n                 Em\r\nYou don\'t do without it\r\n               F          G\r\nBecause you\'re beautiful\r\n            C            Em\r\nAnd If your baby\'s going crazy     }\r\n               F                   }x3\r\nThat\'s how you made me             }\r\n\r\n   [\'la, la, la....\' to verse chords - fade out]\r\n',175,'2021-06-15 00:00:00',NULL),
	(325,'Trash','Maybe, maybe it\'s the clothes we wear,\r\nThe tasteless bracelets and the dye in our hair,\r\nMaybe it\'s our kookiness,\r\nOr maybe, maybe it\'s our nowhere towns,\r\nOur nothing places and our cellophane sounds,\r\nMaybe it\'s our looseness,\r\n\r\nBut we\'re trash, you and me,\r\nWe\'re the litter on the breeze,\r\nWe\'re the lovers on the streets,\r\nJust trash, me and you,\r\nIt\'s in everything we do,\r\nIt\'s in everything we do...\r\n\r\nMaybe, maybe it\'s the things we say,\r\nThe words we\'ve heard and the music we play,\r\nMaybe it\'s our cheapness,\r\nOr maybe, maybe it\'s the times we\'ve had,\r\nThe lazy days and the crazes and the fads,\r\nMaybe it\'s our sweetness,\r\n\r\nBut we\'re trash, you and me,\r\nWe\'re the litter on the breeze,\r\nWe\'re the lovers on the street,\r\nJust trash, me and you,\r\nIt\'s in everything we do,\r\nIt\'s in everything we do...\r\n',175,'2021-06-15 12:30:00',NULL),
	(326,'Så længe jeg lever','(Omkvæd)\r\n   G         C\r\nSå længe jeg lever\r\nG            D7\r\nså længe mit hjerte slår\r\n   C     D7            G    D7\r\nså længe vil jeg elske dig\r\nG            C\r\nmen du er en rullesten\r\nG           D\r\ndu har ikke nok i én\r\nC            D7          G    D7\r\nderfor må du gå din egen vej\r\n\r\n\r\nG                       D\r\nDu si\'r du har en anden ven\r\n                  D7                    G\r\nhvad jeg frygted\' mest, er hændt mig nu igen\r\n                    G7\r\ndu fortæller li\'som sidst\r\n            C           Cm\r\nat det\' den store kærlighed\r\n G\r\nokay, min blomst\r\n  D               G      D7\r\nbehold ham blot i fred\r\n\r\n\r\n(Omkvæd)\r\n\r\n\r\nAt tiden læger alle sår\r\nsi\'r de vise mænd, jeg håber de forstår\r\nhvad de taler om\r\njeg tror det næppe\r\nsimpelthen fordi\r\nde aldrig prøved\' dette helt forbi\r\n\r\n\r\n(Omkvæd)',83,'2021-06-16 01:00:00',NULL),
	(327,'Across the universe','D Dmaj7 A\r\n\r\nD                 Dmaj7              F#m            \r\nWords are flowing out like endless rain into a paper cup\r\n     Em7                                 A                 A7\r\nThey slither while they pass, they slip away across the universe \r\nD                 Dmaj7             F#m               \r\nPools of sorrow, waves of joy are drifting through my opened mind\r\n   Em7           Gm\r\nPossessing and caressing me \r\n\r\nCHORUS:\r\nD             Em7/A\r\nJai Guru Deva Om \r\nA7\r\nNothing\'s gonna change my world\r\nG/D                       D\r\nNothing\'s gonna change my world \r\nA7    \r\nNothing\'s gonna change my world\r\nG                         D\r\nNothing\'s gonna change my world \r\n\r\n   D       Dmaj7               F#m\r\nImages of broken light which dance before me like a million eyes\r\n Em7                      A          A7\r\nThey call me on and on across the universe\r\n   D              Dmaj7           F#m \r\nThoughts meander like a restless wind inside a letterbox\r\n       Em7                              A              A7\r\nThey tumble blindly as they make their way across the universe \r\n...CHORUS \r\n\r\n  D                   Dmaj7              F#m\r\nSounds of laughter, shades of earth are ringing through my opened ears\r\n   Em7          Gm\r\nInciting and inviting me\r\n  D          Dmaj7             F#m                            Em7 \r\nLimitless undying love which shines around me like a million suns\r\n                         A          A7\r\nAnd calls me on and on across the universe \r\n...CHORUS \r\n\r\nD\r\nJai Guru Deva   (Repeat)',6,'2021-06-16 13:30:00',NULL),
	(328,'Born in the U.S.A.','Born down in a dead man\'s town\r\nThe first kick I took was when I hit the ground\r\nYou end up like a dog that\'s been beat too much\r\nTill you spend half your life just covering up\r\n\r\nBorn in the U.S.A.\r\nI was born in the U.S.A.\r\nI was born in the U.S.A.\r\nBorn in the U.S.A.\r\n\r\nGot in a little hometown jam\r\nSo they put a rifle in my hand\r\nSent me off to a foreign land\r\nTo go and kill the yellow man\r\n\r\nBorn in the U.S.A.\r\nI was born in the U.S.A.\r\nI was born in the U.S.A.\r\nI was born in the U.S.A.\r\nBorn in the U.S.A.\r\n\r\nCome back home to the refinery\r\nHiring man says \"Son if it was up to me\"\r\nWent down to see my V.A. man\r\nHe said \"Son, don\'t you understand\"\r\n\r\nI had a brother at Khe Sahn fighting off the Viet Cong\r\nThey\'re still there, he\'s all gone\r\n\r\nHe had a woman he loved in Saigon\r\nI got a picture of him in her arms now\r\n\r\nDown in the shadow of the penitentiary\r\nOut by the gas fires of the refinery\r\nI\'m ten years burning down the road\r\nNowhere to run ain\'t got nowhere to go\r\n\r\nBorn in the U.S.A.\r\nI was born in the U.S.A.\r\nBorn in the U.S.A.\r\nI\'m a long gone Daddy in the U.S.A.\r\nBorn in the U.S.A.\r\nBorn in the U.S.A.\r\nBorn in the U.S.A.\r\nI\'m a cool rocking Daddy in the U.S.A.\r\n',71,'2021-06-17 02:00:00',NULL),
	(330,'Refrainet er frit','A\r\nVi er vist mange i det ganske land\r\n\r\nder plasker rundt så godt vi kan\r\nE\r\ni byer fyldt med romantik\r\n          A\r\nog vild panik.\r\n\r\nA\r\nVi lever livet på må og få\r\n\r\nog jager det som vi ikke ka nå\r\nE\r\nog har du penge ka du få\r\n                   A\r\nhar du ingen ka du gå. Ja du kan, ja du kan.\r\n\r\nD                       E\r\nSå når jeg synger denne sang for dig\r\nD                   E\r\nså er det for at fortælle dig\r\n   C\r\nat livet er kort\r\n   D\r\nog lykken er slidt\r\n    E\r\nmen skide vær\' med det\r\n\r\nfor refrainet er frit.\r\n\r\n   A\r\nÅh lorlei\r\n            E\r\nde ka rende mig\r\n      A\r\nåh lorlei\r\n                  E\r\nmed deres gøgl og gejl\r\n             D                E\r\nfor jeg blev født på en sommernat\r\n  D              E\r\ni sprællemandens tegn.\r\n\r\nVi dyrker kvinder og kærlighed\r\ni denne verden af krig og fred\r\nvi siger til os selv at det nok ska gå.\r\n\r\nMen af og til så er det bare løgn\r\nde skød et gidsel sidste døgn\r\nja denne verden er beskidt\r\ndu ka\' se det sort på hvidt.\r\n\r\n',89,'2021-06-17 14:30:00',NULL),
	(331,'Det er en kold tid','          G    D   A            D\r\nDet er en kold tid som vi lever i\r\nG        D        A  D\r\nalle går rundt og fryser\r\n        G   D      A          D\r\nmen jeg har det da nogenlunde her\r\nA               D\r\nher på Østre Gasværk.\r\n\r\nD                A\r\nDer\' mange mange drømme\r\n     D            A\r\nder\' røget sig en tur\r\n        D             A\r\nmen jeg ka\' da stadig grine\r\nA\r\nnår jeg sidder helt alene\r\n                       D\r\nhelt alene i mit lille skur.\r\n\r\n\r\nDet er en kold tid som vi lever i\r\nalle går rundt og fryser\r\nmen jeg har det da nogenlunde her\r\nher på Østre Gasværk.\r\n\r\nJeg har ikke nogen penge\r\nog ikke noget job\r\ndet har været sådan længe\r\nGu\' ved om det nogensinde\r\nnogensinde holder op.\r\n\r\nMen jeg har da Lange Lone\r\nog hun spiller violin\r\nog når nerverne de klikker\r\nså drikker vi en lille flaske\r\nlille flaske brændevin.\r\n\r\nFor det\' en kold tid som vi lever i\r\nalle går rundt og fryser\r\nmen jeg har det da nogenlunde her\r\nher på Østre Gasværk.\r\n',79,'2021-06-18 03:00:00',NULL),
	(332,'I kan ikke slå os ihjel','      A\r\nI har slået med knipler\r\n      C#m\r\nI har truet med våben\r\n      F#m\r\nI har prøvet at stoppe\r\n      E\r\nJeres egne børns råben\r\n      D\r\nI kan komme med hjelme\r\n   A\r\nOg hule paragraffer\r\n      Hm\r\nMen I burde snart ku\' indse\r\n              E\r\nAt det er jer selv I straffer\r\n\r\n      A\r\nI ka\' ikke slå os ihjel\r\n      C#m\r\nI ka\' ikke slå os ihjel\r\n      F#m\r\nI ka\' ikke slå os ihjel\r\n         E\r\nVi er en del af jer selv\r\n\r\nI holder på magten\r\nOg støtter det I kender\r\nI kæmper jeres kampe\r\nFor at vinde nye stemmer\r\nLåser vore døre\r\nMed sikkerhedskæder\r\nVi er mennesker som lever\r\nLer og kæmper mens vi græder\r\n\r\nI ka\' ikke slå os ihjel\r\nI ka\' ikke slå os ihjel\r\nI ka\' ikke slå os ihjel\r\nVi er en del af jer selv\r\n\r\nI kan sætte os i fængsel\r\nOg fjerne os fra verden\r\nI kan sætte detektiver\r\nTil at følge vores færden\r\nI kan splitte alt med bomber\r\nLægge hele verden øde\r\nEr det os eller det jer selv\r\nI er bange for at møde\r\n\r\nI ka\' ikke slå os ihjel\r\nI ka\' ikke slå os ihjel\r\nI ka\' ikke slå os ihjel\r\nVi er en del af jer selv',190,'2021-06-18 15:30:00',NULL),
	(333,'You Oughta Know','F#m                     B\r\nI want you to know that I\'m happy for you.\r\nF#m                    B\r\nI wish nothing but the best for you both.\r\n        F#m\r\nAnother version of me;\r\n\r\nIs she preverted like me?\r\n             B\r\nWould she go down on you in a theatre?\r\n               F#m\r\nDoes she speak eloquently?\r\n\r\nAnd would she have your baby?\r\n               B\r\nI\'m sure she\'d make a really excellent mother.\r\n\r\nF#m\r\n\'Cause the love that you gave that we made\r\n                                            B\r\nwasn\'t able to make it enough for you to be open wide. No,\r\n    F#m\r\nand everytime you speak her name\r\n                 \r\ndoes she know how you told me you\'d hold me\r\n          B\r\nuntil you died? `Til you died,\r\n\r\nbut you\'re still alive.\r\n\r\n        F#        E\r\nAnd I\'m here to remind you\r\n       A                      B\r\nof the mess you left when you went away.\r\n         F#        E\r\nIt\'s not fair to deny me\r\n       A                     B\r\nof the cross I bare that you gave to me.\r\n\r\nYou, you, you oughta know.\r\n\r\n\r\nYou seem very well. Things look peaceful.\r\nI\'m not quite as well. I thought you should know.\r\nDid you forget about me Mr. Duplicity?\r\nI hate to bug you in the middle of dinner.\r\nIt was a slap in the face how quickly I was replaced,\r\nand are you thinking of me when you fuck her?\r\n\r\nCause the love that you gave that we made\r\nwasn\'t able to make it enough for you to be open wide. No,\r\nand everytime you speak her name\r\ndoes she know how you told me you\'d hold me\r\nuntil you died? `Til you died,\r\nbut you\'re still alive.\r\n\r\nVers uden sang.\r\n\r\nCause the joke that you laid in the bed that was me,\r\nand I\'m not gonna fade\r\nas soon as you close your eyes, and you know it.\r\nAnd everytime I scratch my nails down someone else\'s back\r\nI hope you feel it. Can you feel it?',191,'2021-06-19 04:00:00',NULL),
	(334,'Wanted Man','Wanted man in California,\r\nWanted man in Buffalo\r\nWanted man in Kansas City,\r\nWanted man in Ohio\r\n\r\nWanted man in Mississippi,\r\nWanted man in ol\' Cheyenne\r\nWherever you might look tonight \r\nyou might see this wanted man\r\n\r\nI might be in Colorado,\r\nOr Georgia by the sea\r\nWorking for some man who may not know at all who I might be\r\n\r\nIf you ever see me coming and if you know who I am\r\nDon\'t you breathe it to nobody \'cause you know I\'m on the lamb\r\n\r\nWanted man by Lucy Watson,\r\nWanted man by Jeannie Brown\r\nWanted man by Nellie Johnson,\r\nWanted man in this next town\r\n\r\nI\'ve had all that I wanted of a lot of things I\'ve had\r\nAnd a lot more than I needed of some things that turned out bad\r\n\r\nI got sidetracked in El Paso,\r\nStopped to get myself a map\r\nWent the wrong way in Pleura with Juanita on my back\r\n\r\nWent to sleep in Shreveport,\r\nWoke up in Abilene\r\nWonderin\' why I\'m wanted at some town half way in between\r\n\r\nWanted man in Albuquerque,\r\nWanted man in Syracuse\r\nWanted man in Tallahassee,\r\nWanted man in Baton Rouge\r\n\r\nThere\'s somebody set to grab me \r\nAnywhere that I might be\r\nAnd wherever you might look tonight \r\nYou might get a glimpse of me\r\n\r\nWanted man in California,\r\nWanted man in Buffalo\r\nWanted man in Kansas City,\r\nWanted man in Ohio\r\n\r\nWanted man in Mississippi,\r\nWanted man in ol\' Cheyenne\r\nWherever you might look tonight \r\nyou might see this wanted man ',64,'2021-06-19 16:30:00',NULL),
	(335,'Dont take your guns to town','A young cowboy named Billy Joe \r\ngrew restless on the farm\r\nA boy filled with wanderlust\r\nwho really meant no harm\r\nHe changed his clothes and shined his boots\r\nAnd combed his dark hair down\r\nAnd his mother cried as he walked out;\r\n\r\nRefrain:\r\nDon\'t Take Your Guns To Town, son\r\nLeave your guns at home, Bill\r\nDon\'t Take Your Guns To Town\r\n\r\nHe sang a song as on he rode,his guns hung at his hips\r\nHe rode into a cattle town, a smile upon his lips\r\nHe stopped and walked into a bar and laid his money down\r\nBut his mother\'s words echoed again;\r\n\r\nRefrain:\r\nHe drank his first strong liquor then to calm his shaking hand\r\nAnd tried to tell himself at last he had become a man\r\nA dusty cowpoke at his side began to laugh him down\r\nAnd he heard again his mother\'s words\r\n\r\nRefrain:\r\nBill was raged and Billy Joe reached for his gun to draw\r\nBut the stranger drew his gun and fired before he even saw\r\nAs Billy Joe fell to the floor the crowd all gathered \'round\r\nAnd wondered at his final words;\r\n\r\n\r\n',64,'2021-06-20 05:00:00',NULL),
	(336,'Help me make it through the night','Take the ribbon from my hair\r\nShake it loose and let it fall\r\nLayin\' soft against your skin\r\nLike the shadow on the wall\r\n\r\nCome and lay down by my side\r\nTill the early mornin\' light\r\nAll I\'m takin\' is your time\r\nHelp me make it through the night\r\n\r\nI don\'t care what\'s right or wrong\r\nI won\'t try to understand\r\nLet the devil take tomorrow\r\nLord, tonight I need a friend\r\n\r\nYesterday is dead and gone\r\nAnd tomorrow\'s out of sight\r\nAnd it\'s sad to be alone\r\nHelp me make it through the night\r\n\r\n[ humming of a verse ]\r\n\r\nYesterday is dead and gone\r\nAnd tomorrow\'s out of sight\r\nAnd it\'s sad to be alone\r\nHelp me make it through the night\r\n\r\nI don\'t want to be alone\r\nHelp me make it through the night\r\n',192,'2021-06-20 17:30:00',NULL),
	(337,'Pink Cadillac','Well now you may think I\'m foolish, for the foolish things I do,\r\nYou may wonder how come I love ya, when you get on my nerves like you do,\r\nWell baby you know you bug me, there ain\'t no secret \'bout that,\r\nBut come on over here and hug me, baby I\'ll spell the facts,\r\nWell honey it ain\'t your money, \'cause baby I\'ve got plenty of that,\r\n\r\nI love you for your pink Cadillac,\r\nCrushed velvet seats,\r\nRidin\' in the back,\r\nCruisin\' down the street,\r\nWavin\' to the girls,\r\nPeelin\' outta sight,\r\nSpendin\' all my money on a Saturday night,\r\nHoney I just wonder what you do there in the back of your\r\nPink Cadillac, Pink Cadillac.\r\n\r\nWell now way back in the bible, temptations always come along,\r\nThere\'s always somebody tempted, somebody into doing,\r\nSomething that they know is wrong.\r\nThey\'ll tempt you man with silver, and they\'ll tempt you sir with gold,\r\nAnd they\'ll tempt you with the pleasures, that the flesh does surely hold.\r\nThey say Eve tempted Adam with an apple, but now I ain\'t goin\' for that...\r\n\r\nI know it was a Pink Cadillac\r\nCrushed velvet seats,\r\nRidin\' in the back,\r\nCruisin\' down the street,\r\nWavin\' to the girls,\r\nPeelin\' outta sight,\r\nSpendin\' all my money on a Saturday night,\r\nHoney I just wonder what you do there in the back of your\r\nPink Cadillac, Pink Cadillac.\r\n\r\nWell now some folks say that it\'s too big, uses too much gas,\r\nSome folks say it\'s too old, and it goes too fast,\r\nBut my love is better in a Honda, yeah it\'s better in a Subaru,\r\nAnd there is only one thing, only one car that\'ll do,\r\nAnyway, we don\'t have to drive it, honey we can park it out back,\r\n\r\nAnd have a party in you Pink Cadillac,\r\nCrushed velvet seats,\r\nRidin\' in the back,\r\nCruisin\' down the street,\r\nWavin\' to the girls,\r\nPeelin\' outta sight,\r\nSpendin\' all my money on a Saturday night,\r\nHoney I just wonder what you do there in the back of your\r\nPink Cadillac, Pink Cadillac.\r\n\r\n',71,'2021-06-21 06:00:00',NULL),
	(340,'Thorn In My Side','D     G      A\r\n\r\nD                                 G                A\r\nThorn in my side, you know that\'s all you ever were\r\nD                                  G                  A\r\n\"A bundle of lies, you know that\'s all that it was worth\r\nD                   C               G                A\r\nI should have known better, but I trusted you at first\r\nBb                  F             Bb                G\r\nI should have known better, but I got what I deserve\r\nG                                        \r\nUh oh uh oh uh oh uh oh,(uh oh uh oh uh oh uh oh)\r\nG                      C\r\nUh oh uh oh uh oh uh oh\r\n\r\n   F                   C\r\nTo run away from you (run, run, run, run)\r\n   G                    C\r\nIs all that I could do (run, run, run, run)\r\n   F                  C\r\nTo run away from you (run, run, run, run)\r\n   G                     C\r\nIs all that I could do (run, run, run, run)\r\n   F                   C\r\nTo run away from you (run, run, run, run)\r\n   G                     C\r\nIs all that I could do (run, run, run, run)\r\n   F                   C\r\nTo run away from you (run, run, run, run)\r\n   A                D\r\nIs all that I could do\r\n\r\n\r\nD G A D G A\r\n\r\nThorn in my side, you know that\'s all you\'ll ever be\r\nSo don\'t think you know better, \'cause that\'s what you mean to me\r\nI was feeling complicated, I was feeling \"alone\"\r\nEvery time I think of you, I shiver to the bones\r\nUh oh uh oh uh oh uh oh, (uh oh uh oh uh oh uh oh)\r\nUh oh uh oh uh oh uh oh\r\n\r\nTo run away from you (run, run, run, run)\r\nIs all that I could do (run, run, run, run)\r\nTo run away from you (run, run, run, run)\r\n\r\n    A   Bb   F   Bb   F   Bb   F   Bb   G\r\n    C  F  C  G  C  repeat\r\n\r\nending\r\n\r\nTo run away from you (run, run, run, run)\r\nIs all that I could do (run, run, run, run)  (repeat and fade)',107,'2021-06-21 18:30:00',NULL),
	(341,'Hella Good','The waves keep on crashing on me for some reason\r\nBut your love keeps on coming like a thunderbolt\r\nCome here a little closer\r\n\'Cause I wanna see you, baby, real close up\r\n(Get over here) \r\n\r\n\r\nYou\'ve got me feeling hella good \r\nSo let\'s just keep on dancing\r\nYou hold me like you should \r\nSo I\'m gonna keep on dancing\r\n\r\n\r\nYour performance deserving a standing ovation\r\nAnd who would have thought it\'d be the two of us\r\nSo don\'t wake me if I\'m dreaming\r\n\'Cause I\'m in the mood come on and give it up\r\n\r\n\r\nYou\'ve got me feeling hella good \r\nSo let\'s just keep on dancing\r\nYou hold me like you should \r\nSo I\'m gonna keep on dancing\r\nYou\'ve got me feeling hella good \r\nSo let\'s just keep on dancing\r\nYou hold me like you should \r\nSo I\'m gonna keep on dancing\r\n\r\n\r\nGuitar Solo Wah Sound\r\n\r\n\r\nYou\'ve got me feeling hella good \r\nSo let\'s just keep on dancing\r\nYou hold me like you should \r\nSo I\'m gonna keep on dancing\r\nYou\'ve got me feeling hella good \r\nSo let\'s just keep on dancing\r\nYou hold me like you should \r\nSo I\'m gonna keep on dancing\r\n\r\nKeep on dancing\r\nKeep on dancing',193,'2021-06-22 07:00:00',NULL),
