	(344,'Come Into My World','Come, come, come into my world\r\nWon\'t you lift me up, up, high upon your love\r\n\r\nTake these arms that were made for lovin\'\r\nAnd this heart that will beat for two\r\nTake these eyes that were meant for watching over you\r\nAnd I\'ve been such a long yime waiting\r\nFor someone I can call my own\r\nI\'ve been chasing the life I\'m dreaming\r\nNow I\'m home\r\n\r\nI need your love\r\nLike night needs morning\r\n\r\nCome, come, come into my world\r\nWon\'t you lift me up, up, high upon your love\r\n\r\nNa na na na\r\n\r\nTake these lips that were made for kissing\r\nAnd this heart that will see you through\r\nAnd these hands that were made to touch and\r\nfeel you\r\n\r\nSo free your love\r\nHear me I\'m calling\r\n\r\nOh won\'t you\r\nCome, come, come into my world\r\nWon\'t you lift me up, up, high upon your love\r\n\r\nI need your love\r\nLike night needs morning\r\n\r\nOh won\'t you\r\nCome, come, come into my world\r\nWon\'t you lift me up, up, high upon your love',116,'2021-06-23 08:00:00',NULL),
	(345,'Papa Was a Rolling Stone','It was the third of September.\r\nThat day I\'ll always remember, yes I will.\r\n\'Cause that was the day that my daddy died.\r\nI never got a chance to see him.\r\nNever heard nothing but bad things about him.\r\nMama, I\'m depending on you to tell me the tuth.\r\n\r\nAnd Mama just hung her head and said,\r\n\"Son, Papa was a rolling stone.\r\nWherever he laid his hat was his home.\r\n(And when he died) All he left us was alone.\"\r\n\"Papa was a rolling stone, my son.\r\nWherever he laid his hat was his home.\r\n(And when he died) All he left us was alone.\"\r\n\r\nWell, well\r\n\r\nHey Mama, is it true what they say, \r\nthat Papa never worked a day in his life?\r\nAnd Mama, some bad talk going around town \r\nsaying that Papa had three outside children and another wife.\r\nAnd that ain\'t right.\r\nHey, talk about Papa doing some store front preaching.\r\nTalked about saving souls and all the time leaching.\r\nDealing in debt and stealing in the name of the Lord.\r\n\r\nMama just hung her head and said,\r\n\"Papa was a rolling stone, my son.\r\nWherever he laid his hat was his home.\r\n(And when he died) All he left us was alone.\"\r\n\"Hey, Papa was a rolling stone.\r\nWherever he laid his hat was his home.\r\n(And when he died) All he left us was alone.\"\r\n\r\nUgh\r\n\r\nHey Mama, I heard Papa called himself a jack of all trades.\r\nTell me is that what sent Papa to an early grave?\r\nFolks say Papa would beg, borrow, steal to pay his bills.\r\nHey Mama, folks say that Papa was never much on thinking.\r\nSpent most of his life chasing women and drinking.\r\nMama, I\'m depending on you to tell me the truth.\r\n\r\nAnd Mama looked up with a tear in her eye and said,\r\n\"Son, Papa was a rolling stone. (Well, well, well, well)\r\nWherever he laid his hat was his home.\r\n(And when he died) All he left us was alone, lone, lone, lone, alone.\"\r\n\"Papa was a rolling stone.\r\nWherever he laid his hat was his home.\r\n(And when he died) All he left us was alone.\"\r\n\r\n\"I said, Papa was a rolling stone. Wherever he laid his hat was his home.\r\n(And when he died) All he left us was alone.\"',196,'2021-06-23 20:30:00',NULL),
