	(357,'På Banen (Derudaf)','Vi drøner gennem land og by\r\nvi er på banerne på ny\r\nvi kører hundred kilometer i timen\r\nderudaf.\r\n\r\nOg solen blinker i mit bakspejl\r\nog bag mig snesevis af horn der tuder\r\nder tuder, der tuder.\r\n\r\nVi er på hovedvejen om lidt\r\nog den skal ikke ha\' for lidt\r\nvi trykker sømmet i bund og drøner\r\nderudaf.\r\n\r\nTiden står stille på vejen\r\nmen tænk hvis vi mødes på stregen.\r\n\r\nSå er det op på bremsen igen\r\nfor der er rødt min fine ven\r\nmen det bli\'r grønt igen så vi kan komme\r\nderudaf.\r\n\r\nVi svinger helt helt ud til venstre\r\nog overhaler behændigt en svensker\r\nen svensker, en svensker.\r\n\r\nVi mærker suget fra en bus\r\nsom havde tændt det store blus\r\nmen blænded ned igen, så vi ku\' se\r\nderudaf.\r\n\r\nTiden står stille på vejen\r\nmen tænk hvis vi mødes på stregen.\r\n\r\nVi holder på en tankstation\r\nog fylder op til explosion\r\nvi får en røg og en mokka og så igen\r\nderudaf.\r\n\r\nOg i et hav af lys der blinker\r\nder står der pludselig en blaffer og vinker.\r\n\r\nVi suser over en bakketop\r\nog ser at månen er stået op\r\nden sejler med os de sidste timer\r\nderudaf.\r\n\r\nTiden står stille på vejen\r\nmen tænk hvis vi mødes på stregen.',89,'2021-06-29 14:00:00',NULL),
