	(360,'Ese Hombre','Ese hombre que tu vez ahi\r\nQue parece tan galante \r\nTan atento y arogante \r\nLo conozco como ami \r\n\r\nEse hombre que tu vez ahi \r\nQue aparente ser divino \r\nTan Amable y efusivo \r\nSolo sabe hacer sufriri \r\n\r\nEs un gran necio \r\nUn estupido engreido \r\nEgoista y caprichoso \r\nUn payaso vanidoso \r\nInconciente y presumido \r\nFalso Malo rencoroso \r\nQue no tiene Corazon \r\n\r\nLleno de celos sin razones ni motivos \r\nComo el viento impetuoso \r\nPocas vezes carinoso \r\nInseguro de si mismo \r\nInsoportable como amigo \r\nInsufrible como amor \r\n\r\nEse Hombre que tu vez ahi \r\nQue parece tan amable \r\nVanidoso y agradable \r\nLo conozco como ami \r\n\r\nEse hombre que tu vez ahi \r\nQue parece tan seguro \r\nDe pisar bien por el mundo \r\nSolo sabe hacer sufrir \r\n\r\nEs un gran necio \r\nUn estupido engreido \r\nEgoista y caprichoso \r\nUn payaso vanidoso \r\nInconciente y presumido\r\nFalso Malo rencoroso \r\nQue no tiene Corazon \r\n\r\nLleno de celos sin razones ni motivos \r\nComo el viento impetuoso \r\nPocas vezes carinoso \r\nInseguro de si mismo \r\nInsoportable como amigo \r\nInsufrible como amor \r\nMe enganaste con traicion tu no tienes corazon \r\n\r\nSolo sabe hacer sufrir \r\nTu no tienes corazon \r\nMe enganaste con traicion tu no tienes corazon\r\nEse hombre que tu vez ahi\r\nParece tan amable \r\nPero no es agradable\r\nMe enganaste con traicion tu no tienes corazon \r\n\r\nPocas vezes carinoso\r\nEs un payaso vanidoso \r\nQue me llena de dolor \r\n\r\nTu no tienes Corazon \r\nTu no tienes Corazon \r\nTu no tienes Corazon \r\nTu me enganaste \r\nY me traicionaste \r\nNo te quiero ya \r\nFalso malo rencorozo \r\nYa no te quiero mas\r\nTu me enganaste \r\nTu me enganaste \r\nY me traicionaste \r\nY me traicionaste \r\nNo no no no no no \r\nNo quiero verte mas \r\nOh no \r\nYa no no \r\nNo no\r\nTu me enganaste \r\nY me traicionaste \r\nAy ya no te quiero mas \r\nYa no voy a sufrir mas \r\nEse Hombre ya s