	(361,'Gentle On My Mind','It\'s knowin\' that your door is always open\r\nAnd your path is free to walk\r\nThat makes me tend to leave my sleeping bag \r\nRolled up and stashed behind your couch.\r\nAnd it\'s knowing I\'m not shackled \r\nBy forgotten words and bonds \r\nAnd the ink stains that have dried upon some line\r\nThat keeps you in the backroads by the rivers of my memory \r\nThat keeps you ever gentle on my mind. \r\n\r\nIt\'s not clinging to the rocks and ivy planted\r\nOn their columns now that binds me. \r\nOr something that somebody said because they thought \r\nWe fit together walkin\'. \r\nIt\'s just knowing that the world will not be cursing or forgiving \r\nWhen I walk along some railroad track and find \r\nThat you\'re moving on the backroads by the rivers of my memory \r\nAnd for hours you\'re just gentle on my mind. \r\n\r\nThough the wheat fields and the clothes lines \r\nAnd the junkyards and the highways come between us. \r\nAnd some other woman crying to her mother \r\n\'Cause she turned and I was gone. \r\nI still might run in silence, tears of joy might stain my face \r\nAnd a summer sun might burn me till I\'m blind. \r\nBut not to where I cannot see you walkin\' on the backroads \r\nBy the rivers flowing gentle on my mind. \r\n\r\nI dip my cup of soup, back from the gurgling cracklin\' cauldron \r\nIn some train yard \r\nMy beard a roughning coal pile and a dirty hat \r\nPulled low across my face. \r\nThrough cupped hands \'round a tin can \r\nI pretend I hold you to my breast and find \r\nThat you\'re waving from the backroads by the rivers of my memory \r\nEver smilin\' ever gentle on my mind. \r\n\r\n\r\n',136,'2021-07-01 16:00:00',NULL),
	(362,'Brown Sugar','Intro:\r\n|G C|G C|G C|G C|\r\n|D# C G# Bb C|\r\n\r\nG\r\nGold coast slave ship bound for cotton fields\r\nF\r\nSold in a market down in New Orleans\r\nG\r\nScarred old slaver know he\'s doing alright\r\nBb                      C\r\nHear him whip the women just about midnight\r\n\r\nCHORUS:\r\nG           C\r\nBrown sugar, how come you taste so good, now\r\nG           C\r\nBrown sugar, just like a young girl should, wooo!\r\n\r\n\r\nDrums are beating cold, English blood runs hot\r\nLady of the house wonderin\' where it\'s gonna stop\r\nHouseboy knows that he\'s doing alright\r\nYou shoulda heard him just around midnight\r\n\r\nCHORUS\r\n\r\nSOLO\r\n\r\nCHORUS #2:\r\nOohh come on brown sugar, how come you taste so good babe\r\nAaah brown sugar just like a black girl should\r\n\r\nAa-I bet your mama was a tent show queen\r\nAnd all her boyfriends were sweet sixteen\r\nI\'m no schoolboy but I know what I like\r\nYou shoulda heard me just around midnight\r\n\r\nCHORUS\r\n\r\nI said yeah yeah yeah wooo! How come, how come you taste so good?\r\nI said yeah yeah yeah wooo! Just like a, just like a black girl should\r\nYeah yeah yeah wooo!',4,'2021-07-02 04:30:00',NULL),
	(363,'It\'s Only Rock \'N\' Roll','If I could stick my pen in my heart, \r\nI would spill it all over the stage. \r\nWould it satisfy ya, would it slide on by ya, \r\nwould you think the boy is strange?\r\nAin\'t he strange? \r\n\r\nIf I could win ya, if I could sing ya a love song so divine, \r\nwould it be enough for your cheating heart \r\nif I broke down and cried? \r\nIf I cried? \r\n\r\nI said I know it\'s only rock \'n roll but I like it. \r\nI know it\'s only rock\'n roll but I like it, like it, yes, I do. \r\nOh, well, \r\nI like it, \r\nI like it, \r\nI like it. \r\nI said can\'t you see \r\nthat this old boy has been a-lonely? \r\n\r\nIf I could stick a knife in my heart, \r\nsuicide right on stage, \r\nwould it be enough for your teenage lust, \r\nwould it help to ease the pain?\r\nEase your brain? \r\n\r\nIf I could dig down deep in my heart \r\nfeelings would flood on the page. \r\nWould it satisfy ya, would it slide on by ya, \r\nwould ya think the boy\'s insane? \r\nHe\'s insane. \r\n\r\nI said I know it\'s only rock \'n roll but I like it. \r\nI said I know it\'s only rock\'n roll but I like it, like it, yes, I do. \r\nOh, well, I like it, I like it, I like it. \r\nI said can\'t you see that this old boy has been a lonely? \r\n\r\nAnd do ya think that you\'re the only girl around? \r\nI bet you think that you\'re the only woman in town. \r\n\r\nI said I know it\'s only rock \'n roll but I like it. \r\nI said I know it\'s only rock \'n roll but I like it. \r\nI said I know it\'s only rock \'n roll but I like it, like it, yes, I do. \r\nOh, well, \r\nI like it, \r\nI like it. \r\nI like it... ',4,'2021-07-02 17:00:00',NULL),
