	(366,'Taste It','Yes it\'s me\r\nI am the one\r\nTo make you see\r\nWhere we belong\r\nI was shaking\r\nLike a leaf\r\nAll wrapped up\r\nIn my dirty sheets\r\nIf I agree to what comes next\r\nI would be faking\r\nWith the best of them\r\nIt seems a crime\r\nI would commit\r\nWithout the difference\r\nOf all the world\'s gifts \r\n\r\nSweet sweet sweet\r\nCould you taste it \r\n\r\nNever never never\r\nNever never never\r\n(Taste it) \r\n\r\nTo dream\r\nAll the time\r\nWithout a scream\r\nIn the dead of night\r\nAll those faces\r\nCome back to me\r\nI\'ll be begging\r\nTo swim that sea \r\n\r\nYea I made\r\nA picture story\r\nMake you cry\r\nIn all your glory\r\nA need to quench\r\nThe thirst of many\r\nTo justify\r\nAnd make ready \r\n\r\nSweet sweet sweet\r\nCould you taste it \r\n\r\nNever never never\r\n(Taste it)\r\nNever never never\r\n(Taste it)\r\nNever never never\r\n(Taste it)\r\nNever never never\r\n(Taste it) \r\n\r\nThis realization\r\nOwes us strength to show\r\nIf you\'re uncertain\r\nYou\'re invited to believe\r\nThese are the words I speak\r\nThese are the words I speak \r\n\r\nA dislocation\r\nFrom where we once came from\r\nGive sons and daughters\r\nBecause we want to go on \r\n\r\nThese are the words she speaks\r\nThese are the words she speaks \r\n\r\nSweet sweet sweet\r\nCould you taste it \r\n\r\nNever never never\r\n(Taste it)\r\nNever never never\r\n(Taste it)\r\nNever never never\r\n(Taste it)\r\nNever never never\r\n(Taste it)\r\nNever never never\r\nNever never never',204,'2021-07-04 06:30:00',NULL),
	(367,'Where the streets have no name','D G Hm A C\r\n\r\nI wanna run, I want to hide\r\nI wanna tear down the walls\r\nThat hold me inside.\r\nI wanna reach out\r\nAnd touch the flame\r\nWhere the streets have no name.\r\n\r\nI wanna feel sunlight on my face.\r\nI see the dust-cloud\r\nDisappear without a trace.\r\nI wanna take shelter\r\nFrom the poison rain\r\nWhere the streets have no name\r\nWhere the streets have no name\r\nWhere the streets have no name.\r\n\r\nWe\'re still building and burning down love\r\nBurning down love.\r\nAnd when I go there\r\nI go there with you\r\n(It\'s all I can do).\r\n\r\nThe city\'s a flood, and our love turns to rust.\r\nWe\'re beaten and blown by the wind\r\nTrampled in dust.\r\nI\'ll show you a place\r\nHigh on a desert plain\r\nWhere the streets have no name\r\nWhere the streets have no name\r\nWhere the streets have no name.\r\n\r\nWe\'re still building and burning down love\r\nBurning down love.\r\nAnd when I go there\r\nI go there with you\r\n(It\'s all I can do).',60,'2021-07-04 19:00:00',NULL),
	(368,'Burden Of Freedom','I stand on the stairway\r\nMy back to the dungeon\r\nThe doorway to freedom\r\nSo close to my hand\r\nAnd voices behind me\r\nSo bitterly damn me\r\nFor seeking salvation\r\nThey don\'t understand\r\n\r\nChorus:\r\nLord, help me to shoulder\r\nThe Burden of Freedom\r\nAnd give me the courage\r\nTo Be What I Can\r\nAnd When I am Wounded\r\nBy those who condemn me\r\nLord, help me forgive them\r\nThey don\'t understand\r\n\r\nTheir lonely frustration\r\nDescending to laughter\r\nErases the footprints\r\nI leave in the Sand\r\nBut I\'m free to travel\r\nWhere no one can follow\r\nIn search of the kingdom\r\nThey don\'t understand\r\n\r\nChorus:\r\nLord, help me to shoulder\r\nThe Burden of Freedom\r\nAnd give me the courage\r\nTo be what I can\r\nAnd when I have wounded\r\nThe last one who loved me\r\nLord, help her forgive me\r\nI don\'t understand. ',192,'2021-07-05 07:30:00',NULL),
	(369,'Shine on you crazy diamond','Gm\r\nRemember when you were young,\r\n\r\nGb                 Bb\r\nYou shone like the sun.\r\n\r\nEb   Eb/D   Cm Cm/B F\r\nShine on you crazy diamond.\r\n\r\nGm\r\nNow there\'s a look in your eyes,\r\n\r\nGb                      Bb\r\nLike black holes in the sky.\r\n\r\nEb   Eb/D   Cm Cm/B F\r\nShine on you crazy diamond.\r\n\r\n         Gm\r\nYou were caught in the crossfire\r\n\r\n   Gmmaj7/F#\r\nOf childhood and stardom,\r\n\r\nGm7/F              C-9\r\nBlown on the steel breeze.\r\n\r\nEb                     Edim\r\nCome on you target for faraway laughter,\r\n\r\nBb/F                      Dm          D7          Gm\r\nCome on you stranger, you legend, you martyr, and shine!\r\n\r\n\r\nGb  Bb  Eb  Eb/D  Cm  Cm/B  F - 4th guitar solo (short one)\r\n\r\n\r\n    Gm\r\nYou reached for the secret too soon,\r\n\r\nGb                Bb\r\nYou cried for the moon.\r\n\r\nEb   Eb/D   Cm Cm/B F\r\nShine on you crazy diamond.\r\n\r\nGm\r\nThreatened by shadows at night,\r\n\r\nGb                 Bb\r\nAnd exposed in the light.\r\n\r\nEb   Eb/D   Cm Cm/B F\r\nShine on you crazy diamond.\r\n\r\n         Gm\r\nWell you wore out your welcome\r\n\r\n    Gmmaj7/F#\r\nWith random precission,\r\n\r\nGm7/F             C-9\r\nRode on the steel breeze.\r\n\r\nEb                     Edim\r\nCome on you raver, you seer of visions,\r\n\r\nBb/F                     Dm         D7           Gm\r\nCome on you painter, you piper, you prisoner and shine!\r\n\r\n(Part V)\r\n\r\nGm Eb D Gm Eb D Gm fade out - Sax solo (not 100% correct)\r\n\r\n',5,'2021-07-05 20:00:00',NULL),
	(370,'The ship song','G                D             C              G        D\r\nCome sail your ships around me, and burn your bridges down\r\nG                D               C             G      D\r\nWe make a little history, baby, everytime you come around\r\nG                D           C              G         D    \r\nCome loose your dogs upon me, and let your hair hang down\r\nG                  D           C               G      D\r\nYou are a little mystery to me, everytime you come around\r\n\r\n\r\nC                  G         D\r\n We talk about it all night long\r\nC               G      D\r\n We define our moral grounds\r\nEm                 G\r\n But when I crawl into your arms\r\n C                 G        D\r\n Everything comes tumbling down.\r\n\r\nCome sail your ships around me\r\nAnd burn your bridges down.\r\nWe make a little history baby\r\nEvery time you come around.\r\n\r\nYour face has fallen sad now\r\nFor you know the time is nigh\r\nWhen I must remove your wings\r\nAnd you, you must try to fly.\r\n\r\nCome sail your ships around me\r\nAnd burn your bridges down.\r\nWe make a little history baby\r\nEvery time you come around.\r\nCome loose your dogs upon me\r\nAnd let your hair hang down.\r\nYou are a little mystery to me\r\nEvery time you come around. ',56,'2021-07-06 08:30:00',NULL),
