	(376,'Mytteriet på H.M.S. Bounty','C                  F                     C                       G\r\nHer er den gamle beretning om Bounty, et skib som for længst gik ned\r\nC                    F                      C           G     C\r\nChefen ombord var en satan og pisk var hans form for retfærdighed\r\nC                    F                     C                  G\r\nBounty drog ud til Tahiti, men mange brave mænd vendte aldrig hjem\r\nC                     F                        C            G          C\r\nSkipperens råhed blev vendt mod ham selv da de fandt ham et nummer for slem\r\n\r\n\r\n        G                   F# F\r\nKaptajn Bligh var hans navn\r\n                     C        G\r\nHan var berygtet fra havn til havn \r\n   C                     F\r\nog aldrig så længe havet krydses af mænd \r\n      C          G         C\r\nvil historien om Bounty dø hen\r\n\r\n\r\nC                        F                            C                    G\r\nStyrmand ombord Fletcher Christian var manden der til sidst vågned\' op til dåd\r\nC                       F                  C       G    C\r\nHan tvang kaptajnen fra borde en nat ud på havet i åben båd \r\nC                   F                    C                   G\r\nAtten af mandskabet fulgte kaptajnen med kurs mod den fjerne strand\r\nC                   F                          C          G        C\r\nmen der i båden der svor han sin hævn hvis han selv nåede frelst i land\r\n\r\n\r\nKaptajn Bligh var hans navn...\r\n\r\n\r\nC                    F                     C                       G\r\nBarsk er den gamle beretning om Bounty, et skib der for længst gik ned\r\nC                        F                      C             G       C\r\nBligh nåede hjem og hans løfte blev opfyldt, en retssag fandt hurtigt sted\r\nC                        F                        C                  G\r\nChristian blev dømt in absentia, hans liv blev en flugt over land og sø\r\nC                        F