	(377,'Man ska´ aldrig sige aldrig','Man ska´ aldrig sige aldrig \r\nman ka´ ta´ så grundigt fejl \r\nden som alle sagde var håbløs \r\nhar nu vind i sine sejl. \r\n \r\nHan var blot et nul, et hul i jorden \r\nen sut man ikke regned´ med \r\nsom dasked´ rundt fra sted til sted \r\nog eg´ntlig kun var andre til besvær. \r\nMen han snøred´ hele banden \r\nfor det viste sig minsandten \r\nfjolset var sgu´ tem´lig meget værd. \r\n \r\nMan ska´ aldrig sige aldrig \r\nman ka´ ta´ så grundigt fejl \r\nden som alle sagde var håbløs \r\nhar nu vind i sine sejl. \r\n\r\nDer skete det for ham vi taler om \r\nat lykken var der med en finger, \r\nså han tænkte klokken ringer \r\nog greb til nu var der end´lig bud. \r\nHan var vaks ved havelågen \r\ndrøned´ plud´lig ud af tågen, \r\nfløj af sted mod toppen som et skud \r\n \r\nMan ska´ aldrig sige aldrig \r\nman ka´ ta´ så grundigt fejl \r\nden som alle sagde var håbløs \r\nhar nu vind i sine sejl. \r\n \r\nDen der har succes er alles ven \r\ntak ska´ du ha´ hvor bøtten vendte \r\nsikke en masse folk han kendte \r\nfjolset fra i går var blevet sagen. \r\nKlap på ryggen hele røgen \r\nog han lo med, gik ind på spøgen \r\nmen lærte snart hvordan man meler kagen. \r\n \r\nMan ska´ aldrig sige aldrig \r\nman ka´ ta´ så grundigt fejl \r\nden som alle sagde var håbløs \r\nhar nu vind i sine sejl. \r\n\r\nKom så brødre og søstre \r\n \r\nMan ska´ aldrig sige aldrig \r\nman ka´ ta  så grundigt fejl \r\nden som alle sagde var håbløs \r\nhar nu vind i sine sejl. ',83,'2021-07-10 00:00:00',NULL),
	(378,'Erik Oluf Andersen','Erik Oluf Andersen har hængt sig i en lund, \r\nhan har vel haft en ganske særlig grund, \r\ndet er trods alt en gåde, hvordan dette kunne ske, \r\nhvad var det som fik Andersen på såd´n en skør ide. \r\n \r\nDer var ingen ydre tegn, der viste hvor´n det lå, \r\nman må vel la´ sig nøje med, at sådan kan det gå. \r\nFor Andersens hustru hun var både sød og rar, \r\nog sønnen i familien var et mønstereksemplar, \r\nde bo´de i en kæmpevilla i et fint kvarter, \r\njo, lykken smiled´ til ham, han ku´ næppe ønske mer´. \r\n \r\nDet hele started´ med et lille bolsjekogeri, \r\nhan kogte nat og dag og glemte helt at holde fri, \r\nmen virksomheden voksed´ han blev snart en holden mand, \r\nhan købte sig en luksusvogn der svared´ til hans stand. \r\n\r\nFru Andersen tog tit til byen med sin kontokort, \r\nhun parkerede sin egen bil ved varehusets port, \r\nder købte hun hvad hun fik lyst til, intet blev forsømt, \r\nog når hun kørte hjem igen var varehuset tømt. \r\n\r\nDe havde køleskab og fryseboks som altid var fyldt op \r\nog svinelædermøbler, kvaliteten var i top, \r\nmotorbåd og sommerhus med bar og åben pejs, \r\nder slapped´ fruen af i ny og næ med sin filejs. \r\n\r\nMen Erik Oluf Andersen han tog familiens hund, \r\nog gik en tur en dejlig aftenstund, \r\nhunden kom tilbage, der var blot et lille men, \r\nErik Oluf Andersen kom aldrig hjem igen. \r\n\r\nSiden blev han fundet i en lund ved Snekkersten, \r\nder hang den stakkels Andersen og dingled´ fra en gren. \r\nAldrig mer´ skal Andersen hæve sin pokal, \r\nnår han har givet middag i hotellets store sal, \r\nfesten den er slut, det hele endte med et brag, \r\nog en hel flok aktionærer fik et ord´ntligt nakkedrag. \r\n \r\nFor lykken havde vendt sig sådan som det ofte sker, \r\nhans firma gik af helved´ til, han lånte mer og mer, \r\nfor sent kom han i tanke om at gi´ den en spand kul, \r\nfor at redde sig i land og fylde gældens dybe hul. \r\n \r\nSå han knoklede for livet ofte flere døgn i træk, \r\nhan rationaliserede men skuden den var læk, \r\nog der si´s at han til slut har strøet om sig vidt og bredt \r\nmed gældsbeviser, og han har også spillet på roulet. \r\n \r\nMen regningerne voksede til en stadig større stak, \r\nså Erik Oluf Andersen han sa´ farvel og tak, \r\nog i den skønne aftenstund der rejste han af sted, \r\nmod fjerne horisonter for at finde ro og fred. \r\n\r\nErik Oluf Andersen har hængt sig i en gren \r\nlad os andre læse på hans sten: \r\nHer hviler E. O. Andersen - et offer for vor tid \r\ndistancen var for hård og konkurrencen var for strid.\r\n\r\nTred´ve år før tiden gik han gennem dødens port. \r\nBrødet han slog op var alt for stort. ',83,'2021-07-10 12:30:00',NULL),
	(379,'Kom hjem igen','Jeg vandrer i det hvide sand på stranden uden dig. \r\nOg tænker på den tid, vi havde sammen, du og jeg. \r\nHvorfor er alt forbi, skal vi nu aldrig ses igen ? \r\nKom hjem igen, jeg savner dig, kom hjem igen. \r\n \r\nSe månen kysser havet blidt i nattens lune vind. \r\nHvor ofte stod vi ikke her og så det, kind mod kind. \r\nNår dagen gryr, si´r de farvel, men ved, de ses igen. \r\nKom hjem igen, jeg savner dig, kom hjem igen. \r\n \r\nSiden vi forlod hinanden, har jeg ingen fred. \r\nHvileløs går jeg omkring fra sted til sted med min kærlighed. \r\nJeg vandrer i det hvide sand på stranden uden dig. \r\nKom hjem igen, jeg savner dig, kom hjem igen. \r\n\r\nSiden vi forlod hinanden, har jeg ingen fred. \r\nHvileløs går jeg omkring fra sted til sted med min kærlighed. \r\nJeg vandrer i det hvide sand på stranden uden dig. \r\nKom hjem igen, jeg savner dig, kom hjem igen. ',83,'2021-07-11 01:00:00',NULL),
	(380,'Mig og Magrethe','Den dag det skete mellem mig og Margrethe \r\nblev hun taget på sengen kun i negligé. \r\nSikken ballade fyren fik et par flade \r\nsåd´n på fransk manér: \r\nSortie, allez. \r\nEller på godt dansk: \r\nLuk døren efter dig makker, det trækker. \r\n \r\nHun var ung og dejlig, bare en snes år. \r\nOg jeg var femogfyrre, mangled´ et par hår. \r\nVi blev gift i kirke, heste og karet. \r\nJeg fik hjerter dame, hvilken kæmpe bet \r\n \r\nLige børn skal lege, jo, jeg fik det lært \r\nmen betalte prisen, selv om det var svært. \r\nJeg kom hjem for tidligt, så den muntre leg \r\nhan røg ned ad trappen, og jeg gik samme vej. \r\n\r\nDen dag det skete mellem mig og Margrethe \r\ngik jeg ind på en knejpe for at dulme mit sind. \r\nBrandert og hikke jeg forstod det jo ikke. \r\nTroede alt gik fint, dum og blind. \r\n \r\nSådan er det gået op og ned, mest ned. \r\nKonen har jeg mistet, jobbet det gik med. \r\nMen hun var sgu dejlig, jeg var blot til grin. \r\nHun stak a´ med fyren, ned med det gardin. \r\n \r\nJeg tog at rejse, fartede omkring \r\nsøgte efter noget, men fandt dog ingenting. \r\nJeg har resigneret, sådan kan det gå. \r\nLivet skal jo leves, vil du ha´ en skrå ?',83,'2021-07-11 13:30:00',NULL),
	(381,'Carsten Levin','Der´ en stund, jeg aldrig glemmer. \r\nEn forbandede dag. \r\nDet var, da jeg fulgte ham på vej. \r\nTel Aviv var målet, Okay \r\nhans private sag. \r\n\r\nMen hva´ pokker sku´ der bli´e af mig. \r\nVi var vokset op, to drenge. \r\nGik i samme skole. \r\nOg vort venskab holdt. \r\nNu var vi blevet mænd. \r\nHans beslutning kom en aften. \r\nDa vi sad på vor´ cafe´. \r\nJeg tror nu nok \r\njeg havde følt, hvor det bar hen. \r\n\r\nFrihed, er en ting, \r\nsom folk må kæmpe for at få. \r\nEllers bli´r de ofte \r\ngjort til grin. \r\nLængsel efter frihed. \r\nBryder hver en lås og slå. \r\nden er hver mands eje \r\ndin og min. \r\nDet var gået op \r\nfor Carsten Levin. \r\n\r\nRegnen faldt den dag vi blaffede. \r\nTavse vandrede vi mod syd. \r\nEnd´lig kom en vogn, \r\nder tog os op. \r\nViskerne mod ruden, \r\ntimevis, den samme lyd. \r\nSorgen knugede hjertet \r\ni min krop. \r\nSå nåede vi da grænsen \r\nog jeg bød min ven; farvel. \r\nDet var lige før \r\njeg fulgte med. \r\nMen jeg vidste der var noget \r\nhan sku´ klare med sig selv. \r\nHan fik lov at rejse \r\nhjem i fred. \r\n \r\nFrihed, er en ting, \r\nsom folk må kæmpe for at få. \r\nEllers bli´r de ofte \r\ngjort til grin. \r\nLængsel efter frihed. \r\nBryder hver en lås og slå. \r\nden er hver mands eje \r\ndin og min. \r\nOg det var gået op \r\nfor Carsten Levin. \r\n\r\nLængsel efter frihed. \r\nBryder hver en lås og slå. \r\nden er hver mands eje \r\ndin og min. \r\nFrihed, er en ting, \r\nsom folk må kæmpe for at få',83,'2021-07-12 02:00:00',NULL),
	(382,'Du si´r jeg ska´ gi´ dig en chance','Du si´r jeg ska´ gi´ dig en chance, \r\nmen der ta´r du fejl, kære ven. \r\nJeg tvivler på den alliance. \r\nDet bli´r jo blot det samme om igen. \r\n\r\nGang efter gang sad jeg og hang. \r\nJeg vented´, jeg længtes, jeg savnede dig. \r\nMen hvor var du ? Jeg ved det nu. \r\nDer var andre, der trak mer´ end jeg. \r\n\r\nOg du si´r jeg ska´ gi´...\r\n\r\nVend spillet om. Sæt nu jeg kom \r\nmed samme gang røg, fuld af løgn li´som dig. \r\nHvad tror du selv ? Stod du model \r\ntil det samme ? Næh, gu´ gjord´ du ej. \r\n\r\nDu si´r jeg ska´ gi´ dig en....',83,'2021-07-12 14:30:00',NULL),
	(383,'Søndag morgen','Bb\r\nJeg stod op en søndag morgen \r\n        Eb          F               Bb\r\nkigged´ ud og så en himmel trist og grå, \r\n                                   Gm\r\nfik mig vasket lidt en kam igennem håret, \r\n                     F\r\nskægget lod jeg bare stå.\r\n        Bb\r\nHvorfor pynte sig, en ensom mand, \r\n    Eb                               Bb    Gm\r\nder blot skal ha´ en lang dag til at gå,\r\n   Eb                          \r\nog for øvrigt knækked´ snørrebåndet, \r\n        F                          C7   F7  \r\ndet var det, der mangled´. Jeg fik nok. \r\n \r\n           Bb\r\nJeg sprang ned a´ trappen, ud på gaden,\r\nEb             F             Bb \r\nblæsten kom og rusked´ mig i nakken. \r\n                                       Gm\r\nJeg blev hurtigt kølet af, slog kraven op,\r\n                           F\r\nog fandt den sidste mønt i frakken. \r\n      Bb                   Eb                            Bb        Gm\r\nPå en kaffebar i nabolaget sad jeg lidt og lytted´ efter snakken, \r\n     Eb                         F\r\ndet´ svært at være ene, når man ønsker\r\n                     Bb \r\nman var medlem af en flok. \r\n\r\n                      Eb                           Bb\r\nSå´n en tidlig søndag morgen er der ingen brug for mig. \r\n                  F                            Bb\r\nAlle andre holder fridag, slapper af, kun ikke jeg. \r\n                   Eb                        Bb\r\nNår man lever helt alene uden no´en at holde af,\r\n                      F                          Bb \r\nmå man nok ha´ lov at mene, søndag er den værste dag. \r\n\r\nI en park så jeg en far \r\nsom stod og leged´ med sin pige ved en gynge. \r\nFra et åbent vindue hørtes barnegråd \r\nen mor fik standset ved at synge. \r\nDet var mer´ end jeg ku´ ta´ \r\ndet var som sten blev lagt på hjertet i en dynge. \r\nJeg blev syg i sjælen \r\nlængtes efter kærlighed, et sted at gå i dok. \r\n\r\nSå´n en tidlig søndag morgen er der