	(384,'En fattig troubadur','Jeg er en gammel troubadur, \r\nSom ikke dur til nogen ting. \r\nJeg rejser vidt og bredt omkring. \r\nEn underlig figur. \r\n \r\nJeg synger mine viser små, \r\nfor den som gider høre på. \r\nMin enkle livs filosofi \r\nhar denne melodi. \r\n \r\nDu ka´ ingenting ta´ med dig når du går. \r\nNæ, du ka´ ingenting ta´ med dig når du går. \r\nDu behøver ingen skillinger, \r\nnår du ved porten står. \r\nFor du ka´ ingenting ta´ med dig når du går. \r\n\r\nMåske er du den rige mand. \r\nDer samler i en pengepung. \r\nSkønt den er trin og tyk og rund, \r\nså ta´r du hvor du kan. \r\nDin pengekiste er din gud. \r\nMen så en aften får du bud. \r\nDet guld du levede livet for; \r\nhvad hjælper det dig så! \r\n\r\nDu ka´ ingen ting ta´ med dig når du går. \r\nNæ, du ka´ ingenting ta´ med dig når du går. \r\nOg for penge kan du ikke \r\nkøbe blot et enkelt år \r\nNæ, du ka´ ingenting ta´ med dig når du går. \r\n\r\nJeg er en fattig troubadur, \r\nder rejser vidt og bredt omkring. \r\nJeg ejer ingen verdens ting \r\naf visdom og kultur. \r\nEn enkelt ting har jeg dog lært; \r\nat magt og rigdom tynger svært. \r\nSå du som tror på guld og magt, \r\nhusk på, hvad jeg har sagt \r\n\r\nDu ka´ ingenting ta´ med dig når du går. \r\nNæ, du ka´ ingenting ta´ med dig når du går. \r\nDer er så mange, du kan hjælpe \r\nsom har brug for det de får. \r\nOg du ka´ ingenting ta´ med dig når du går. ',83,'2021-07-13 15:30:00',NULL),
	(385,'Hjemme igen - langt herfra','Mellemspil: | G G | C C | G G | C D | \r\n\r\n    G         C            G\r\nJeg venter på brev fra Californien\r\n        G                       D     D7\r\nJeg har ventet nu i mange mange år\r\n             G            C            G\r\nOg nu er jeg havnet på en bar her i Chicago\r\n      G                 D            G\r\nEt fordrukkent vrag der slikker sine sår\r\n\r\n       D                                   G\r\nHr. pianist - jeg gir en drink hvis du vil spille\r\n                                   D\r\nblot en strofe fra det gamle repetoire\r\n           G        C           G        C\r\nså vil jeg sidde og lytte i mit hjørne - drømme\r\n       G       D              G\r\njeg er hjemme igen - langt herfra\r\n\r\n\r\nMellemspil \r\n\r\n\r\nEngang var livet værd at leve\r\nDer var ingen sorte skyer i det blå\r\nMen så slog lynet ned hun traf en anden\r\njeg har siden vandret rundt på må og få\r\n\r\nHr. pianist - jeg gir en drink hvis du vil spille\r\nblot en strofe fra det gamle repetoire\r\nså vil jeg sidde og lytte i mit hjørne - drømme\r\njeg er hjemme igen - langt herfra',83,'2021-07-14 04:00:00',NULL),
	(387,'Det var Inga, Katinka og smukke Charlie på sin Harley','A                       E               D          A \r\nDet var lørdag aften og ballet det var lige begyndt \r\nA                   E               D          A \r\nskrækkelige Olfert stod der i sin stiveste pynt \r\nD                         F            G           A \r\nDer var nok af tøser Dér pølsebrød og meget meget mer\' \r\nD                       F               G          A \r\nHele salen kogte op og der kom stadig fler\' og fler\' \r\n         A \r\nDer var Inga og katinka, smukke charlie på sin harley \r\n\r\n\r\nDet var lørdag aften og  \r\nballet det var lige begyndt \r\nskrækkelige Olfert stod der \r\ni sin stiveste pynt \r\n\r\nDer var nok af tøser Dér  \r\npølsebrød og meget meget mer\' \r\nHele salen kogte op  \r\nog der kom stadig fler\' og fler\' \r\n\r\nDer var Inga  \r\nog katinka \r\nsmukke charlie  \r\npå sin harley \r\n\r\nDet var lørdag aften og \r\nballet det var godt igang \r\nForstærkerne de larmed\' \r\nidolerne hopped\' og sprang \r\n\r\nDorrit hun var varm på Kaj \r\nog drengen sagde aldrig aldrig nej \r\nMen da de endelig fandt et sted \r\nstod der tre og fyred\' en fed \r\n\r\nDer var Inga  \r\nog katinka \r\nsmukke charlie  \r\npå sin harley \r\n\r\nDet var lørdag aften og  \r\nballet det var næsten forbi \r\nkys og sympati \r\nog en smule jalousi \r\n\r\nOg udenfor var månen fuld \r\nog mælkevejen lå på lur \r\nNogen dingled\' bare hjem  \r\nandre tog på nattegaletur \r\n\r\nDer var Inga  \r\nog katinka \r\nsmukke charlie  \r\npå sin! - ',89,'2021-07-14 16:30:00',NULL),
	(388,'På Banen (Derudaf)','E - C# - A - B  \r\n\r\nH          E \r\nVi drøner gennem land og by \r\n          C# \r\nvi er på banerne på ny \r\n          A                           E \r\nvi kører hundred kilometer i timen derudaf \r\n          A  \r\nog solen blinker i mit bakspejl \r\n            A                     H \r\nog bag mig snesevis af horn der tuder \r\n\r\n\r\nH         E \r\nVi er på hovedvejen om lidt \r\n             C# \r\nog den skal ikke få for lidt \r\n            A \r\nvi trykker sømmet i bund \r\n             E \r\nog drøner derudaf \r\n\r\nE           D        A     D D A \r\nTiden står stille på vejen \r\n     E           D         A \r\nmen tænk hvis vi mødes på stregen \r\n\r\n\r\nVi drøner gennem land og by \r\nvi er på banerne på ny \r\nvi kører hundred kilometer  \r\ni timen derudaf \r\n\r\nOg solen blinker i mit bakspejl \r\nog bag min snesevis af horn \r\nder tuder \r\n\r\nVi er på hovedvejen om lidt \r\nog den skal ikke få for lidt \r\nvi trykker sømmet i bund \r\nog drøner derudaf \r\n\r\nTiden står stille på vejen \r\nmen tænk hvis vi mødes på  \r\nstregen \r\n\r\nSå er det op på bremsen igen \r\nfor der er rødt min fine ven \r\nmen det blir grønt igen så vi kan \r\nkomme derudaf \r\n\r\nVi svinger helt helt ud til venstre \r\nog overhaler behændigt \r\nen svensker \r\n\r\nVi mærker suget fra en bus \r\nsom havde tændt det helt store blus \r\nden blænned ned igen \r\nså vi ku\' se derudaf \r\n\r\nTiden står stille på vejen \r\nmen tænk hvis vi mødes på  \r\nstregen \r\n\r\nVi holder på en tankstation \r\nog fylder op til eksplosion \r\nvi får lidt røg og en mokka \r\nog så igen derudaf \r\n\r\nog i et hav af lys der blinker \r\nder står der pludselig en blaffer \r\nog vinker \r\n\r\nvi suser over en bakketop \r\nog ser at månen er stået op \r\nden sejler med os de sidste  \r\ntimer derudaf \r\n\r\nTiden står stille på vejen \r\nmen tænk hvis vi mødes på  \r\nstregen',89,'2021-07-15 05:00:00',NULL),
	(389,'Bye Bye Love','INTRO:  E  D5  A   A  D5  E\r\n\r\n[CHORUS]\r\nC        G\r\nBye bye, love.\r\nC        G\r\nBye bye, happiness.\r\nC      G\r\nHello, loneliness.\r\nG           D     G\r\nI think I\'m gonna cry.\r\n\r\nC        G\r\nBye bye, love.\r\nC        G\r\nBye bye, sweet caress.\r\nC      G\r\nHello, emptiness.\r\nG           D       G\r\nI feel like I could die.\r\nG           D         G  \r\nBye bye, my love, goodbye.\r\n\r\n              D\r\nThere goes my baby\r\n             G\r\nWith someone new.\r\n               D\r\nShe sure looks happy;\r\n          G\r\nI sure am blue.\r\n           C\r\nShe was my baby\r\n         D\r\n\'till he stepped in.\r\n\r\nGoodbye, to romance\r\n                G   \r\nThat might have been.\r\n\r\n(CHORUS)\r\n\r\nI\'m through with romance.\r\nI\'m through with love.\r\nI\'m through with counting\r\nThe stars above,\r\nAnd here\'s the reason\r\nThat I\'m so free:\r\nMy lovin\' baby\r\nIs through with me.\r\n\r\n(CHORUS)\r\n\r\nGoodbye, my love goodbye...',269,'2021-07-15 17:30:00',NULL),
	(390,'Du lille svale','Du lille svale du som forår bringer\r\nhjem til vort kære gamle danevang,\r\nsig mig hvor vil du hvile dine vinger,\r\nog hvem vil du forlyste med din sang.\r\n\r\nHusker du da roserne vi plukked\',\r\nfiskerbåden styrer ind mod land,\r\nog fuglen til sin lille rede iler,\r\nog nattergalen sine triller slår.\r\n\r\nMange år og mange flere dage\r\nmine tanker er endnu hos dig,\r\nkunne jeg blot drømme mig tilbage\r\ntil dig min ven, så var jeg lykkelig.\r\n\r\nHvorfor bad du om mit unge hjerte,\r\nhvorfor bad du om at elske mig,\r\nhvorfor voldte du mig al den smerte,\r\nog hvorfor var du utro imod mig?\r\n\r\nJeg er forladt og ene må jeg vandre,\r\nhvorhen min tunge skæbne fører mig,\r\nvi skilles ad i håbet for hverandre,\r\nog kun en tanke vil jeg ofre dig. ',207,'2021-07-16 06:00:00',NULL),
	(391,'Ud i det blå','Vågner op i min seng på en dum dag, dum dag\r\nstikker snotten frem si\'r goda\' da\', øv da\'\r\nKlokken den er klokken den er ti\r\nstyrter ud af sengen med et skrig\r\n\r\nUd i det blå\r\nud og se på til verdens ende\r\nmen ved jo aldrig hvad der ku\' hænde\r\n\r\nRegnen siler ned af mit vindue, vindue\r\nmen jeg er salig åh, ja som en hindu, hindu\r\nNå jeg går med min paraply\r\ni den sjip sjap våde by\r\n\r\nUd i det blå\r\ngå og gå til verdens ende\r\nman ved jo aldrig hvad der ku\' hænde\r\nman ved jo aldrig aldrig aldrig aldrig\r\n\r\nStår og drømmer midt i en vandpyt, vandpyt\r\nmen jeg må springe for mit liv, det siger dyt-dyt, dyt-dyt\r\nAutomobilerne de maser frem\r\nåh gud ved hvor de skal hen\r\n\r\nUd i det blå\r\nud og se på til verdens ende\r\nman ved jo aldrig hvad der ku\' hænde\r\nman ved jo aldrig\r\n\r\nUd i det blå\r\nud og se på til verdens ende\r\nman ved jo aldrig hvad man ku\' finde\r\nfinde finde',79,'2021-07-16 18:30:00',NULL),
	(392,'KatteMor','Hun er gammel lidt for brugt\r\nbare havnet i en slukt.\r\nAlt hvad hun ejer er en pose og en sæk\r\nhun går om natten og gi\'r det hele væk.\r\n\r\nTil byens vilde katte\r\nde slikker hendes hånd\r\nog det kan ingen fatte\r\nnej for hvem på denne jord kan vel elske\r\nen ensom gammel kattemor?\r\n\r\nHun var kysk vistnok fra Fyn\r\nså en dag tog hun til byen\r\nog der der satte hun sig til at vente\r\nmen der var ligesom ikke nogen\r\nder gad danse med hende.\r\n\r\nOg byens vilde katte\r\nde slikker hendes hånd\r\nog det kan ingen fatte\r\nnej for hvem på denne jord kan vel elske\r\nen ensom gammel kattemor?\r\n\r\nkattene de kommer\r\nde slikker hendes hånd\r\nog det kan ingen fatte\r\nnej for hvem på denne jord kan vel elske\r\nen ensom gammel kattemor?',89,'2021-07-17 07:00:00',NULL),
	(393,'De fjorten astronauter','Har du hørt hva der er sket?\r\nJa ja ja ja - de er landet på en fjern planet\r\nmen sig mig så hvordan den er\r\nwo wo wo wo - den er rød som et kirsebær\r\nDe kommer aldrig hjem\r\nfor himlen stod på klem\r\nda de endelig nåede frem\r\n\r\nHar du set det gamle blad?\r\nJa ja ja ja - der stod om kærlighed og had\r\nmen sig mig så hva du nu ser\r\nwo wo wo wo - fjorten engle der står og ler\r\nDe kommer aldrig hjem\r\nfor himlen stod på klem\r\nda de endelig nåede frem',79,'2021-07-17 19:30:00',NULL),
	(394,'De Gule Enker','Jeg går temmelig ofte\r\nud på danserestaurant\r\nder hvor de Gule Enker \r\nspiller op til can can.\r\n\r\nHendes fugtige øjne\r\nmøder tillidsfuldt mit blik\r\nmens de røde fingre\r\nfamler ved mit gule slips.\r\n\r\nJeg er sigøjner\r\nog selvom øjnene er blå\r\ner jeg vist ikke lige typen\r\nsom man kan stole på!',79,'2021-07-18 08:00:00',NULL),
	(395,'Det Bedste Til Mig Og Mine Venner','G             A        D\r\nSolen den går ned over gaden\r\nG             A       D\r\nstemmerne får tusmørkelyd\r\nG          A          D\r\nvi spiller bold mod facaden\r\nG         A                D\r\nog så med et der ryger min dyd.\r\n\r\n        G\r\nOg Floridor ja\r\n        A\r\nog Cellestin\r\n         G                    A\r\nde siger hva\' ska\' du ha\' min dreng\r\n             G\r\njeg si\'r det bedste \r\n                D             A\r\ntil mig og mine venner, ja ja ja.\r\n\r\nBilly var på speed i Herstedvester\r\nca. sytten dage på pip pip\r\nder var discofil-musik og skrigende gæster\r\nog gamle venner på trip.\r\n\r\nOg Floridor ja\r\nog Cellestin\r\nde siger hva\' ska\' du ha\' min dreng\r\njeg si\'r det bedste \r\ntil mig og mine venner.\r\n\r\nSjakalerne de begyndte og grine\r\nda de første ruder de røg\r\nog drengene de gik på line\r\ni crepe-de-chine og tøsetøj.\r\n\r\nOg Floridor ja\r\nog Cellestin\r\nde siger hva\' ska\' du ha\' min dreng\r\njeg si\'r det bedste \r\ntil mig og mine venner.\r\n\r\nNerverne som glas på resteniler\r\nskøjteløb på Bagsværd sø\r\nkærlighed i kolde biler\r\nog så er man sgu bange for at dø.\r\n\r\nOg Floridor ja\r\nog Cellestin\r\nde siger hva\' ska\' du ha\' min dreng\r\njeg si\'r det bedste \r\ntil mig og mine venner, ja ja ja.',89,'2021-07-18 20:30:00',NULL),
	(396,'Hvis din far gir dig lov','Hvis din far gir dig lov\r\ntar du så med mig i skoven\r\nog din mor hun sir ja ja\r\nså bli\'r der fuglesang foroven\r\n\r\nSmut du bare ind og spør\r\nde vil ikke sige nej nej\r\nfor de stoler på dig\r\nmed de kender sgu ikke mig\r\nfor det er mig der har drømmende\r\nmed til dig\r\n\r\nOg så kører vi afsted\r\nud af byen langs med vandet\r\nfra far og mor har du ja ja\r\nså vi kysser lidt bl.a.\r\n\r\nKys mig bare en gang til\r\ndu kan ikke sige nej nej\r\nfor de stoler på dig\r\nmen de kender sgu da ikke mig\r\nfor det er mig der har drømmene\r\nmed til dig\r\n\r\nJa det er...\r\n\r\nHvis din far gir dig lov\r\ntar du så med mig i skoven\r\nog din mor hun sir vov vov\r\nså bli\'r der fuglesang foroven',79,'2021-07-19 09:00:00',NULL),
	(397,'Joanna','Ta mig med til dit drømmeland\r\nder hvor man ka drømme\r\nOg ta mig med ud i verdens larm\r\nder hvor man ka larme\r\nTa mig med til Joanna\r\nta mig med ta mig med ta mig med\r\nHvis det er der hvor man ikke bare\r\nska passe sig selv\r\n\r\nTa mig ud på det store hav\r\nder hvor man kan svømme\r\nOg ta mig op i den tynde luft\r\nder hvor man ka svæve\r\nTa mig med til Joanna\r\nta mig med ta mig med ta mig med\r\nHvis det er der hvor man ikke bare\r\nska passe sig selv\r\n\r\nTa mig ud i den grønne skov\r\nder hvor man ka spire\r\nOg ta mig med ind til storbyens jag\r\nder hvor man ka jage\r\nTa mig med til Joanna\r\nta mig med ta mig med ta mig med\r\nHvis det er der hvor man ikke bare\r\nska passe sig selv',79,'2021-07-19 21:30:00',NULL),
	(398,'Køb Bananer','A\r\nKøb bananer køb bananer\r\nG                   A\r\nkøb bananer her hos mig\r\n\r\nkom kun nærmer\' kære frue\r\nG                           A\r\nDe bliver sgu ikke snydt af mig\r\n\r\nA\r\nKøb bananer køb bananer\r\nG                   A\r\nkøb bananer her hos mig\r\n\r\nkom kun nærmer\' kære frue\r\nG                           A\r\nDe bliver sgu ikke snydt af mig\r\nA\r\nSådan sagde onkel Stage\r\nG                         A\r\nnår han stod ved sit bananskib\r\n\r\nmidt på strøget pæn i tøjet\r\n   G                                   A\r\nog lille mig stod vagt på det nærmeste hjørne\r\n\r\nA\r\nOnkel Stage sagde tit til mig\r\n         G\r\ndet skal ikke gå dig ligesom mig\r\n        A                  G\r\ndu skal lære noget du skal bli\' til noget\r\n        A\r\nåh ja i ja\r\n\r\nmen da Stage til sidst blev syg\r\n       G\r\naf for meget tutti-frutti og for meget fy fy\r\n            A             G          D\r\nvar det sgu mig der måtte ud og lave kassen\r\n\r\njeg stod og råbte:\r\n\r\nKøb bananer køb bananer\r\nkøb bananer her hos mig\r\nkom kun nærmer\' kære frue\r\nDe bliver sgu ikke snydt af mig\r\nSådan sagde jeg ja det gjorde jeg\r\nnår jeg stod ved mit bananskib\r\nmidt på strøget pæn i tøjet\r\nog drengen han stod vagt på det nærmeste hjørne\r\n\r\nDa drengen han var lille da sagde han tit\r\nåh daddy jeg skal drive det vidt\r\njeg vil lære noget jeg vil bli\' til noget\r\nåh ja i ja\r\njeg vil ikke nikke ende som dig\r\nog stå her på gaden som et andet kvaj\r\ndu kan tro nej det ikke mig åh nej åh nej\r\nMen i skolen der gik det skidt\r\nhan ku\' ikke sidde stille og lærte for lidt\r\nhan havde kviksølv i numsen som sin daddy\r\nog salig onkel Stage\r\nnu står han og råber:\r\n\r\nKøb bananer køb bananer\r\nkøb bananer her hos mig\r\nkom kun nærmer\' kære frue\r\nDe bliver sgu ikke snydt af mig\r\nSådan cirka siger pojken\r\nnår han står ved sit bananskib\r\nmidt på strøget pæn i tøjet\r\nog daddy han står vagt ved det næ