	(399,'Nanna','Nanna med den røde mund\r\nog lange sorte negle.\r\nHun drikker og hun er lidt dum\r\nså hun er glad.\r\nDet så trist, det så trist siger de.\r\n\r\nNanna med den røde mund\r\nog lange sorte negle.\r\nHun har to mænd og otte børn\r\nså hun er glad.\r\nDet så trist, det så trist siger de.\r\n\r\nNanna med den røde mund\r\nog lange sorte negle.\r\nHun griner og får dem til at le\r\nhør sig mig - hva\' er der egentlig galt?\r\nDet så trist, det så trist siger de.',79,'2021-07-20 22:30:00',NULL),
	(400,'Rita','Rita du har ramt mig nu\r\nog jeg ved slet ikke hvad\r\njeg skal sige til dig\r\nnår jeg ser dig igen\r\n\r\nSkal jeg sige at jeg elsker dig?\r\nÅrh nej, du ka\' tro nej\r\nfor det har du sikkert hørt så tit\r\n\r\nRita du er dejlig\r\nfor evigt min\r\nog hvis du ikke vil ha\' mig\r\ner du alligevel min\r\n\r\nFor jeg ka\' gå og drømme om dig\r\nli\' så tosset som jeg vil\r\nosse lige meget\r\nhvad du siger dertil\r\n\r\nMen Rita, du går bare forbi\r\nfor du ved slet ingenting\r\nom de vilde tanker\r\nder kører i ring\r\n\r\nRita, mit hjerte\r\nbanker kun for dig\r\ni den lyse sommernat\r\ndet svimler for mig\r\n\r\nRita, du er dejlig\r\nfor evigt min\r\nog hvis du ikke vil ha\' mig\r\ner du alligevel min.\r\n\r\nRita, Rita, la la la la la, la la la la la\r\nRita, Rita, Rita...',79,'2021-07-21 11:00:00',NULL),
	(401,'Sort Sort Sort','Sort Sort Sort\r\nLigger vandet under byens bro\r\nen søvning bus, tar  øjne med\r\net skib går ind sejler gennem mit sind\r\nsom om jeg var et havne løb\r\n\r\nBlankt blankt blankt\r\nligger vandet under solen rød\r\nen gammel tøs gir fugle brød\r\nen doktor fin fløjter rundt i konens bil\r\nsom om det var et løbehjul\r\n\r\nSort Sort Sort\r\nLigger vandet under byens bro\r\nen gammel tøs går træt til ro\r\nen trist bilist \r\nmister pludslig livets gnist\r\nog springer ud fra byens bro',89,'2021-07-21 23:30:00',NULL),
	(402,'Sylvesters Drøm','Når jeg står og kigger ud over jorden\r\nfår jeg længsel\r\nfår jeg længsel\r\nEfter tiderne da bonden gik og såede\r\nog ku mærke\r\nog ku mærke\r\nOg kunne mærke jordens hjerte banke\r\nsom en tanke\r\nsom en tanke\r\nOg hørte fuglesang fra søerne blanke\r\ndet var dejligt\r\ndet var dejligt\r\n\r\nOg når jeg står og kigger på en dejlig kvinde\r\nfår jeg længsel\r\nfår jeg længsel\r\nEfter tiderne da jeg kunne rødme\r\nog ku mærke\r\nog ku mærke\r\nOg kunne mærke hendes hjerte banke\r\nselv på afstand\r\nselv på afstand\r\nOg kunne gyse bare jeg så hendes arme\r\ndet var dejligt\r\ndet var dejligt\r\n\r\nOg når jeg står og kigger ud over byen\r\nfår jeg længsel\r\nfår jeg længsel\r\nEfter dagen hvor vi er os alle sammen\r\nog ka mærke\r\nog ka mærke\r\nAt vi nåede ud af vores første barndom\r\ni tide\r\ni tide\r\nSkønt vi fik nogle slemme slemme skrammer\r\ngamle krige\r\ngamle krige\r\n\r\nOg når jeg står og kigger langt ud i rummet\r\nfår jeg længsel\r\nfår jeg længsel\r\nEfter dagen hvor vi fløjter rundt derude\r\nsom en tanke\r\nsom en tanke\r\nOg når den allerældste kvinde på Venus\r\nblinker til mig\r\nblinker til mig\r\nOg forklarer mig om evighedens gåde\r\nbli\'r det dejligt\r\nbli\'r det dejligt\r\n\r\nOg når den allerældste kvinde på Venus\r\nblinker til mig, blinker til mig\r\nOg forklarer mig om evighedens gåde\r\nbli\'r det dejligt\r\nbli\'r det dejligt\r\nSå bli\'r det tider\r\nså bli\'r det tider',79,'2021-07-22 12:00:00',NULL),
	(403,'U lu la lu','Lille lykkerider\r\nmed din flaske sprut\r\nville du for meget\r\ndu siden har fortrudt\r\nHar du gået for længe\r\nmed ryggen mod en mur\r\nude midt i regnen\r\nog ventet på din tur\r\n\r\nU Lu la lu\r\n\r\nEr du stadig at finde\r\npå hjertets markedsplads\r\neller sidder du ene \r\ni dit baggårdspalads\r\n\r\nU Lu la lu\r\n\r\nSe de vilde roser\r\npå den stenede vej\r\nde står og vugger i vinden\r\nforglem dem ej\r\n\r\nU Lu la lu',79,'2021-07-23 00:30:00',NULL),
	(404,'Blaffersangen','Jeg går ad vejen mod Korsør\r\nen tidlig fredag aften\r\nbilerne de drøner bare forbi\r\nMit tøj er tyndt og det er hundekoldt\r\njeg går med tommen i vejret\r\nbilerne de drøner bare forbi\r\n\r\nDet er koldt og jeg er langt hjemmefra\r\nog jeg savner min mor og min far\r\nkære bilist\r\nta mig op\r\nta mig op\r\nellers får jeg en prop',79,'2021-07-23 13:00:00',NULL),
	(405,'Pligterne kalder','G                  C\r\nPligterne de kalder endnu engang\r\nD                       G\r\nsom de har gjort det så tit\r\n                       C\r\njeg gemmer mig af vejen til bægerklang & sang\r\nD                  G\r\nvenneløs & uden kredit\r\n\r\nC                            G\r\nIntet nyt er godt nyt for de fleste\r\nC                          G\r\nmen svært at tro på for de få\r\nC                               G\r\nder alle lægger afstand til det meste\r\nC                          D\r\ni muntre hjørner bag lås & slå\r\n\r\nG         C\r\nPenge sex magt & viden\r\n          D\r\nman bli\'r klogere med alderen\r\n    G\r\nmen fattigere med tiden\r\n\r\nIntet nyt er godt nyt for de fleste\r\nmen svært at tro på for de få\r\nder alle lægger afstand til det meste\r\ni muntre hjørner bag lås & slå \r\n\r\nG\r\nPligterne kalder om & om igen\r\n\r\nviljen er mit våben vejen er min ven\r\nC                      G\r\n& jeg vedgår gerne min gæld\r\n   D                        C          G\r\nså længe jeg får lov til at stifte den selv\r\n\r\nNogle nikker klogt i takt med tiden\r\nandre ryster ærmerne for kort\r\nHva\' stiller man op med al sin viden\r\nnår man har leflet hjernen bort\r\n\r\nIntet nyt er godt nyt for de fleste\r\nmen svært at tro på for de få\r\nder alle lægger afstand til det meste\r\ni muntre hjørner bag lås & slå ',80,'2021-07-24 01:30:00',NULL),
	(406,'Spildte bedrifter','   E                     D\r\nEn syndflod af spildte bedrifter\r\n   E                A\r\net vognlæs af døde ideer\r\n   E                   D\r\nen digter der flæbende skrifter\r\n   E                 A\r\net intet ingen andre ser\r\n\r\nEt hav af panik uden mæle\r\nen skipperskrøne ingen tør tro\r\nen ghetto på gloende pæle\r\net Herrens hus hvor ingen vil bo\r\n    D                 E\r\nMit livslys er ude at svømme\r\n    A                 D\r\nmin næste er gået til ro\r\n\r\njeg står ved en korsvej\r\n  E                A\r\n& savner dem begge to\r\n\r\nJeg længes mod nul efter noder\r\nlænges efter nok et nej\r\nmens alle dine støvede kustoder\r\nlænges efter dit og dig\r\n\r\nMit livslys er ude at svømme\r\nmin næste er gået til ro\r\njeg står ved en korsvej\r\n& savner dem begge to ',80,'2021-07-24 14:00:00',NULL),
	(407,'Tre portrætter','E   A        E\r\nJeg kendte engang en maler \r\nG         A   \r\nhvis initialer\r\n                  E\r\nvar noget med L & Å\r\n    A      E       \r\nhan malede kun portrætter\r\nG       A\r\n& varme retter\r\n                     E\r\nvar noget han aldrig så\r\n\r\nH\r\n\r\nG\r\nHan gik omkring i sin egen verden\r\nA\r\naf terpentin & skam\r\nG\r\n& viste sig sjældent på gaden\r\n        A                 H\r\nmen lod gaderne komme til ham\r\n\r\nE   A        E\r\nJeg kendte engang en maler \r\nG         A   \r\nhvis initialer\r\n                  E\r\nvar noget med L & Å\r\n\r\n\r\nJeg kendte engang en rocker\r\ni nylonsokker & killersko\r\nhan rokkede alt & alle\r\nfra Bjergby City til Tupelo\r\n\r\nHan for omkring i sin egen verden\r\naf engle der fløj i flok\r\n& pudsede løs på sin glorie\r\ntil han menet den var skinnende nok\r\n\r\nJeg kendte engang en hippie\r\nfra Mississippi\r\nWater Valey U.S.A.\r\nhun svømmede i kolde kontanter\r\ngik som en panter\r\n& spandt som en harmonika\r\n\r\nHum kom omkring i sin egen verden\r\npå stop uden forbehold\r\ntil den dag hun tabte sit hjerte\r\ntil en middelmådig truckerknold ',80,'2021-07-25 02:30:00',NULL),
	(408,'Blåt blod til alle','Neonskrig & nylonskrål\r\ntabte tænder i metermål\r\nnatteravne på rov \r\nusynligheder med hjælp behov\r\n\r\nFryseflip & gåsehud\r\nhættemåger med portvinstud\r\nuskyldigheder en masse\r\nblåt blod til alle på Blågårds Plads\r\n\r\nGi\' mig en pause på klods\r\nalle her er en af os\r\nbrikker i et spil\r\nhvor tilfældet råder som tilfældet vil\r\n\r\nGadeklog og ghettovis\r\nalt eller intet for enhver pris\r\ndumme dage på en sky\r\naf gamle drømme fra de glemtes by\r\n\r\nGi\' mig en pause på klods\r\nalle her er en af os\r\nbrikker i et spil\r\nhvor tilfældet råder som tilfældet vil ',80,'2021-07-25 15:00:00',NULL),
	(409,'Det regner i mit hjerte','Fanget i en fælde af lys\r\nbag et forhæng af regn\r\nstår vi stumme & smiler\r\naf skygger der flyder forbi\r\nopløst i fri fantasi\r\ni takt med tiden der iler\r\n\r\nDet regner & det regner i mit hjerte\r\ndet smager lidt af smerte\r\ndet minder mig om noget\r\n\r\nStrandet i en by under vand\r\ni en havn uden navn\r\nfinder vi ind til hinanden\r\ni gader med stridende strømme\r\naf anløbne drømme\r\ngår vi & mister forstanden',80,'2021-07-26 03:30:00',NULL),
	(410,'Det si\'r sig selv','       Hm\r\nDer er næppe noget der swinger\r\n                   E\r\nsom Bjerringbro by night\r\n     Hm\r\nhele hovedgaden emmer\r\n                    E\r\naf landmænd fit for fight\r\n\r\n             Cm\r\nDet si\'r sig selv\r\n             Hm\r\ndet si\'r sig selv\r\n               F#m\r\nwell well well well\r\n             E\r\ndet si\'r sig selv\r\n\r\nGud skal vide at jeg hader\r\nat se dig holdt for nar\r\naf hjernedøde bønder\r\npå pedalsteel & dobroguitar\r\n\r\nDer er ingenting der maner\r\nsom en Gjellerup plan\r\n& en rejselysten fråde\r\npå hævntogt fra Gedser til Skagen\r\n\r\nDet er sent & det er vinter\r\nsolen går til psykolog\r\n& månen fulder rundt\r\nblandt troløshed & status quo ',80,'2021-07-26 16:00:00',NULL),
	(411,'På gyngende grund','Jeg går gerne op i en helhed\r\nfor uhyggens skyld\r\n& ofrer med glæde\r\nenhver form for sigøjneridyl\r\nfor det jeg mindst af alt synes om\r\ner at stå ved mig selv\r\nnår min lomme er tom\r\nklos op af pigen fra Fyn på gyngende grund\r\n\r\nJeg gør gerne vold på mig selv\r\nhver eneste dag\r\n& rejser mig frivilligt op\r\nfor den dårlige smag\r\nfor det jeg mindst af alt synes om\r\ner at stå ved mig selv\r\nnår min lomme er tom\r\nklos op af pigen fra Fyn på gyngende grund\r\n\r\nJeg går gerne bag om dansen\r\ni al slags vejr\r\n& ernærer mig som højhuspoet\r\nfor et sultesalær\r\nfor det jeg mindst af alt synes om\r\ner at stå ved mig selv\r\nnår min lomme er tom\r\nklos op af pigen fra Fyn på gyngende grund ',80,'2021-07-27 04:30:00',NULL),
	(412,'Skygger af skønhed','Skygger af skønhed kommer & går\r\ni en uendelig strøm\r\nhimlen er høj og vinklerne skrå\r\npræcis som var det i en drøm\r\n\r\ndet rimer & det regner\r\nmed minder om fravær i flæng\r\nøjeblikket falmer & blegner\r\nsom dage uden sammenhæng\r\nsom nætter i harmonikaseng\r\n\r\nGår den så går den hvis ikke so what?\r\ntænkte han & så på sit ur\r\ntiden stod stille et kort sekund\r\nog skyggerne gik sig en tur\r\n\r\ndet rimer & det regner\r\nmed minder om fravær i flæng\r\nøjeblikket falmer & blegner\r\nsom dage uden sammenhæng\r\nsom nætter i harmonikaseng\r\n\r\nSkygger af skønhed længes om kap\r\ni gader uden ende & med\r\nhatten i hånden igen & igen\r\nsom skygger uden tilholdssted\r\n\r\ndet rimer & det regner\r\nmed minder om fravær i flæng\r\nøjeblikket falmer & blegner\r\nsom dage uden sammenhæng\r\nsom nætter i harmonikaseng ',80,'2021-07-27 17:00:00',NULL),
