	(414,'The weight','A               C#m             D                       A\r\nI pulled in to Nazareth, I was feeling about half past dead.\r\nA                 C#m        D             A\r\nI just need some place where I can lay my head.\r\nA                      C#m             D                A\r\n\"Hey, Mister, can you tell me where a man might find a bed?\"\r\nA                  C#m           D               A\r\nHe just grinned, shook my hand, \"No\" was all he said.\r\n\r\n\r\nA      A/G#       D\r\nTake a load off, Fanny.\r\nA      A/G#       D\r\nTake a load for free.\r\nA      A/G#       D\r\nTake a load off, Fanny.\r\nD                                  A\r\nAnd...  you put the load right on me.\r\n\r\n|:A  A/G#  |F#m7  E  |D    |     :|\r\n\r\nI picked up my bag.  I went looking for a place to hide.\r\nWhen I saw Carmen and the devil walking side by side.\r\nI said, \"Hey, Carmen, come on. Let\'s go downtown.\"\r\nShe said, \"I got to go, but my friend can stick around.\"\r\n\r\n(refrain)\r\n\r\nGo down, Miss Moses, there\'s nothing you can say.\r\nIt\'s just old Luke, and Luke\'s waiting on the judgement day.\r\n\"Well, Luke, my friend, what about young Anna Lee?\"\r\nHe said, \"Do me a favor, son, won\'t you stay and keep Anna Lee company.\"\r\n\r\n(refrain)\r\n\r\nCrazy Chester followed me and he caught me in the fog.\r\nHe said, \"I will fix your rack, if you\'ll take Jack my dog.\"\r\nI said, \"Wait a minute, Chester. You know I\'m a peaceful man.\"\r\nHe said, \"That\'s okay, boy.  Won\'t you feed him when you can?\"\r\n\r\n(refrain)\r\n\r\nGet your Canonball now, to take me down the line.\r\nMy bag is sinking low, and I do believe it\'s time\r\nTo get back to Miss Fanny.  You know she\'s the only one\r\nWho sent me here with her regards for everyone.\r\n\r\n(refrain)',208,'2021-07-28 18:00:00',NULL),
	(415,'The night they drove old Dixie down','|C    |     |\r\n\r\nAm      C/G                   F             Em        Dm\r\nVirgil Cain is my name and I served on the Danville train,\r\nAm                C/G              F           Em      Dm\r\nTill Stonewall\'s cavalry came and tore up the tracks again.\r\nC/E               F                  C           Dm\r\nIn the winter of sixty-five we were hungry, just barely alive.\r\nC/E               F\r\nBy May the tenth Richmond had fell.\r\n          C        Dm            D\r\nIt was a time I remember all so well.\r\n\r\n\r\n     C/G         F              C/G\r\nThe night they drove old Dixie down,\r\n         F\r\nAnd the bells were ringing.\r\n     C/G         F              C/G\r\nThe night they drove old Dixie down,\r\n         F\r\nAnd the people were singing.  They went...\r\n  C/G     Am        G              F\r\n\"La la la la la la, la la la la la la la la la.\"\r\n\r\n\r\nBack with my wife in Tennessee, when one day she called to me.\r\n\"Virgil, quick!  Come see!  There goes Robert E. Lee!\"\r\nNow I don\'t mind I\'m chopping wood, \r\nAnd I don\'t care if the money\'s no good.\r\nYou take what you need and you leave the rest,\r\nBut they should never have taken the very best.\r\n\r\n(refrain)\r\n\r\nLike my father before me, I work the land.\r\nAnd like my brother above me, who took a rebel stand.\r\nHe was just eighteen, proud and brave,\r\nBut a Yankee laid him in his grave.\r\nI swear my the mud below my feet,\r\nYou can\'t raise the cane back up when it\'s in the feed.\r\n\r\n(refrain)\r\n\r\n|C  C/B  |Bb  Am  |Ab  G  |\r\n\r\n(refrain)',208,'2021-07-29 06:30:00',NULL),
