	(438,'Martha','Intro:  / D - A7 - / D - A7 - /\r\n        / Bm - A - / G - - - /  \r\n\r\nD  A7     D       A7           Bm      A    G\r\nOperator, number, please: it\'s been so many years\r\n     D     A7     D      A7    Bm      A         G\r\nWill she remember my old voice while I fight the tears?\r\n   D      B7        Em      A7      D       B7      Em     A7\r\nHello, hello there, is this Martha? this is old Tom Frost,\r\n    D    B7      Em      A7           Bm     A        G\r\nAnd I am calling long distance, don\'t worry \'bout the cost.\r\n       D    B7         Em       A7        D      B7       Em    A7\r\n\'Cause it\'s been forty years or more, now Martha please recall,\r\nD       B7      Em      A7          Bm    A       G\r\nMeet me out for coffee, where we\'ll talk about it all.\r\n\r\n \r\nChorus:\r\n    D                      G      D          G\r\nAnd those were the days of roses, poetry and prose and Martha\r\nBm            G               Em  A   D\r\nAll I had was you and all you had was me.\r\nD              G             D               G\r\nThere was no tomorrows, we\'d packed away our sorrows\r\n       Bm         G     Em  A D\r\nAnd we saved them for a rainy day.\r\n\r\n/ D - A7 - / D - A7 - /\r\n/ Bm - A - / G - - - /  \r\n\r\nAnd I feel so much older now, and you\'re much older too,\r\nHow\'s your husband? and how\'s the kids? you know that I got married \r\ntoo?\r\nLucky that you found someone to make you feel secure,\r\n\'Cause we were all so young and foolish, now we are mature.\r\n\r\nChorus\r\n \r\n/ D - A7 - / D - A7 - /\r\n/ Bm - A - / G - - - /\r\n\r\nAnd I was always so impulsive, I guess that I still am,\r\nAnd all that really mattered then was that I was a man.\r\nI guess that our being together was never meant to be.\r\nAnd Martha,    Martha,   I love you can\'t you see?\r\n\r\nChorus\r\n\r\n/ D - A7 - / D - A7 - /\r\n/ Bm - A - / G - - - /  \r\n\r\nAnd I remember quiet evenings trembling close to you...',214,'2021-08-09 17:30:00',NULL),
	(439,'Nine Million Bicycles','Nine Million Bicycles KATIE MELUA\r\nalbum: Piece by piece\r\n\r\nStandard tuning\r\n\r\nC                                     Em\r\nThere are nine million bicycles in Beijing \r\n         Dm           F\r\nThat\'s a fact, It\'s a thing we can\'t deny \r\n         Dm                G              C      C\r\nLike the fact that I will love you till I die. \r\n\r\n                                          Em\r\nWe are twelve billion light years from the edge, \r\n         Dm                F\r\nThat\'s a guess, No-one can ever say it\'s true \r\n      Dm               G              C          C\r\nBut I know that I will always be with you. \r\n\r\n    Fm            C            G        Am\r\nI\'m warmed by the fire of your love everyday \r\n   Fm7             C          D                         G\r\nSo don\'t call me a liar, Just believe everything that I say \r\n\r\n          C                         Em\r\nThere are six billion people in the world \r\n        Dm           F\r\nMore or less, and it makes me feel quite small \r\n    Dm               G                C         C\r\nBut you\'re the one I love the most of all \r\n\r\n\r\n\r\n      Fm          C              G            Am\r\nWe\'re high on the wire, with the world in our sight \r\n    Fm7        C            D                           G\r\nAnd I\'ll never tire, Of the love that you give me every night \r\n \r\n          C                        Em\r\nThere are nine million bicycles in Beijing \r\n         Dm           F\r\nThat\'s a Fact, it\'s a thing we can\'t deny \r\n         Dm               G               C        \r\nLike the fact that I will love you till I die \r\n\r\n              Dm           G           C          \r\nAnd there are nine million bicycles in Beijing \r\n        Dm               G        C\r\nAnd you know that I will love you till I die!\r\n',215,'2021-08-10 06:00:00',NULL),
