	(441,'Sæt dig ned i en vejgrøft','Sæt dig ned i en vejgrøft og se dig omkring, \r\nse hvordan livet leves i hver lille ting. \r\nVend dit blik op mod himlen, og mærk hvad der sker. \r\nDu får ro i din sjæl, kan du ønske dig mer? \r\n \r\nLæg dig ud i en båd midt på bølgen den blå, \r\nud med snøren og vent så, til fisken går på. \r\nRo din fangst ind på stranden og tænd dig et bål, \r\næd din fisk, nyd en dram, velbekomme og skål. \r\n \r\nSmæk en pil på din bue og send den af sted, \r\nbag de blå horisonter vil pilen slå ned. \r\nMåske rammer den lykken, måske ikke, hvem ved. \r\nSpænd din bue igen, send en ny pil af sted. \r\n \r\nFlyv af sted på din vinge mod ukendte mål, \r\ngi´ en skærv til den mand, der har sko uden sål. \r\nHver en gave, du skænker, kommer altid igen. \r\nKan du tro, kan du gi´, får du mangen en ven. \r\n \r\nKan du ej finde hvile og falde til ro, \r\ner dit sind som en vildfugl, så sæt aldrig bo, \r\nfor dit liv bli´r en plage for dig og din viv. \r\nDet er synd for din mage og synd for dit liv. \r\n \r\nGå en tur ned til havet en efterårsdag, \r\nnår det tordner og bruser i hvert bølgeslag. \r\nVend din snude mod vinden og snus kraftigt ind \r\ngamle ven, dine sorger forlader dit sind.',83,'2021-08-11 07:00:00',NULL),
	(442,'Sweet child of mine','She\'s got a smile that it seems to me\r\nReminds me of childhood memories \r\nWhere everything \r\nWas as fresh as the bright blue sky \r\nNow and then when I see her face \r\nShe takes me away to that special place\r\nAnd if I\'d stare too long \r\nI\'d probably break down and cry \r\n\r\nSweet child o\' mine \r\nSweet love of mine \r\n\r\nShe\'s got eyes of the bluest skies \r\nAs if they thought of rain \r\nI hate to look into those eyes \r\nAnd see an ounce of pain \r\nHer hair reminds me of a warm safe place \r\nWhere as a child I\'d hide \r\nAnd pray for the thunder \r\nAnd the rain \r\nTo quietly pass me by\r\n\r\nSweet child o\' mine \r\nSweet love of mine \r\n\r\nWhere do we go \r\nWhere do we go now \r\nWhere do we go \r\nSweet child o\' mine ',217,'2021-08-11 19:30:00',NULL),
	(443,'The Waters Of My Time','Don\'t look for me in fields of clover\r\nI won\'t be there I won\'t get older\r\nI must wait here holed up in my time\r\n\r\nDon\'t search for me in fields of green\r\nI\'m not there I won\'t be seen\r\nI\'m wading through the waters of my time\r\nI\'m wading through the waters of my time\r\n\r\nDon\'t look for me in lands of gold\r\nI won\'t be there I won\'t get old\r\nI\'ll hover like a frozen bird in time\r\n\r\nDon\'t reach for me the stars are cold\r\nMy race is run my stories told\r\nI\'m wading through the waters of my time\r\n\r\nDon\'t search for me in lands of gold\r\nI won\'t be there I can\'t get old\r\nDon\'t hope for me the stars have died\r\nI\'ve slipped into the past\r\nCos I\'m wading through the waters of my time\r\nYes I\'m wading through the waters of my time\r\n\r\nDon\'t search for me in lands of gold\r\nI won\'t be there I can\'t get old\r\nDon\'t hope for me the stars have died\r\nI\'ve slipped into the past\r\nCos I\'m wading through the waters of my time\r\nYes I\'m wading through the waters of my time\r\nmmmmmmmmmmm mmmmmmmmmmm\r\nYes I\'m wading through the waters of my time',218,'2021-08-12 08:00:00',NULL),
	(444,'(Do You Wanna) Come Walk With Me?','Little girl have I told you \r\nhow you light up my life \r\ncome and lay down beside me \r\ncome and thrill me tonight \r\ndo you wanna? \r\n\r\nI\'m not saying I love you \r\nI won\'t say I\'ll be true \r\nthere\'s a crimson bird flying \r\nwhen I go down on you \r\n\r\nI\'m so weary and lonesome \r\nand it\'s cold in the night \r\nwhen the path to your doorway \r\nis a pathway of light \r\n\r\ndo you wanna come walk with me? \r\ndo you wanna come walk with me? \r\nif you do baby say it now \r\nthough we\'ll both wonder anyhow \r\n\r\ndo you wanna come walk with me? \r\ndo you wanna come walk with me? \r\ndo you wanna? \r\n\r\nlittle girl have I told you \r\nyou\'re my guiding north star \r\nand my love travels with you \r\nwherever you are \r\n\r\nfrom the mountains to the valley \r\nleave the light on for me \r\nfrom Virginia to Alaska \r\nfrom sea to shining sea \r\n\r\ndo you wanna come walk with me? \r\ndo you wanna come walk with me? \r\nif you do baby say it now \r\nthough we\'ll both wonder anyhow \r\n\r\ndo you wanna come walk with me? \r\ndo you wanna come walk with me? \r\ndo you wanna?\r\n\r\n(feat. Mark Lanegan) ',219,'2021-08-12 20:30:00',NULL),
	(445,'Jagten går ind','G                          C\r\nNu er\'ed tijen nær naturen kalder,\r\n   D                           G\r\nmæ mel\'ma\' å mæ dram ta\'r wi a\'stej\r\n                             C\r\nFuglen\' synger, å\' geværern\' knalder,\r\n    D                         G\r\nfor wi hår nemli\' tawen bøsse mæ\r\n\r\n   G                        C\r\nNu er\'ed intj fordi at a er morder,\r\n    D                            G\r\nnej a\' er tværtom vældig glå\' ve dyrj\r\n                               C\r\nMen nær de li\'frem går i sture horder,\r\n   D                               G\r\nså er maj dælme dum, hvis intj man sky\'r.\r\n\r\nG\r\nA\' så glå for dyrj,\r\n           C                G\r\nså glå for dyrj, så glå for dyrj\r\n      D                         G\r\nSå a\' lukker åltij ywen\' nær a\' sky\'r.\r\n\r\n\r\nDet satan lyn\'me nå mæ nå sport i,\r\nå\' se om maj ka\' ram\' dem li\' i tryn\'\r\nsår\'n te\' dum-dum kuwl i hud\' af hjort\'i,\r\ndet er no kun nåe et gewaldigt syjn\r\n\r\nOm winter\'n gi\'r wi dyern\' lidt til føjen,\r\nen sækfuld hø å\' så måske en ro\'ew\r\nå\' nær de kommer for at æ\'e høen,\r\nså plaffer vi en enkelt eller to\'\r\n\r\nA\' så glå for dyrj´...\r\n\r\nSom\'ti\'er hunner frejet som\'ti\'er hanner,\r\nmen sår\'n nå snak syn\'s a\' no\' kun sort\r\nA\' når kun li\' at se dem nær de render,\r\nog hva\' faen en hjort de\' sgu en hjort\r\n\r\nDe\' hænder os\' a\' vi for skudt no\'n ænder,\r\nwi har en kunstig dam, hvor de går ni\'er\r\nå\' det intj så sjældent at det hænder,\r\na\' rammer jen a\' ellers aldrig ser\r\n\r\nA\' så glå for dyrj´...\r\n\r\nMin nabo tøw\'s en jæger, de\' en rå fyr,\r\nja haj er no for resten li\'e dø\'\r\nA tøw\'s bestemt, haj lign\'t sår\'n te\' rådyr,\r\nda haj sto\' i ruskindsfrak\' ne\' ve\' a sø....\r\nmen a\' lukked\' osse ywen da a\' skø\' ',220,'2021-08-13 09:00:00',NULL),
	(446,'Uv oe yev uv oe seej','Venner smid ham ud af byen, spark ham i hans røv.\r\nHan skal ikke gøre vores piger gravide.\r\n\r\nDu er ikke fra Hirtshals, du er slet ikke li\'som mig -\r\nog du rager mig en skid.\r\nTag din frakke, og tag din hat, og pak så alt dit grej -\r\nspring på toget bare skrid.\r\nTag din guitar, tag dit hash, og tag så og forsvind -\r\nud af øje ud af sind.\r\n\r\nDu siger, du er sanger, og du synger kun om fred - \r\nmen det rager mig en pind.\r\nJeg for slet ikke ro og fred, før du er taget af sted - \r\nud af øje ud af sind.\r\n\r\nVenner smid ham ud af byen, spark ham i hans røv.\r\nHan skal ikke gøre vores piger gravide.\r\nHan er ikke fra Hirtshals, han er slet ikke li\'som mig -\r\nog han rager mig en skid.\r\nDu siger, du er træt af ræset, og du vil stå af - \r\npå et kønt og landligt sted.\r\nMen nu skal du stå på igen, og skrub så væk herfra - \r\nfør vi hjælper dig på gled.\r\n\r\nDit hår er alt for langt, og du går rundt i spraglet tøj -\r\ndu har fuldskæg på din kind.\r\nVi vil ha\' vores by gjort ren for alt slags skidt og møj -\r\nud af øje ud af sind.\r\n\r\nVenner smid ham ud af byen.... ',220,'2021-08-13 21:30:00',NULL),
	(447,'Bondemand Jensen','C                F          C\r\nBondemand Jensen han er sgu snu,\r\n                       G\r\nhan skider på havre og hvede og rug.\r\n    C                 F             C\r\nHar lavet sine marker til en campingplads,\r\n                        G               C\r\nog inde i laden går det løs med beat og jazz.\r\nF                C\r\nUde i haven står roser i flor,\r\nG               C\r\nmen der jo også noget andet gror.\r\n    F                      C\r\nFor Jensen han dyrker lidt krydder til en chillum,\r\n   G                         C\r\nog sælger det hver lørdag på torvet i Billum.\r\nC       F    C      C       G    C\r\nÅåh ja, hvor fedt - ååh ja, hvor fedt.\r\n\r\n\r\nOg hen under aften så er der stripper-tease,\r\nturisterne morer sig med latter og fis.\r\nDet er fru Jensen, der viser sin røv,\r\nhun gør det nok for penge, men også lidt for sjøw.\r\nOg datteren på fjorten er pornomodel,\r\nhun har store bryster sikke da et held.\r\nHun tjener mange penge, men ikke til sig selv,\r\nnej dem ta\'r hr. Jensen til sit luksushotel.\r\n\r\nÅåh ja, hvor fedt - ååh ja, hvor fedt.\r\n\r\nHoteller, restauranter den får, hvad den kan ta\',\r\nfor alt hvad der kan købes, det vil hr. Jensen ha\'.\r\nHan lever i en villa, der nærmest er et slot,\r\ndet lyder skide godt, men det er det rene snot.\r\nMen så en dag, så sker der et krak,\r\nfærdig med Jensen - pænt farvel og tak.\r\nNu tror i vel at Jensen han sidder i spjæld,\r\nnej han er på Mallorca og skider på sin gæld.\r\n\r\nÅåh ja, hvor fedt - ååh ja, hvor fedt.\r\n\r\n        F                       C\r\nMen fru Jensen viser stadig sin bare røv,\r\n   G                      C\r\nnu er\'ed kun for penge og ikke spor for sjøw.\r\n   F                     C\r\nOg datteren er ikke mere pornomodel,\r\n   G                                       C\r\nnu er hun blevet ludder i et tredjerangsbordel.\r\n\r\nÅåh ja, hvor fedt - ååh ja, hvor fedt. ',220,'2021-08-14 10:00:00',NULL),
	(448,'En godhjertet kvinde','    G\r\nHun drømte om lykken\r\n                             C\r\nog ønsked\' kun at være til behag,\r\n        D\r\nmen det liv som han loved\',\r\n                        G\r\ner ikke det hun lever i dag\r\n\r\nMen hun klager aldrig over,\r\n                                C\r\nde mange skøre ting som han har gjort\r\n       D\r\nDer er altid smil og varm mad,\r\n                         G      D\r\nom han er nok så stor en lort.\r\n\r\n          G\r\nHun er en godhjertet kvinde,\r\n                      C\r\nsom kan li\' en munter mand\r\n        D                  \r\nHun har aldrig forstået ham,\r\n                           G\r\nmen hun gør det bedste hun kan\r\n\r\nDen ene dag er som den anden,\r\n                                  C\r\nmen hun har aldrig klaget til sin mand\r\n             D\r\nNej, hun har alt hvad hun ønsker,\r\n                          G\r\ndet si\'r i hvert tilfælde han\r\n\r\nHan gør som han lyster,\r\nog altid kun i gode venners lag.\r\nHallo, det er mig skat,\r\njeg kommer sent hjem i dag.\r\nHun sidder med sit tv,\r\nsin portvin og den uspiste mad.\r\nMen når han kommer hen ad morgen,\r\nså gør hun klar til hans bad.\r\n\r\nHun er en godhjertet kvinde....\r\nHun lever mest af piller,\r\nog skyller dem kun sjældent ned med vand.\r\nMen der er skam ikke noget i vejen,\r\nhun har jo verdens bedste mand.\r\nSå det er da klart hun blev forvirret,\r\nden dag da hun havde taget gas.\r\nOg hun skrev, der står varm mad,\r\npå den sædvanlige plads.\r\n\r\nHun var en godhjertet kvinde,\r\nsom ku\' li\' en munter mand.\r\nDet sagde præsten ved graven,\r\nog alles øjne stod i vand.\r\nDen ene dag var som den anden,\r\nmen hun har aldrig klaget til sin mand.\r\nDet sagde præsten ved graven,\r\nog alles øjne stod i vand....\r\nDet sagde præsten ved graven,\r\nmen han er også kun en mand. ',220,'2021-08-14 22:30:00',NULL),
	(449,'Rulles i tjære og fjer','Rullet i tjære og fjer, rullet i tjære og fjer.\r\nJeg røg ud som et lyn, jeg blev smidt ud af byen -\r\nrullet i tjære og fjer.\r\n\r\nJeg kan sælge dig Lillebæltsbroen,\r\nog Amalienborg med mer\'.\r\nMen når handelen er gjort,\r\nmå jeg skynde mig bort.\r\nJeg bli\'r rullet i tjære og fjer.\r\n\r\nJeg har et kortspil med fjorten esser i,\r\nog en krone der kun viser plat.\r\nJeg er lidt af et fund,\r\nmen i regningens stund,\r\nfår de mig altid på plat\r\n\r\nRullet i tjære og fjer....\r\nHvor er far nu den lede stodder,\r\nmå han rådne under muld og ler.\r\nDa han lærte mig alt,\r\nblev det aldrig fortalt.\r\nMan bli\'r rullet i tjære og fjer.\r\n\r\nRullet i tjære og fjer.... ',220,'2021-08-15 11:00:00',NULL),
	(450,'Luk op for dit TV','        F                       Bb\r\nDer var en mine venner, som kom hen og sagde til mig\r\n        C                                    F\r\nJeg har fået to billetter, og den ene er til dig\r\n        F                      Bb\r\nVi skal til olympiaden i Montreal i Canada.\r\n        F                                             C\r\nMen jeg rystede blot på hovedet, og her er de ord jeg sagde\r\n\r\n               F\r\nLuk op for dit TV, læg dig på din sofa.\r\n               C                F\r\nSnup en enkelt bajer, og en cigare-e-et.\r\n\r\nHvorfor tænke tanker, hvorfor bruge kræfter.\r\n           C                F    C F\r\nNår du har TV, det er skide let.\r\n\r\nDer er altid nogen der siger, at naturen den er skøn,\r\nnår blomsterne de blomstrer, og bøgen den er grøn.\r\nMen at gå en tur i skoven, det er sgu en syg idé,\r\nnår jeg kan sidde med en pilsner, og få det hele på TV.\r\nVi skal ud at se på damer, ud at ha\' en lækker steg - \r\ner der ofte nogen der lokker, men det er sgu ikke mig.\r\nFor der er damer nok på skærmen, og transmission af fødselsveer,\r\nså jeg har ikke noget behov for sex, men jeg er meget ivrig seer.\r\n\r\nLuk op for dit TV....\r\n\r\nNår en dag de smider bomben i en paddehatte sky,\r\nog I løber rundt og hyler - nu er det tid at fly.\r\nJa så åbner jeg for kassen, mens i flygter ud ad byen.\r\nOg jeg får det hele med farver på, det bli\'r et mægtigt syn.\r\n\r\nLuk op for dit TV.... ',220,'2021-08-15 23:30:00',NULL),
	(451,'Volles nr. 69','    A                                         E\r\nHar du besvær med maven, eller gør dit hoved\' ondt,\r\n   A               D             E          A\r\ner sprutten gået i blodet, eller er du nervebundt\r\n   A                                   E\r\nSå hjælper ingen læge, psykiater eller præst,\r\n     A            D            E            A\r\nhvis du vil op på mærkerne, er doktor Volle bedst.\r\n\r\nA                                      E\r\nSkide vær\' med rendski\' og impotens og stress,\r\n    A                D             E            A     \r\nnår bare hver dag du spiser Volles nummer ni og tres\r\n\r\n\r\nVil tiden ikk\' stå stille, og vil uret ikke gå,\r\ner lillebror på værtshus, og har han en brandert på.\r\nSå skriv til doktor Volle, han vil gerne hjælpe dig,\r\ntre - fire piller dagligt og det hele er en leg\r\n\r\n\r\nSkide vær\' med rendski\'....\r\n\r\n\r\nSkal motorvejen føres gennem dit rabarberbed,\r\nkan hjemmeværnet ikke la\' din kone være i fred.\r\nEr dine roser gået ud, og er din flagstang rejst,\r\nhar AGF nu tabt igen og spillet uden gejst.\r\n\r\n\r\nSkide vær\' med rendski\'.... ',220,'2021-08-16 12:00:00',NULL),
	(452,'Neuroser','C\r\nNogle vil ha\' heroin og andre nikotin.\r\nF                           C\r\nNogle vil ha\' sommerdrik og andre medicin.\r\nG                           F\r\nNogen vil ha\' to kvinder og andre øl med malt.\r\nC \r\nAlle vil ha\' et eller andet,\r\nG           C\r\njeg vil ha\' alt.\r\n\r\n           G                 C\r\nJeg har neuroser, jeg har neuroser.\r\n           G                 C\r\nJeg har neuroser, jeg har neuroser.\r\n           F\r\nJeg har neuroser hele tiden,\r\n       G                 C\r\nog jeg plejer dem dag og nat.\r\n\r\n\r\nJeg ta\'r dig måske en gang, jeg ta\'r dig måske fler\'.\r\nOg jeg gør måske noget ved dig, du ikke ved hvad er.\r\nMåske ta\'r jeg din bankbog, måske ta\'r jeg din krop.\r\nMåske ta\'r jeg din gamle mor,\r\nnår jeg har slidt dig op.\r\n\r\nJeg har neuroser....\r\n\r\nJeg drømmer tit om duller, der svømmer i min seng.\r\nJeg drømmer tit om dyr og nogle gange om en dreng.\r\nJeg dræber det der lever, jeg vækker det der er dødt.\r\nJeg ryger mig en heftig tjald,\r\nog sover ind så sødt.\r\n\r\nJeg har neuroser....',220,'2021-08-17 00:30:00',NULL),
	(453,'Nørhalne','C\r\nWi rø\'r int hashish i Nørhalne,\r\n                       G\r\nWi ta\'r int trips mæ LSD\r\n\r\nWi napper os en dram og så en bajer,\r\n                                       C\r\nog det\' kun svin, der intj ka\' nøws mæ\' de\'\r\n\r\nC\r\nWi slår int de gammel ne\' på gajen,\r\n                                G\r\nwi tjør\' int på knallert ejtter ti\'\r\n\r\nDet wildest\', som vi hår, de\' stadig fo\'bold,\r\n                                 C\r\nog så\' der andagt, nær det er forbi\r\n\r\nC\r\nA\' glå for a\' er født i Nørhalne,\r\n                            G\r\nhvor selv en idiot ka\' ha\'e godt\r\n\r\nMen hvis do int er jen af dem fra egnen,\r\n                                    C\r\nså får du jen på ho\'et, så du græ\'r snot\r\n\r\n\r\nWi la\'r int vor\' hår bli\' långt og snawse,\r\nsår\'n som alle de hippier i Aalborg gjør\r\nVor\' børn slår int der\' lærer halvt fordærvet,\r\nnej her er\'ed ham der slår som de\' sig bør\r\n\r\nWi gjør int en fest u\' a\' at knylle,\r\nde\' gjør wi to og to i fre\' og ro\r\nOg er der jen, der rester sår\'n te\' kviefolk,\r\nså ka\' haj dælme gør\'ed mæ sin ko\r\n\r\nJeg er glad for....\r\n\r\nI Nørhalne - norden om - å\' westen ug!!! ',220,'2021-08-17 13:00:00',NULL),
	(454,'Det nationale særpræg','C                           F         C\r\nLørdag formiddag så starter ugens invasion.\r\n                               G\r\nDen røde lampe er hængt ud ved byens detention.\r\nC                          F             C\r\nSvenske skolebørn og pensionister hånd i hånd.\r\n     F             C             G              C\r\nVort broderfolk er kommet for at knytte venskabsbånd.\r\n\r\n   F                         C\r\nDe drikker, de slåsser og de banker os i fodbold.\r\n   G                         C\r\nDe stjæler i butikker, og de hugger vores pi\'r.\r\n     F                           C\r\nHva\' fa\'en er der blevet af vort nationale særpræg.\r\nG                                           C\r\nAlt hvad man kan høre er kun fulde folk der si\'r:\r\n\r\n  C           G              C\r\nHelan går hey kom fallera hurra hurra.\r\n                  G              C\r\nHelan går går hey kom fallera hurra.\r\n\r\n\r\nArabere og tyrkere fylder op på restaurant.\r\nBøf og rødgrød får man kun med udenlandsk accent.\r\nTjeneren er jugoslav og kokken sikkert spansk.\r\nKun fluen som du får i suppen den er pæredansk.\r\n\r\nDe drikker, de slåsser og de banker os i fodbold.\r\nDe stjæler i butikker, og de hugger vores pi\'r.\r\nHva\' fa\'en er der blevet af vort nationale særpræg.\r\nAlt hvad man kan høre er kun fulde folk der si\'r:\r\n\r\nA mustafaja mustafa, a mustafaja mustafa.\r\nA mustafaja mustafa, a mustafaja mustafa.\r\n\r\nI sommer sol og badevejr så bli\'r det ekstra galt.\r\nNår du ta\'r til stranden, er du ved at blive kvalt.\r\nGermaner-patter, prøjser-maver, sauerkraut und bier.\r\nVi sælger vores lebenstraum - to meter for en ti\'er.\r\nDe drikker, de slåsser og de banker os i fodbold.\r\nDe stjæler i butikker, og de hugger vores pi\'r.\r\nHva\' fa\'en er der blevet af vort nationale særpræg.\r\nAlt hvad man kan høre er kun fulde folk der si\'r:\r\n\r\nDeutschland Deutschland über alles (eins zwei drei vier).\r\n\r\nOoh flygte hvo som flygte kan med Spies og Tjæreborg.\r\nDanmark lige fra Skagerack til middelhavet når.\r\nPalma de Malloca lyder måske tem\'li\' spansk,\r\nmen her er flæskesteg og rødkål og en Gammel Dansk. \r\n\r\nVi drikker, vi slåsser og vi glemmer alt om fodbold.\r\nVi stjæler i butikker, og bedrager vores pi\'r.\r\nJa, her har vi bevaret vores nationale særpræg.\r\nAlt hvad man kan høre er kun glade folk der si\'r:\r\n\r\nÅåh vi sejler op ad åen,\r\nvi sejler nedad igen.\r\nDet var vel nok en dejlig sang,\r\nbare den ikke bli\'r for lang.\r\n\r\nSejler op ad åen....HOLD KÆFT ALFRED, NÅR VI ER I GANG MED NOGET PROVINS PUNK. ',220,'2021-08-18 01:30:00',NULL),
	(455,'Carl Anton','    C                F           C\r\nNår nu Carl Anton, a skriver til dæ,\r\n                      G\r\nså ered for a hør, om du er uv på mæ.\r\n   C                         F           C\r\nDu sa\' vi sku\' givtes, og du loved\' mæ a skriv,\r\n    F             C           G              C\r\nmen da du int har gjor\'ed, så ku\'ed godt vær lyv.\r\n\r\n            G                           C\r\nÅh åh, Carl Anton - hvor dælen bli\'r du af.\r\n     G                      C\r\nCarl Anton a venter dæ hver dag\r\n   C                     F\r\nDe ajer her i sognet, de kalder mæ et fæ,\r\nG                                       C\r\nfordi a stadig venter på en horebuk som dæ\r\n\r\n\r\nA husker efter ballet, da vi i høet lå,\r\ndet var så romantisk så\'n uden klæer på\r\nMen så kom min far, å a ska love at do råbt højt,\r\nda haj tog en høtyv, og jog den i din røv\r\n\r\nJa, nu er do jo blevet en meje fin person,\r\nhar fået en uniform og vel også en kanon.\r\nOg a vil sagtens tro til at do må være flot,\r\nså\'n når do vader rundt uden til ved kongens slot\r\n\r\nÅh åh, Carl Anton....\r\n\r\nCarl Anton a er også kommet i nogen ajer klæer,\r\nmen de er ikke så stram som dem i har ve militæred\r\nFor efter do er rejst, har a fået en ny figur,\r\nog a ser herrens ud, når a står i positur.\r\n\r\nÅh åh, Carl Anton.... ',220,'2021-08-18 14:00:00',NULL),
	(456,'A ku intj tænk mæ å fløet te Tjøbenhavn','Jeg er Vendelbo, og det er jeg dælme glad ved.\r\nVi er de bedste af alle forskellige folk på jord.\r\nOg det \"land\" hvor vi har slået vores rødder,\r\ndet er skræddersyet til guds englekor.\r\nBare det at gå en tur ud på stranden,\r\nog en måge der skider i dit hår.\r\nEllers trave hen over heden med hinanden,\r\nog en hugorm der \"jawer\" efter dit lår.\r\n\r\nNej, jeg ku aldrig tænke mig at flytte til København.\r\nDer ser alting ud som var det fastelavn. \r\n\r\nJeg har øl, og jeg har bjæsk i lange baner.\r\nJeg har sulemad på bordet dag og nat.\r\nOg når vommen den fuld, og jeg har ræbet,\r\nså går mor og mig i gang med en tagfat.\r\nBare det at tage sin mellemmad med i skoven,\r\nog myrerne pisser på den, så det sviger.\r\nEllers lægge sig i en høstak og være doven,\r\nog tænke på grønlangkål eller piger.\r\n\r\nNej, jeg ku aldrig....\r\n\r\nJeg er glad for livet, og jeg har mange glæder.\r\nJeg æder, drikker, avler og jeg skråer.\r\nDet er nu sådan de interesser jeg går op i,\r\nog så at blive kløet på ryggen af vor mor.\r\nBare det at ligge og stirre op i himlen,\r\nog din lu\' bli\'r ædt af naboens brogede ko.\r\nEller gå til bal i kroen og midt i vrimlen,\r\ner der en, der brækker sig over dine søndagssko.\r\n\r\nNej, jeg ku aldrig.... ',220,'2021-08-19 02:30:00',NULL),
	(457,'Olga','D                    G         D\r\nOlga min ven hvor er do dragen hen,\r\n                         A  \r\nhar do no forladt mæ no igjen\r\nD                         G          D \r\nDo er stukken av på selve juleavtens dav,\r\n                A            D\r\nå\' do har tagen hønsen mæ herfra.\r\n\r\nOlga a tænker tilbawe på den ti\',\r\nnår vi gjord de ting, som a ku\' li\'\r\nDo var så bar som et støjt mæ tatar,\r\nog når do kaldt, så var a åltij klar\r\n\r\nOlga dit fæ hvorfor ræst do fra mæ,\r\na kan int klared det ujen dæ\r\nOg grisen de spø\'r, om hva de no ska gjør\',\r\nnår do intj vil lav der daglig grø\'r\r\n\r\nOlga de seijr, at det snart vil bli beíjr,\r\nmen a har intj lyst til livet mier.\r\nA\' kan intj glæm\' dæ, åh Olga kom hjem,\r\nfor tyren den ska malkes klokken fem. ',220,'2021-08-19 15:00:00',NULL),
	(458,'Folde - ud - mand','Jeg vil så gerne være folde-ud-mand - i Ugens Rapport.\r\nDe bruger aldrig andet end nøgne kællinger,\r\nog det synes jeg er noget lort.\r\nJeg har en torso, der siger spar to\r\ntil alt hvad man kan finde hos Brigitte Bardot.\r\nJeg vil så gerne være folde-ud-mand - i Ugens Rapport.\r\n\r\nForleden dag der købte jeg et lækkert lille blad\r\nmed billeder af 34 kvinder i bad.\r\nDet var et farveorgie i blegfedt kød,\r\ndet meste af det lignede sgu den sorte død.\r\nNogle havde bryster så store som tornyster,\r\nflere af de andre var bare en slags knyster.\r\nDesværre så er den slags et lukket land\r\nfor en almindelig velskabt mand.\r\n\r\nJeg vil så gerne....\r\nDer er da masser af dejlige mandfolk, der har både til gården og til gaden,\r\nse dog bare på mig, hvad synes I om facaden.\r\nJeg har bryster som balloner og baller som Mont Pigeoner,\r\nhvor tit finder man nogen med den slags faconer.\r\nSå hør nu hvad jeg vil, lad mig komme til,\r\njeg vil også være med i det seksuelle spil.\r\nHvorfor faen skal den slags være lukket land,\r\nfor en mand der ligner Tarzan.\r\n\r\nJeg vil så gerne.... ',220,'2021-08-20 03:30:00',NULL),
	(459,'Banko','Når jeg har lagt mig efter middag,\r\nog når konen i køkkenet står.\r\nTa\'r jeg mig en stille bajer,\r\nimens kaffen står og snurrer.\r\nOg jeg læser i avisen,\r\nden fyldt med ord og tal.\r\nMen se der er fanden fiseme,\r\nkæmpe spil i vor bingohal.\r\n\r\nKone vil du med til banko?\r\nHar du lyst til at spille?\r\nHvad er det for noget pjank du?\r\nNå men så går jeg da selv,\r\ndu er en klovn, dit gamle fjog.\r\n\r\nAndespil det er noget jeg kan li\',\r\nman kan vinde en hel halv ko.\r\nMen det værste, det ham ved siden af,\r\nfor han mangler kun nummer to. \r\nUha nu fik han banko,\r\njeg bliver dæleme så sur.\r\nHan sku ha\' haft nogen bank du.\r\nNå, vi begynder på ny,\r\nsagde han syvoghalvtreds,\r\nså var jeg nu tilfreds.\r\n\r\nNu er det li\'som pulsen,\r\nfår jeg mangler kun halvfems.\r\nGlemmer alt om druk og piger.\r\nKom nu med den, den bette fims.\r\n\r\nNu tror jeg nok jeg får banko.\r\nJeg bliver svedt og nervøs.\r\nDet er lige før jeg får banko.\r\nSå var en der nøs,\r\nham sku\' satan da ta\',\r\nfor alle mine brikker røg af.',220,'2021-08-20 16:00:00',NULL),
	(460,'To gears Disella','Hør nu starter de motoren,\r\novre ved Olsens kaffebar.\r\nDe pudser så det skinner,\r\nder er ingen støv og bla\'r.\r\nDe har alle sammen kvindfolk,\r\nder hænger bagen til.\r\nJa det er nogle vældige karlfolk,\r\nmen hva\' sjov er der ved det?\r\n\r\nDe snakker kun om tændrør\r\nog om topstyk\' og benzin.\r\nEllers ved de ingenting,\r\njeg synes da de er til grin.\r\nDer er andet her i verden\r\nend Honda og BSA.\r\nMen når jeg siger det,\r\nså spørger Ella altid hva\'?\r\n\r\nNej det er så svært at forklare Ella,\r\nat jeg kun har en to gears Disella.\r\nAf ældre model.\r\n\r\nJamen tænkt sig sådan et monstrum,\r\nhvad det kan koste af penge.\r\nDet er ligeså dyrt som fire stole\r\nog spisebord og seng.\r\nJeg synes nu vi skulle spare lidt,\r\nog få et typehus.\r\nMen Ella hun er tosset,\r\nhun vil hellere ud at suse.\r\nNår Ella ser de knajt-røve,\r\ni deres hjelm og lædertøj.\r\nSå stiller hun sig an,\r\nog gør sig til, så jeg bliver flov.\r\nOg når jeg så vil ha\' et kys,\r\nså skubber hun mig fra.\r\nHun siger, det hedder ikke jeg vil ha.\r\nDet hedder \"Yamaha\"!\r\n\r\nNej det er så svært....\r\n\r\nI søndags var der motorløb,\r\nham Olsen han var med.\r\nJeg tænkte det kunne hjælpe på Ella,\r\nså vi rejste af sted.\r\nHun siger han bruger cyklen\r\ntil at øge potensen med.\r\nMen min potens er god nok,\r\nmen hvem vil tro på det?\r\n\r\nHun skabte sig, og hun råbte og skreg,\r\nog for at få lidt ro.\r\nSå lovede jeg at købe en ting,\r\nhvor der plads til to.\r\nMen jeg er så fornuftig,\r\nså jeg købte en 2 CV.\r\nOg nu er Ella rendt sin vej,\r\n....Med en BMW.\r\n\r\nNej det er så svært....',220,'2021-08-21 04:30:00',NULL),
