	(462,'Old Shoes (And Picture Postcards)','I\'m singing this song, it\'s time it was sung\r\nI\'ve been putting it off for a while,\r\nBut it\'s harder by now, \'cause the truth is so clear\r\nThat I cry when I\'m seeing you smile.\r\nSo goodbye, so long, the road calls me dear\r\nAnd your tears cannot bind me anymore,\r\nAnd farewell to the girl with the sun in her eyes\r\nCan I kiss you, and then I\'ll be gone.\r\n\r\nEvery time that I tried to tell\r\nthat we\'d lost the magic we had at the start,\r\nI would weep my heart when I looked in your eyes\r\nAnd I searched once again for the spark.\r\nSo goodbye, so long, the road calls me dear\r\nAnd your tears cannot bind me anymore,\r\nAnd farewell to the girl with the sun in her eyes\r\nCan I kiss you, and then I\'ll be gone.\r\n\r\nI can see by your eyes, it\'s time now to go\r\nSo I\'ll leave you to cry in the rain,\r\nThough I held in my hand, the key to all joy\r\nHoney my heart was not born to be tamed.\r\nSo goodbye, so long, the road calls me dear\r\nAnd your tears cannot bind me anymore,\r\nAnd farewell to the girl with the sun in her eyes\r\nCan I kiss you, and then I\'ll be gone.\r\n\r\nSo goodbye, so long, the road calls me dear\r\nAnd your tears cannot bind me anymore,\r\nAnd farewell to the girl with the sun in her eyes\r\nCan I kiss you, and then I\'ll be gone,\r\nCan I kiss you, and then I\'ll be gone,\r\ncan I kiss you, and then I\'ll be gone.',214,'2021-08-22 05:30:00',NULL),
	(463,'This is my life','C C C          G   Am \r\n    This is my life\r\n               F   Am\r\n    this is my time\r\n                   G\r\n    to show me the light\r\n        F    C\r\n    and I go there.\r\n\r\nC C           G   Am\r\n  Give me the wine\r\n             F    Am\r\n  bitter and sweet\r\n                      G\r\n  and a little bit of bread\r\n         F     C\r\n  that\'s all I need.\r\n\r\nC Am                   E\r\n  No, I don\'t want the gold from Xanadu\r\n  I think I leave it all to you \r\n  wow wow wow \r\n  this is my life and I don\'t care.\r\n\r\nThis is my street, uh uh uh uh\r\nare you restless feet\r\ncarry me on to anywhere.\r\n\r\nTake the fear\r\ntake it away\r\nand give me some hope\r\nfor one more day.\r\n\r\nI saw a ghost behind the door \r\nwhen the kids were coming home from the war\r\nwow wow wow\r\nwith broken dreams and nothing more.\r\n\r\nahh I heard a woman, singing her song\r\nand it was good, and warm and strong\r\nwow wow wow\r\nShe made me cry, I don\'t know why.\r\n\r\nAs a woman, singing her song\r\nand it was good, and warm and strong\r\nwow wow wow\r\nShe made me cry, I don\'t know why.\r\n\r\nNo No No \r\n\r\nI don\'t want to bring you down\r\nI think it\'s good to be here,\r\nwow wow wow \r\nthis is my life and I don\'t care.\r\n',89,'2021-08-22 18:00:00',NULL),
	(464,'Old Dan Tucker','Now old Dan Tucker\'s fine old man\r\nWashed his face in a fryin\' pan\r\nCombed his head with a wagon wheel\r\nAnd died with a toothache in his heel\r\n\r\nGet out of the way old Dan Tucker\r\nGet out of the way old Dan Tucker\r\nGet out of the way old Dan Tucker\r\nYou\'re too late to get your supper\r\n\r\nNow old Dan Tucker is come to town\r\nRiding a billy goat leading a hound\r\nHound dog bark and the billy goat jump\r\nLanded Dan Tucker on top of the stump\r\n\r\nNow old Dan Tucker he got drunk\r\nFell in the fire and kicked up a chunk\r\nRed hot coal got in his shoe\r\nAnd oh my lawd how the ashes flew\r\n\r\nNow old Dan Tucker is come to town\r\nSwinging the ladies round and round\r\nFirst to the right and then to the left\r\nThen to the girl that he loves best',221,'2021-08-23 06:30:00',NULL),
	(465,'Jesse James','Jesse James was a lad that killed many a man,\r\nHe robbed the Glendale train,\r\nHe stole from the rich and he gave to the poor,\r\nHe\'d a hand and a heart and a brain.\r\n\r\nWell it was Robert Ford, that dirty little coward,\r\nI wonder how he feel,\r\nFor he ate of Jesse\'s bread and he slept in Jesse\'s bed,\r\nThen he laid poor Jesse in his grave.\r\n\r\n(chours)\r\nWell Jesse had a wife to mourn for his life\r\nThree children now they were brave\r\nWell that dirty little coward that shot Mr. Howard\r\nHe laid poor Jesse in his grave\r\n\r\nJesse was a man, a friend to the poor,\r\nHe\'d never rob a mother or a child\r\nThere never was a man with the law in his hand\r\nThat could take Jesse James alive\r\n\r\nIt was on a Saturday night and the moon was shining bright,\r\nThey robbed the Glendale train,\r\nAnd people they did say o\'er many miles away\r\nIt was those outlaws,Ther\'re Frank and Jesse James\r\n\r\n(Chours)\r\nNow the people held their breath when they heard of Jesse\'s death,\r\nAnd wondered how he ever came to fall\r\nRobert Ford,It was a fact,He shot Jesse in the back\r\nWhile Jesse hung a picture on the wall\r\n\r\nNow Jesse went to rest with his hand on his breast,\r\nThe devil will be upon his knee.\r\nHe was born one day in the County Clay,\r\nAnd he came from a solitary race.\r\n(Chours)',71,'2021-08-23 19:00:00',NULL),
	(466,'Mrs. McGrath','\"Oh, Mrs. McGrath,\" the sergeant said \r\n\"Would you like to make a soldier out of your son Ted \r\nWith a scarlett coat and a big cocked hat \r\nOh, Mrs. McGrath, wouldn\'t you like that?\" \r\n\r\nChorus: \r\nWith your too-ri-a, fol-di-diddle-da, too-ri, oor-ri, oor-ri-a \r\nWith your too-ri-a, fol-di-diddle-da, too-ri, oor-ri, oor-ri-a \r\n\r\nNow, Mrs. McGrath lived on the shore \r\nFor the space of seven long years or more \r\nShe spied a ship coming into the bay \r\nWith her son from far away\" \r\n\r\n\"Oh captain dear, where have you been \r\nYou?ve been sailing the Mediterranean \r\nHave you news of my son Ted \r\nIs he living or is he dead?\" \r\n\r\nChorus \r\n\r\nUp came Ted without any legs \r\nAnd in their place, two wooden pegs, \r\nShe kissed him a dozen times or two \r\nAnd said \"My god, Ted is it you\" \r\n\r\n\"Now were you drunk or were you blind \r\nWhen you left your two fine legs behind \r\nOr was it walking upon the sea\r\nThat wore your two fine legs away?\" \r\n\r\nChorus \r\n\r\n\"No, I wasn\'t drunk and I wasn\'t blind \r\nWhen I left my two fine legs behind \r\nA big cannon ball on the fifth of May \r\nTore my two fine legs away\" \r\n\r\n\"Oh, Teddyboy,\" the widow cried \r\n\"Your two fine legs were your mothers pride \r\nStumps of a tree won\'t do at all \r\nWhy didn\'t you run from the big cannon ball?\" \r\n\r\nChorus \r\n\r\n\"All foreign wars I do proclaim \r\nlive on the blood and the mothers pain \r\nI\'d rather have my son as he used to be \r\nThan the King of America and his whole navy\" \r\n\r\nChorus',71,'2021-08-24 07:30:00',NULL),
	(467,'John Henry','One, two, three\r\nWell, John Henry was a little baby\r\nSittin\' on his dady\'s knee\r\nHe pick up a hammer and a little piece of steel,\r\nAnd cried, \"Hammer\'s gonna be the death of me, Lord, Lord\r\nHammer\'s gonna be the death of me\"\r\n\r\nNow the captain he said to John Henry,\r\n\"I\'m gonna bring that steam drill \'round\r\nI\'m gonna bring that steam drill out on these tracks\r\nI\'m gonna knock that steel on down, God, God\r\nGonna knock that steel on down\"\r\n\r\nJohn Henry told his captain,\r\n\"Lord, man ain\'t nothin\' but a man\r\nBefore I let that steam drill beat me down\r\nI\'m gonna die with a hammer in my hand, Lord, Lord\r\nDie with a hammer in my hand\"\r\nViolin Soozie!\r\n\r\nJohn Henry driving on the right side\r\nThat steam drill driving on the left\r\nSays, \"Before I\'ll let your steam drill beat me down\r\nI\'m gonna hammer myself to death, Lord, Lord\r\nI\'ll hammer my fool self to death\"\r\n\r\nWell, captain said to John Henry,\r\n\"What is that storm I hear?\"\r\nJohn Henry said, \"That ain\'t no storm\r\nCaptain, that\'s just my hammer in the air, Lord, Lord\r\nThat\'s just my hammer in the air\"\r\n\r\nJohn Henry said to his shaker\r\n\"Shaker, why don\'t you sing?\r\n\'Cause I\'m swigin\' thirty pounds from my hips on down\r\nYeah, listen to my cold steel ring, Lord, Lord\r\nListen to my cold steel ring\"\r\nCome on accordion now!\r\n\r\nI wanna hear that banjo too!\r\n\r\n???\r\nNow John Henry, he hammered in the mountains\r\nHis hammer was striking fire\r\nBut he worked so hard, he broke his heart\r\nJohn Henry laid his hammer and died, Lord, Lord\r\nJohn Henry laid down his hammer and died\r\n\r\nWell, now John Henry, he had him a woman\r\nHer name was Polly Ann\r\nShe walked down to those tracks, picked up John Henry\'s hammer\r\nPolly drove steel like a man, Lord, Lord\r\nPolly drove that steel like a man\r\nHey!\r\n\r\nWell every, every Monday morning\r\nWhen the bluebird he begin to sing\r\nYou can hear John Henry from a mile or more\r\nYou can hear John Henry\'s hammer ring, Lord, Lord\r\nYou can hear John Henry\'s hammer ring\r\nsay it again!\r\n\r\nSo you can hear John Henry\'s hammer ring, Lord, Lord\r\nYou can hear John Henry\'s hammer ring\r\nCome on! Woah!',71,'2021-08-24 20:00:00',NULL),
	(468,'My Oklahoma Home','When they opened up the strip I was young and full of zip,\r\nI wanted some place to call my own.\r\nAnd so I made the race, and staked me out a place,\r\nAnd settled down along the Cimarron.\r\n\r\nIt blowed away, it blowed away,\r\nMy Oklahoma home, it blowed away.\r\nIt looked so green and fair when I built my shanty there,\r\nBut my Oklahoma home, it blowed away.\r\n\r\nI planted wheat and oats, got some chickens and some shoats,\r\nAimed to have some ham and eggs to feed my face.\r\nGot a mule to pull the plow, got an old red muley cow\r\nAnd got a fancy mortgage on the place.\r\n\r\nIt blowed away, it blowed away,\r\nAll the crops I planted blowed away.\r\nYou can\'t grow any grain if you ain\'t got any rain;\r\nAll except the mortgage blowed away.\r\n\r\nIt looked so green and fair, when I built my shanty there,\r\nI figured I was all set for life.\r\nI put on my Sunday best with my fancy scalloped vest\r\nAnd went to town and picked me out a wife.\r\n\r\nShe blowed away, she blowed away\r\nMy Oklahoma woman blowed away.\r\nMister as I bent and kissed her, she was picked up by a twister;\r\nMy Oklahoma woman blowed away.\r\n\r\nThen I was left alone a-listenin\' to the moan\r\nOf the wind around the corners of my shack;\r\nSo I took off down the road when the south wind blowed,\r\nA-travelin\' with the wind at my back.\r\n\r\nI blowed away, I blowed away\r\nChasin\' a dust cloud up ahead.\r\nOnce it looked so green and fair, now it\'s up there in the air;\r\nMy Oklahoma farm is overhead.\r\n\r\nNow I\'m always close to home no matter where I roam,\r\nFor Oklahoma dust is everywhere.\r\nMakes no difference where I\'m walkin\', I can hear my chickens squawkin\'\r\nI can hear my wife a-talkin\' in the air.\r\n\r\nIt blowed away, it blowed away,\r\nMy Oklahoma home blowed away.\r\nBut my home is always near; it\'s in the atmosphere,\r\nMy Oklahoma home that blowed away.\r\n\r\nI\'m a roamin\' Oklahoman, but I\'m always close to home\r\nAnd I\'ll never get homesick \'til I die.\r\nNo matter where I\'m found, my home is all around;\r\nMy Oklahoma home is in the sky.\r\n\r\nIt blowed away, it blowed away,\r\nMy farm down upon the Cimarron.\r\nBut all around the world, wherever dust is whirled,\r\nSome is from my Oklahoma home.\r\n\r\nIt blowed away, it blowed away,\r\nMy Oklahoma home blowed away.\r\nOh it\'s up there in the sky in that dust cloud rolling by, my Oklahoma home is blowed away.',71,'2021-08-25 08:30:00',NULL),
