	(470,'Uhadada - så slem han var','Venner kom og lyt til hvad jeg her har at fortælle\r\nDet er en historie der handler om en dreng\r\nMange år er gået siden dengang da han boede\r\nHer på gården Katfred i byen Lønneberg\r\n\r\nUhadada så slem han var ? folk mindes ham endnu\r\nEmil var navnet som han bar ? Emil ja husk det nu\r\n\r\nUhadada - Uhadada - Uhadada ? Uha\r\nUhadada - Uhadada - Uhadada ? Uha\r\n\r\nVenner kom og lyt til hvad jeg her har at fortælle\r\nHør blot hvad Emil han fandt på en dag i maj\r\nOp i Katfreds flagstang hejste han sin lille søster\r\nI kan vel forstå at der blev en stor ståhej\r\n\r\nUhadada så slem han var ? men Ida var så kry\r\nOg ingen anden svævet har så højt i vores by\r\n\r\nNu skal jeg fortælle om den dag da vi fik suppe\r\nOg Emil sit hoved stak i terrinen ned\r\nHen til doktoren måtte vor Emil og tænk terrinen\r\nSad om hovedet fastklemt hvor meget vi end sled\r\n\r\nUhadada så slem han var ? for I forstår jo godt\r\nMan ikke i terrinen har plads til en slikkepot\r\n\r\nVenner det er ikke alt jeg når jer at fortælle\r\nFor Emil ku? lave spilopper dagen lang\r\nHan blev sat i snedkerboden for at blive artig\r\nHusk det I som sidder og lytter til min sang\r\n\r\nUhadada så slem han var ? han overgår vist alt\r\nI småland aldrig nogen har gjort så meget galt\r\n\r\nUhadada - Uhadada - Uhadada ? Uha\r\nUhadada - Uhadada - Uhadada ? Uha\r\n',222,'2021-08-26 09:30:00',NULL),
	(471,'Hva\' gør vi nu, lille du','Jeg kom til verden på 5. sal\r\nmin far var tosset min mor var normal\r\nmen da de kørte ham væk sagde mor til mig:\r\n\r\nHvad gør vi nu lille du?\r\n\r\nJeg gik i skole i mange år\r\nrøg på fabrik og fik mavesår\r\nog så en dag sparked\' bossen mig ud.\r\n\r\nHvad gør man så lille du?\r\n\r\nOg tiden gik og jeg gik med\r\njeg fløj af sted fra sted til sted\r\nog gadens løse fugle de fløjted\' og sang:\r\n\r\nHvor skal vi hen lille du?\r\n\r\nMen så en dag gik jeg op til ministeren og sagde:\r\nDu der - få lige fødderne ned og ta\' hatten af!\r\nMand kan du ikke se at det hele er ved at gå\r\nfuldstændig agurk?!\r\n\r\nSå hvad gør vi nu din gamle skurk?\r\n\r\nMen han grinte bare og sagde:\r\nDig, du kan sgu gå fanden i vold!\r\nSå det gør vi nu, lille du.\r\nJa, vi gør!',89,'2021-08-26 22:00:00',NULL),
	(472,'Smuk og dejlig','Jeg gik ind til byen for at kigge efter dig\r\nog pludselig stod du der i mængden\r\nog smilede til mig\r\n\r\nJa alle folk kan se det straks\r\nDu er så smuk og dejlig\r\nOg dine øjne skinner\r\nDu må hellere passe på\r\nJa alle folk kan se det straks\r\nDu er så smuk og dejlig\r\nOg dine øjne skinner\r\nDu må hellere passe på\r\n\r\nJa pas på at ilden i mig ikke bliver tændt\r\nVi kunne begge to meget vel blive forbrændt\r\nMen det er ikke let\r\nFor du er så smuk og dejlig\r\nDine øjne skinner\r\nTag og kig den anden vej\r\nDu er lidt forvirret\r\nSiger du og ler\r\nSmiler lidt vemodigt\r\n\r\nNår du spør? mig\r\nHvad er det der sker\r\nMen jeg ved det heller ikke\r\nDu er så smuk og dejlig\r\nDine øjne skinner stærkere end nogen sol\r\nDu er lidt forvirret\r\nSiger du og ler\r\nSmiler lidt vemodigt\r\n\r\nNår du spør? mig\r\nHvad er det der sker\r\nDu er så smuk og dejlig\r\n\r\nDine øjne skinner stærkere end nogen sol\r\nDet er ikke let for du er så smuk og dejlig\r\nDine øjne skinner stærkere end nogen sol\r\nDet er ikke let for du er så smuk og dejlig\r\nDine øjne skinner stærkere end nogen sol\r\nDet er ikke let for du er så smuk og dejlig',223,'2021-08-27 10:30:00',NULL),
	(473,'Kvinde min','Kvinde min jeg elsker dig\r\nog jeg ved du elsker mig\r\nog hvad der så end sker\r\nåh la det ske\r\nfor jeg er din\r\nog selv om vi har skændtes tit\r\nog du har grædt og lidt\r\nnår det har været slemt\r\nså glem det nu\r\nfor jeg er din.\r\n\r\nÅh, jeg har huslet\r\nog spillet tosset\r\nog jeg har snydt dig ja\r\nog skammet mig\r\nog stjålet af din kærlighed\r\ndu ved besked.\r\nåh ja\r\nåh ja\r\nwowwa og bababiliåh\r\n\r\nfor du er stadigvæk akkurat lige så smuk\r\nsom allerførste gang da du kyssede mig\r\nså inderligt\r\nså inderligt.\r\n\r\nTror du vi ska følges ad\r\ntil livet det er slut\r\nåh det håber jeg\r\nja jeg gør ja jeg gør.\r\nSå kvinde kom og drøm med mig\r\ni den lange nat\r\nnår stjernerne de funkler\r\nog blinker som besat.\r\n\r\nNej, bliv ikke bange\r\nfor deres sange.\r\nHold bare fast i mig\r\nnår de fortæller dig\r\nat der er tusinde mil\r\nimellem dig og mig.\r\n\r\nNej nej\r\nåh tro det ej\r\nwauwa og bababiliåh\r\n\r\nfor du er stadigvæk akkurat lige så smuk\r\nsom allerførste gang da du kyssede mig\r\nså inderligt\r\nså inderligt',89,'2021-08-27 23:00:00',NULL),
	(476,'You Never Can Tell','It was a teenage wedding, and the old folks wished them well \r\nYou could see that Pierre did truly love the madamoiselle \r\nAnd now the young monsieur and madame have rung the chapel bell, \r\n\"C\'est la vie\", say the old folks, it goes to show you never can tell \r\n\r\nThey furnished off an apartment with a two room Roebuck sale \r\nThe coolerator was crammed with TV dinners and ginger ale, \r\nBut when Pierre found work, the little money comin\' worked out well \r\n\"C\'est la vie\", say the old folks, it goes to show you never can tell \r\n\r\nThey had a hi-fi phono, boy, did they let it blast \r\nSeven hundred little records, all rock, rhythm and jazz \r\nBut when the sun went down, the rapid tempo of the music fell \r\n\"C\'est la vie\", say the old folks, it goes to show you never can tell \r\n\r\nThey bought a souped-up jitney, \'twas a cherry red \'53, \r\nThey drove it down to Orleans to celebrate the anniversary \r\nIt was there that Pierre was married to the lovely madamoiselle \r\n\"C\'est la vie\", say the old folks, it goes to show you never can tell',225,'2021-08-28 11:30:00',NULL),
