	(478,'Skovsangen','Vil du med en tur i skoven, Der er så mange træer\r\nrundt omkring dig og for oven.\r\n\r\nHalløjsa kom så med, så tager vi afsted\r\nder er så fuld af sjov, inde i en skov.\r\n\r\nDer er massevis af fugle, du høre nok en gøg\r\nog du ser måske en ugle.\r\n\r\nHalløjsa kom så med, så tager vi afsted\r\nder er så fuld af sjov, inde i en skov.\r\n\r\nHør engang hver ganske stille, HR Spætte banker på\r\nog en sangfugl slår en trille.\r\n\r\nHalløjsa kom så med, så tager vi afsted\r\nder er så fuld af sjov, inde i en skov.\r\n\r\nRæven jager mus og fugle, men hvis den møder dig\r\ngemmer den sig i sin hule.\r\n\r\nHalløjsa kom så med, så tager vi afsted\r\nder er så fuld af sjov, inde i en skov.\r\n\r\nDet kan være du ser hjorte, de springer raskt afsted\r\nen to tre så er de borte.\r\n\r\nHalløjsa kom så med, så tager vi afsted\r\nder er så fuld af sjov, inde i en skov.\r\n\r\nSe det lille egern hoppe, en lille festlig fyr\r\noppe mellem trærenes toppe.\r\n\r\nHalløjsa kom så med, så tager vi afsted\r\nder er så fuld af sjov, inde i en skov.\r\n\r\nHør et pindsvin det kan snøfte, men det har pigge på\r\nså lad hellere være og løfte det.\r\n\r\nHalløjsa kom så med, så tager vi afsted\r\nder er så fuld af sjov, inde i en skov.\r\n\r\nVers: F-F-Bb-G7-C\r\nOmk: F-F-Bb-Ho-F,Dm7-G7-C-F \r\n',226,'2021-08-29 12:30:00',NULL),
	(479,'Buster','C                              G \r\nStille, stille, stille nu står solen op \r\nC           F            C   G \r\n-   Nattens trolde er forsvundet \r\n    Em7         Am7       Em7   Am7 \r\nDen sidste fløj bort i en kaffe kop \r\nD7                       G \r\n  -  og bli\'r nok aldrig fundet. \r\n    C                    G \r\nDet hyler og tuder i det fjerne nu \r\nC        F              C   G\r\n- verden drøner hastigt vid\'re \r\n    Em7       Am7       F \r\nmen klovnerne danser og folk dør af grin \r\nD7              G\r\n- og fuglene de kvidrer\r\n \r\n\r\nOMKVÆD:\r\n\r\n   C   -  F     C  -  F \r\nÅh Buster \r\n   C   -  F     C  -  F \r\nÅh Buster\r\n   C                G\r\nÅh Buster kigger på stjernerne \r\n   F                          Am    Bb\r\nog drømmer sig langt ud i det blå-å-åå \r\n\r\nStille, stille, stille, nu står solen op \r\n- Der er varmt under dynen \r\nhan strækker sin søvnige, dovne krop \r\n- og gnider sig på trynen \r\n\r\nBuster kan noget andre ikke kan \r\n- han har nem\'lig lært at trylle \r\nEn gang bli\'r han sikkert en stor og mægtig mand \r\n- som hele verden vil hylde \r\n\r\n(OMKVÆD)\r\n\r\nC stk:\r\n\r\n   C   -   F     C   -   F \r\nÅh Buster \r\n   C   -   F       C   -   F \r\nÅh Buster \r\n    C           E     C   F \r\nsom sprunget ud af et eventyr \r\nAm          E7         Am   D7 \r\nrider han afsted på et fabeldyr\r\n   F                          Am      Bb \r\nog drømmer sig langt ud i det blå \r\n\r\n(OMKVÆD)\r\n',227,'2021-08-30 01:00:00',NULL),
