	(481,'Se Venedig og dø','F                      Gm\r\nÅh Luigi ja nu skriver jeg igen\r\nC7                              F\r\nka? du huske at du var min søde ven\r\n                         Gm\r\nda vi sad og kyssed i gondolerne\r\nC7                         F\r\nog du tog mig kærligt på gajolerne\r\n                         Gm \r\nKa? du huske da du sagde jeg er din\r\nCm           D7          G  (A)(Bb)(H)F\r\nog du sang sonater i det kla-re må-ne-skin\r\n      C7\r\nÅh, Luigi \r\n    F\r\nMåneskin\r\n      C7       F        C7\r\nåh, Luigi se Venedig og dø.\r\n\r\n\r\nÅh du var faneme dejlig, da du sa? til mig\r\nmå jeg godt ha? lov at invitere dig\r\npå en middag i min pappas pizzabar\r\nog jeg sukkede og sagde hva?be?har.\r\nOg Fellini spillede på violin\r\nog du sang sonater i det klare måneskin.\r\nÅh, Luigi måneskin\r\nåh, Luigi se Venedig og dø.\r\n\r\nÅh du var smuk som en gud og fiks på fingrene\r\nog gadelysene de flimrede\r\nda du fulgte med mig hjem til mit hotel\r\nnatportier?en sov og det var vores held.\r\nJeg ku? mærke skægstubbene på din kind\r\nda du sang sonater i det klare måneskin.\r\nÅh, Luigi måneskin\r\nåh, Luigi se Venedig og dø.',229,'2021-08-31 02:00:00',NULL),
	(482,'Ring them bells','Ring them bells, ye heathen\r\nFrom the city that dreams,\r\nRing them bells from the sanctuaries\r\nCross the valleys and streams,\r\nFor they\'re deep and they\'re wide\r\nAnd the world\'s on its side\r\nAnd time is running backwards\r\nAnd so is the bride.\r\n\r\nRing them bells St. Peter\r\nWhere the four winds blow,\r\nRing them bells with an iron hand\r\nSo the people will know.\r\nOh it\'s rush hour now\r\nOn the wheel and the plow\r\nAnd the sun is going down\r\nUpon the sacred cow.\r\n\r\nRing them bells Sweet Martha,\r\nFor the poor man\'s son,\r\nRing them bells so the world will know\r\nThat God is one.\r\nOh the shepherd is asleep\r\nWhere the willows weep\r\nAnd the mountains are filled\r\nWith lost sheep.\r\n\r\nRing them bells for the blind and the deaf,\r\nRing them bells for all of us who are left,\r\nRing them bells for the chosen few\r\nWho will judge the many when the game is through.\r\nRing them bells, for the time that flies,\r\nFor the child that cries\r\nWhen innocence dies.\r\n\r\nRing them bells St. Catherine\r\nFrom the top of the room,\r\nRing them from the fortress\r\nFor the lilies that bloom.\r\nOh the lines are long\r\nAnd the fighting is strong\r\nAnd they\'re breaking down the distance\r\nBetween right and wrong.',7,'2021-08-31 14:30:00',NULL),
	(483,'With God on our side','A              D A         E7            A\r\nMy name, it is nothing; my age, it means less\r\n              F#m            D                A\r\nThe country I come from is a part of the free West\r\n                         F#m           D        A\r\nI was taught and brought up there, its laws to abide\r\n                         D    A      E7         A\r\nAnd that the land that I live in has God on its side\r\n\r\nVerse 2:\r\nOh the history books tell it, they tell it so well\r\nThe cavalries charged, the Indians fell\r\nThe cavalries charged, the Indians died\r\nFor the country was young with God on its side\r\n\r\nVerse 3:\r\nThen the first World War, it came and it went\r\nThe reason for fighting, I never could get\r\nBut I learned to accept it, accept it with pride\r\nAnd you don\'t count the dead when God\'s on your side\r\n\r\nVerse 4:\r\nThen the second World War, it came to an end\r\nWe forgave the Germans, and now we are friends\r\nThough they murdered 6 million, in the ovens they fried\r\nThe Germans now too have God on their side\r\n\r\nVerse 5:\r\nAnd now we have weapons of chemical dust\r\nIf fire them we\'re forced too, well then fire them we must\r\nOne push of the button, and a shot the world wide\r\nAnd you never ask questions when God\'s on your side\r\n\r\nVerse 6:\r\nIn many a dark hour I think about this\r\nThat Jesus Christ was betrayed by a kiss\r\nBut I can\'t think for you; you\'ll have to decide\r\nWhether Judas Iscariot had God on his side\r\n\r\nVerse 7 (decelerate on last line):\r\nAnd now as I leave you, I\'m weary as hell\r\nThe confusion I\'m feeling no tongue can tell\r\nThe words fill my head and drop to the floor\r\nIf God\'s on our side, he\'ll stop the next war',7,'2021-09-01 03:00:00',NULL),
	(484,'Sweetheart Like You','Well the pressures down the boss aint here\r\nHe\'s got north for a while\r\nThey say that vanity got the best of him \r\nBut he sure left here in style\r\nBy the way that\'s a cute hat and a smile so hard\r\nto resist\r\nBut whats a sweetheart like you doing in a dump\r\nlike this?\r\n\r\nYou know i once knew a woman who looked like you,\r\nShe wanted a whole man, not just a half,\r\nShe used to call me sweet daddy when i was just a\r\nchild\r\nYou kind of remind me of her when you laugh.\r\nIn order to deal in this game youve got to make\r\nthe king disappear, \r\nIts done with a flick of the wrist\r\nWhats a sweetheart like you doing in a dump like\r\nthis?\r\n\r\nYou know a woman like you should be at home, \r\nThats where you belong,\r\nTaking care of somone nice,\r\nWho don\'t know how to do you wrong.\r\nJust how much abuse will you be able to take?\r\nWell there\'s no way to tell by the first kiss.\r\nWhat\'s a sweetheart like you doing in a dump like\r\nthis?\r\n\r\nYou know you can make a name for yourself,\r\nYou know you can hear them tires squeal,\r\nYou can be known as the most beautiful woman \r\nWho ever crawled across cut glass to make a deal.\r\n\r\nYou know news of you has come down the line \r\nEven before you came through the door\r\nThey say in your fathers house, theres many\r\nmansions \r\nEach one of them s got a fire proof floor.\r\nSnap out of it people are jealous of you,\r\nThey smile to your face, but behind your back they\r\nhiss\r\nWhat\'s a sweetheart like you doing in a dump like\r\nthis?\r\n\r\nGot to be an important person to be in here baby,\r\nGot to have done some evil deed,\r\nGot to have your own harem when you come in the\r\ndoor,\r\nGot to play your heart until your lips bleed.\r\n\r\nThey say that patriotism is the last refuge\r\nTo which a scoundrel clings\r\nSteal a little and they throw you in jail,\r\nSteal a lot and they make you a king.\r\nTheres only one more step from here baby,\r\nIts called the land of permanent bliss.\r\nWhats a sweetheart like you doing in a dump like\r\nthis?',7,'2021-09-01 15:30:00',NULL),
	(485,'Shout','Shout\r\nShout\r\nLet it aloud\r\nThese are the things I can do without\r\nCome on\r\nI?m talking to you\r\nCome on\r\n(repeat)\r\n\r\nIn violent times\r\nYou shouldn?t have to sell your soul\r\nIn black and white\r\nThey really really ought to know\r\nThose one track minds\r\nThat took you for a working boy\r\nKiss them goodbye\r\nYou shouldn?t have to jump for joy\r\nYou shouldn?t have to jump for joy\r\n\r\nChorus\r\n\r\nThey gave you life\r\nAnd in return you gave them hell\r\nAs cold as ice\r\nI hope we live to tell the tale\r\nI hope we live to tell the tale\r\n\r\nChorus(x2)\r\n\r\nAnd when you?ve taken down your guard\r\nIf I could change your mind\r\nI?d really love to break your heart\r\nI?d really love to break your heart\r\n\r\nChorus \r\n',230,'2021-09-02 04:00:00',NULL),
	(486,'In the air tonight','I can feel it coming in the air tonight, oh lord\r\nIve been waiting for this moment, all my life, oh lord\r\nCan you feel it coming in the air tonight, oh lord, oh lord\r\n\r\nWell, if you told me you were drowning\r\nI would not lend a hand\r\nIve seen your face before my friend\r\nBut I dont know if you know who I am\r\nWell, I was there and I saw what you did\r\nI saw it with my own two eyes\r\nSo you can wipe off the grin, I know where youve been\r\nIts all been a pack of lies\r\n\r\nAnd I can feel it coming in the air tonight, oh lord\r\nIve been waiting for this moment for all my life, oh lord\r\nI can feel it in the air tonight, oh lord, oh lord\r\nAnd Ive been waiting for this moment all my life, oh lord, oh lord\r\n\r\nWell I remember, I remember dont worry\r\nHow could I ever forget, its the first time, the last time we ever met\r\nBut I know the reason why you keep your silence up, no you dont fool me\r\nThe hurt doesnt show; but the pain still grows\r\nIts no stranger to you or me\r\n\r\nAnd I can feel it coming in the air tonight, oh lord...',2,'2021-09-02 16:30:00',NULL),
