	(490,'I hope that I don\'t fall in love with you','   C                F                 G\r\nI hope that I don\'t fall in love with you\r\n      C           F                   G\r\nCause falling in love just makes me blue\r\n          F              C                F               C\r\nWell the music plays and you display your heart for me to see\r\n  F              C              F              G\r\nI had a beer and now I hear you calling out to me\r\n      C                 F                 G\r\nAnd I hope that I don\'t fall in love with you.\r\n\r\nNow the room is crowded, people everywhere\r\nAnd I wonder should I offer you a chair\r\nWell if you sit down with this old clown,\r\nhe\'ll take that frown and break it\r\nBefore the evening\'s gone away, I think that we could make it\r\nAnd I hope that I don\'t fall in love with you\r\n\r\nNow the night does funny things inside a man\r\nThese old tomcat feelings you don\'t understand\r\nI turn around and look at you, you light a cigarette\r\nWish I had the guts to bum one, but we\'ve never met\r\nAnd I hope that I don\'t fall in love with you\r\n\r\nAnd I can see that you are lonesome just like me\r\nAnd I\'m feeling like you\'d like some company\r\nWell I turn around to look at you, and you look back at me\r\nThe guy you\'re with is up and split, the chair next to you\'s free\r\nAnd I hope that you don\'t fall in love with me\r\n\r\nNow it\'s closing time, the music\'s fading out\r\nLast call for drinks I\'ll have another stout\r\nI turn around and look at you, you\'re nowhere to be found\r\nI search the place for your lost face, I guess I\'ll have another round\r\nand I think that I just fell in love with you',214,'2021-09-04 18:30:00',NULL),
	(491,'Orphan Girl','        G\r\nI am an orphan\r\n         D\r\nOn God\'s highway\r\n                  G\r\nBut I\'ll share my troubles\r\n          C\r\nYou go my way\r\n\r\n          G\r\nI have no mother\r\n   D          G\r\nNo father, no sister\r\n   C\r\nNo brother\r\nG       D       G\r\nI am an orphan girl\r\n\r\n\r\nI have had friendships\r\nPure and golden\r\nBut the ties of kinship\r\nI have not known them\r\n\r\nI know no mother\r\nNO father, no sister\r\nNo brother\r\nI am an orphan girl\r\n\r\n(inst. break)\r\n\r\nBut when He calls me\r\nI will be able\r\nTo meet my family\r\nAt God\'s table\r\n\r\nI\'ll meet my mother\r\nMy father, my sister\r\nMy brother\r\nNo more an orphan girl\r\n\r\n(inst. break)\r\n\r\nBlessed savior\r\nMake me willing\r\nAnd walk beside me\r\nUntil I\'m with them\r\n\r\nBe my mother\r\nMy father, my sister\r\nMy brother\r\nG       D\r\nI am an orphan girl\r\nG        D      C      G\r\nI  am an orphan girl',233,'2021-09-05 07:00:00',NULL),
