	(495,'The Midnight Special','D                        G\r\nWell, you wake up in the mornin\'\r\n                       D\r\nYou hear the work bell ring\r\n                          A7\r\nAnd they march you to the table\r\n                     D\r\nYou see the same old thing\r\n                       G\r\nAin\'t no food upon the table\r\n                      D\r\nAnd no fork up in the pan\r\n                        A7\r\nBut you\'d better not complain, boy\r\n                               D\r\nYou\'ll get in trouble with the man\r\n\r\n\r\nCHORUS:\r\n                 G\r\nLet the midnight special\r\n                   D\r\nShine the light on me\r\n                 A7\r\nLet the midnight special\r\n                   D\r\nShine the light on me\r\n                 G\r\nLet the midnight special\r\n                   D\r\nShine the light on me\r\n                 A7\r\nLet the midnight special\r\n                      D\r\nShine the ever-lovin\' light on me\r\n\r\n\r\nYonder come Miss Rosie\r\nHow in the world did you know\r\nBy the way she wears her apron\r\nAnd the clothes she wore\r\nUmbrella on her shoulder\r\nPiece of paper in her hand\r\nShe come to see the gov\'nor\r\nShe wanna free her man\r\n\r\n(chorus)\r\n\r\nIf you\'re ever in Houston\r\nOoh, you\'d better do right\r\nYou\'d better not gamble\r\nAnd you\'d better not fight\r\nOr the sheriff will grab ya\r\nAnd the boys\'ll bring you down\r\nThe next thing you know, boy\r\nOoh, you\'re prison-bound',15,'2021-09-07 09:00:00',NULL),
	(496,'Lodi','INTRO: F Bb F\r\n\r\nF \r\nJust about a year ago\r\n  Bb             F\r\nI set out on the road.\r\n                    Dm\r\nSeekin\' my fame and fortune,\r\nBb                   C\r\nLookin\' for a pot of gold.\r\nF                  Dm\r\nThings got bad and things got worse,\r\n  Bb                 F\r\nI guess you know the tune\r\n              C              Bb      F\r\nOh, Lord! I\'m stuck in Lodi again.\r\n\r\n\r\nRode in on the greyhound, I\'ll be walkin\' out if I go.\r\nI was just passing through must be seven months or more.\r\nRan out of time and money, looks like they took my friends.\r\nOh, Lord! I\'m stuck in Lodi again.\r\n\r\nThe man from the magazine, said I was on my way.\r\nSomewhere I lost connections, ran out of songs to play,\r\nI came in to town a one night stand, looks like my plans fell though.\r\nOh, Lord! I\'m stuck in Lodi again.\r\n\r\nGUITAR-CHANGING PART: C   G   D   G\r\n\r\nG                          C            G\r\nIf I only had a dollar for every song I sung.\r\n                Em                  C                D\r\nEvery time I\'ve had a to play while people sat there drunk.\r\n    G                  Em\r\nYou know I\'d catch the next train,\r\nC               G\r\nBack to where I live.\r\n              D              C      G\r\nOh, Lord! I\'m stuck in Lodi again.\r\n              D              C      G\r\nOh, Lord! I\'m stuck in Lodi again.\r\n\r\nENDING: G C G (Repeat and fade)',15,'2021-09-07 21:30:00',NULL),
