	(501,'Van Lear Rose ','G\r\nOne of my fondest memories\r\n    C   \r\nWas sittin\' on my daddy\'s knee\r\nG                                D\r\nListenin\' to the stories that he told\r\n     G                   \r\nHe\'d pull out that old photograph\r\n       C\r\nLike a treasured memory from the past\r\n        G\r\nAnd say child\r\n     D                   G\r\nThis here\'s the Van Lear Rose\r\n\r\nOh how it would bring a smile\r\nWhen he talked about her big blue eyes\r\nAnd how her beauty ran down to her soul\r\nShe\'d walk across the coal miner\'s yard\r\nThem miner\'s would yell loud and hard\r\nAnd they\'d dream of who would hold\r\nThe Van Lear Rose\r\n\r\n            C\r\nShe was the belle of Johnson County\r\n     G \r\nOhio river to Big Sandy\r\n  D                       C              G\r\nA beauty to behold like a diamond in the coal\r\n        C                   \r\nAll the miner\'s they would gather \'round\r\n      G\r\nTalk about the man that came to town\r\n      D\r\nRight under their nose\r\n                                G\r\nStole the heart of the Van Lear Rose\r\n\r\nNow the Van Lear Rose could\'ve had her pick\r\nAnd all the fellers figured rich\r\nUntil this poor boy caught her eye\r\nHis buddies would all laugh and say\r\nYour dreamin\' boy she\'ll never look your way\r\nYou\'ll never ever hold the Van Lear Rose\r\n\r\nThen one night in mid July\r\nUnderneath that ol\' blue Kentucky sky\r\nWell, that poor boy won that beauty\'s heart\r\nThen my daddy would look at my mommy and smile\r\nAs he brushed the hair back from my eyes and he\'d say\r\nYour mama\r\nShe\'s the Van Lear Rose\r\n\r\n[Chorus]',232,'2021-09-10 12:00:00',NULL),
	(502,'Loving her was easier','C/G                           F                              C/G\r\nI\'ve seen the morning burning golden on the mountains in the skies\r\n                               F                            C/G\r\nAching with the feeling of the freedom of an eagle when she flies\r\nF                                                    \r\nTurning on the world the way she smiles upon my soul \r\n         C/G\r\nas i lay dying\r\n                               F                              C/G\r\nHealing with the colors of the sunshine and the shadow of her eyes\r\n\r\n\r\nC/G                          F                            C/G\r\nWaking in the morning to the feeling of her fingers on my skin\r\n                             F                               C/G\r\nWiping out the traces of the people and the places that i\'ve been\r\nF\r\nTeaching me that yesterday was something \r\n                        C/G\r\nthat i never thought of trying\r\n                               F                                C/G\r\nTalking about tomorrow and the money love and time we\'d have to spend\r\n                           G                     C/G\r\nLoving her was easier than anything i\'ll ever do again\r\n\r\n\r\nC/G                          F                            C/G\r\nComing close together with a feeling that i\'ve never know before,in my time\r\n                         F                       C/G\r\nShe ain\'t afraid to be a woman or afraid to be a friend\r\nF\r\nI don\'t know the answer to the easy way\r\n                C/G\r\nshe opens every door in my mind\r\n                        F                            C/G\r\nDreaming was as easy as believing it was never gonna end\r\n                           G                     C/G\r\nLoving her was easier than anything i\'ll ever do again',192,'2021-09-11 00:30:00',NULL),
	(503,'Sunday Mornin\' Coming Down','G\r\nWell I woke up Sunday morning\r\n        C                                G\r\nwith no way to hold my head, that didn\'t hurt\r\n\r\nand the beer I had for breakfast\r\n       Em                           D\r\nwasn\'t bad so I had one more for dessert\r\n       G\r\nThan I fumble through my closet for\r\n   C                                   G       Em\r\nmy clothes and found my cleanest dirty shirt\r\n      C\r\nand I shaved my face and combed my hair\r\n    Am                                   D\r\nand stumbled down the stairs to meet the day\r\n\r\n\r\n    G\r\nI\'d smoked my brain the night before\r\n    C                                   G        \r\nand cigarettes and songs that I\'ve been pickin\'\r\n                                       Em\r\nbut I lit my first and watched a small kid\r\n                             D\r\ncussin\' at a can that he was kicking\r\n       G\r\nThen I crossed the empty street and caught\r\n    C                              G        Em\r\nthe sunday smell of someone fryin\' chicken\r\n       C               Am\r\nand it took me back to somethin\' that\r\n    C	            D	      G\r\nI\'d lost somehow somewhere along away\r\n\r\n\r\n                    C\r\nOn a sunday mornin\' sidewalks\r\n                        G\r\nwishing Lord that I was stoned\r\n                               D\r\n\'cause there is something in a sunday\r\n                        G\r\nthat makes a body feel alone\r\n                             C\r\nAnd there\'s nothin\' short of dyin\'\r\n                        G\r\nhalf as lonesome as the sound\r\n                     D\r\non the sleepin\' city side walks\r\n                      G\r\nSunday mornin\' comin\' down\r\n\r\n\r\nG\r\nIn the park I saw a daddy with\r\n  C                               G\r\na laughing little girl who he was swingin\'\r\n            \r\nand I stopped beside a sunday school\r\n    Em                                  D\r\nand listened 