	(518,'Jeg er ikke som de andre','G           C        G\r\nJeg er ikke som de andre, \r\n                     D\r\njeg er noget for mig selv; \r\n        G\r\npå landevejene vil jeg vandre \r\n                    D7     G\r\ntil den dag, jeg må si\\\' farvel. \r\n  \r\nSelvom natten er sort som tjære, \r\nviser stjernerne mig vej; \r\njeg finder altid et sted at være, \r\njeg skal nok finde vej til dig. \r\n  \r\nPigen sover i sin køje, \r\nhendes vindue står på klem, \r\nså pluds\\\'lig hører hun nogen støje \r\n- er det ham, er han kommet hjem? \r\n  \r\nJeg er ikke som de andre ... \r\n  \r\nHan står under hendes rude, \r\nkaster grus mod rudens glas, \r\nhan hvisker: Det er så koldt herude, \r\nhar du i sengen en ledig plads? \r\n  \r\nHun løfted\\\' ho\\\'det fra sin pude \r\n- lagde armen om sit bryst; \r\nhun spurgte: Hvem banker på min rude \r\nlænge før, det er blevet lyst? \r\n  \r\nJeg er ikke som de andre ... \r\n  \r\nHan svared\\\': Tag din lysestage, \r\ngå til dør\\\'n og luk mig ind, \r\nfor jeg har vandret i mange dage \r\ngennem regn, pløre, frost og vind. \r\n  \r\nHun lukked\\\' døren op med glæde \r\n- modtog ham med kys og kram, \r\nog hun løfted\\\' sit sengeklæde \r\nfor at dele sin seng med ham. \r\n  \r\nJeg er ikke som de andre ... \r\n  \r\nNu skinner solen på din rude, \r\njeg må op og gå min vej, \r\nog alt vil være så skønt derude, \r\nsiden jeg har vær\\\'t hos dig. \r\n  \r\nJeg er ikke som de andre ...',81,'2021-09-18 20:00:00',NULL),
	(519,'Jeg ta\'r aldrig på valsen igen','        C                              F \r\nJeg har været på valsen, men nu er det slut\r\n       C          F      G7       C \r\nmed at bruge hver øre på damer og sprut, \r\n                                      F\r\nså nu vender jeg hjemad med masser af mønt, \r\n          C            F         G7      C\r\nfor det\'r sket med det liv og et andet begyndt. \r\n\r\n         G7                      C                   F  \r\nNu\'r det slut med at ture (åh-åh-åh) med at ture min ven, \r\n        C          F       G7      C\r\nnu ta\'r jeg aldrig mere på valsen igen. \r\n  \r\n\r\nJeg gik ind på det værtshus, hvor jeg plejed\' at komm\', \r\nog sagde til tjener\'n: \"Min pung den er tom\"! \r\nJeg bad om kredit; men han svarede: \"Nej, \r\nder er snese af kunder, der\'r bedre end dig\". \r\n\r\nSå\'r det slut... \r\n  \r\nJeg stak hånden i lommen, hev frem af mit guld \r\nindtil baren, jeg stod ved, var bugnende fuld. \r\n\"Du kan få alt på klods her båd\' i pose og sæk\"! \r\n\"Du kan rende mig der, hvor min ryg den bli\'r fræk\"! \r\n\r\nSå\'r det slut... \r\n  \r\nJeg ta\'r hjem til de gamle, jeg be\'r dem en bøn \r\nom at modta\' og tilgi\' der\'s vildfarne søn; \r\nog hvis de vil tilgi\', hvad jeg tror, de vil, \r\nta\'r jeg bare på valsen en en\'ste gang til! \r\n\r\nSå\'r  det slut...',81,'2021-09-19 08:30:00',NULL),
	(520,'Konen på Læsø','        C                          G            C\r\nSe, der var en kone på Læsø, og på Læsø var hun født; \r\n                     F                G              G7\r\nhun elsked\' højt sin mand men mer\' en anden hun ha\'d mødt, \r\n       C                               G           C\r\nKom så tikkerli takkerli takkerli tara turom turom ta, \r\n    C                F                G7             C\r\nhun elsked\' højt sin mand men mer\' en anden hun ha\'d mødt... \r\n  \r\nSå gik hun til sin doktor for at købe en mixtur, \r\nsom helst sku\' gøre manden blind, før elskeren blev sur. \r\nKom så tikkerli takkerli tara turom turom ta, \r\nsom helst sku\' gøre manden blind, før elskeren blev sur. \r\n  \r\nOg doktor\'n sa\': Gi\' ham brændevin og fjorten æg om da\'en, \r\ndet varer kun et øjeblik, så\'r han blind som bare fa\'en. \r\nKom så tikkerli takkerli tara turom turom ta, \r\ndet varer kun et øjeblik, så\'r han blind som bare fa\'en. \r\n  \r\nMen doktoren skrev et listigt brev. Hør her dit gamle skind \r\ndin kone hun har købt mixtur, for hun vil gør\' dig blind. \r\nKom så tikkerli takkerli tara turom turom ta, \r\ndin kone hun har købt mixtur, for hun vil gør\' dig blind. \r\n  \r\nDa konen hun kom hjem, så fik han æg og snaps, det skind; \r\ndet vared\' kun et par timer, så ku\' han ikke se en pind. \r\nKom så tikkerli takkerli tara turom turom ta, \r\ndet vared\' kun et par timer, så ku\' han ikke se en pind. \r\n  \r\nSå sa\'e den gamle: Hør du kone, jeg vil drukne mig, \r\nog konen svared\': Jeg går med, så ka\' jeg vis\' dig vej. \r\nKom så tikkerli takkerli tara turom turom ta, \r\nog konen svared\': Jeg går med, så ka\' jeg vis\' dig vej. \r\n  \r\nVed havets bred der stod hun bagved for at skub\' ham i\'et; \r\nmen da hun så tog tilløb, så stod manden lidt tilsid\'. \r\nKom så tikkerli takkerli tara turom turom ta, \r\nmen da hun så tog tilløb, så stod manden lidt tilsid\'. \r\n  \r\nOg konen sank, højt skreg hun op, og bleg var hendes kind, \r\nhan sa\': Ku\' jeg blot redde dig, men jeg ka\' ikke se en pind. \r\nKom så tikkerli takkerli tara turom turom ta, \r\nhan sa\': Ku\' jeg blot redde dig, men jeg ka\' ikke se en pind. \r\n  \r\nMoralen er: Skub or\'nligt til, hvis du vil drukne mand\'n, \r\nog vær sikker på, han drukner, før du finder dig en and\'n. \r\nKom så tikkerli takkerli tara turom turom ta, \r\nog vær sikker på, han drukner, før du finder dig en and\'n. \r\n  \r\nSel\'fø\'lig ka\' du gøre ham blind med æg og brændevin; \r\nmen skal det være ganske sikkert, gi\' ham no\'et stryknin. \r\nKom så tikkerli takkerli tara turom turom ta, \r\nmen skal det være ganske sikkert, gi\' ham no\'et stryknin',81,'2021-09-19 21:00:00',NULL),
	(521,'Kys mig her og der','I Paradis sad Adam i toppen af et træ, \r\nog så på havens fugle, dyr og hvad han nu ku? se, - ku?se, - ku?se \r\nman han blev noget betænkelig dengang han hørte at, \r\nen stemme hviskede til Eva: \"Hør min lille skat\" \r\n  \r\nKom og kys mig her, og kys mig der, og kys mig hvor du vil \r\nde kys jeg får, får du igen med renterne lagt til. \r\nJeg har nok til alle piger, der trænger til lidt trøst, \r\nkom blot og stil din længsel her - ved farmands brede bryst. \r\n  \r\nFru Jørgensen lå i sengen, Anker var på Christiansborg \r\nog der var koldt og ensomt i de hvide pudevår. \r\nOg mens han bevilligede penge til EF og militær, \r\nlød der en røst fra vinduet, ?Lille Ingrid hør nu her?. \r\nKom og kys mig her .... \r\n  \r\nPrins Henrik har så travlt, det ka? da ikke være pral, \r\nnår han på fjorten dage ku? blive admiral. \r\nSå hjemme i gemakket er der aldrig tid til spræl, \r\nså det lyder bag gardinet når Henrik si?r farvel. \r\nKom og kys mig her .... \r\n  \r\nFra New York til Alaska og fra Rio til Shaigon \r\nfra Peking til Nebraska og fra Ålborg til Hong-Kong, \r\nja overalt på kloden er der altid éen der vil, \r\nræk? en hjælpende hånd hvis ikke - manden ka? slå til. \r\nKom og kys mig her, og kys mig der, og kys mig hvor du vil \r\nde kys jeg får, får du igen med renterne lagt til. \r\nJeg har nok til alle piger, der trænger til lidt trøst, \r\nkom kun og stil din længsel her - ved farmands brede bryst. \r\nkom kun og stil din længsel her - ved farmands brede bryst.',81,'2021-09-20 09:30:00',NULL),
	(522,'Munken fra Børglum','  C                   \r\nI Børglum der leved\' en munk \r\n                                 G\r\nder var kendt for sin fromhed og lærdom, \r\n    C                  F\r\nhan var en mærk\'lig hallunk \r\n       G                            C\r\nsom ej brød sig om pi\'r - snarer\' - tværtom! \r\n   C\r\nFa la la la la la la la \r\n                     G\r\nfa la la la la la la la di \r\n   C                 F\r\nfa la la la la la la la \r\n      G              C\r\nfa la la la la la la la di \r\n  \r\nHan elsked\' at læse en bog \r\n- han læste nu aldrig de frække - \r\nog fisked\' med snøre og krog \r\ni omegnens søer og bække. \r\nFa la la la... \r\n  \r\nEn aften ved søen han står \r\nog prøver om fisken vil bide, \r\nda Maren fra naboens gård \r\nkom og satte sig ned ved hans side. \r\nFa la la la... \r\n  \r\nSkrub af! skreg den gamle krabat, \r\nhans øjne de lyste af galskab. \r\nJeg lever sgu i cølibat \r\nog vil ikke ha\' kvindeligt selskab! \r\nFa la la la... \r\n  \r\nMen Maren vill\' ikke gi\' op \r\nså da han gik i seng i sit kloster, \r\nså mærked\' han pludselig en krop \r\n- og af skræk bad han 5 paternoster \r\nFa la la la... \r\n  \r\nForskrækket sprang munken så op \r\nog slog sine arme om møen, \r\nså lukked\' han vinduet op \r\n- og smed hende på røven i søen! \r\nFa la la la... \r\n  \r\nOm morg\'nen sad munken ved søen, \r\nhan kunne knap holde sig vågen, \r\nså pluds\'lig gav stangen et ryk \r\n- og så sprællede Maren på krogen! \r\nFa la la la... \r\n  \r\nAf historien her kan vi lære \r\nat bli\'r man forfulgt af en dame, \r\nkan man gøre hvad fanden man vil \r\n- hun er bar\' ikke til at bli\' af me\'! \r\nFa la la la...',81,'2021-09-20 22:00:00',NULL),
	(523,'Pi\'r, gift jer aldrig med en på 70','   G                                D\r\nEn gammel mand sa? til mig: Hey dingdoorum dow. \r\n   G\r\nEn gammel mand sa? til mig: Hey doorum dow. \r\n               Am            G          D\r\nEn gammel mand sa? til mig: ?Kom vil du elsk? med mig?? \r\nG              C          D7        G\r\nPi?r, gift jer aldrig med én på halvfjerds! \r\n\r\nFor han har ingen faloorum faliddle faloorum, \r\nhan har ingen faloorum faliddle faley. \r\nHan har ingen faloorum han har tabt sin dingdoorum, \r\nPi?r, gift jer aldrig med én på halvfjerds! \r\n  \r\nDa vi i kirken stod, hey dingdoorum dow. \r\nDa vi i kirken stod, hey doorum dow. \r\nDa vi i kirken stod, misted? han alt sit mod \r\nPi?r, gift jer aldrig med én på halvfjerds! \r\n\r\nFor han har ingen .... \r\n  \r\nDa vi kom i seng, hey dingdoorum dow. \r\nDa vi kom i seng, hey doorum dow. \r\nDa vi kom i seng, kunne han ingenting \r\nPi?r, gift jer aldrig med én på halvfjerds! \r\n\r\nFor han har ingen .... \r\n  \r\nDa han faldt til ro, hey dingdoorum dow. \r\nDa han faldt til ro, hey doorum dow. \r\nDa han faldt til ro, ud af min seng jeg sto?, \r\nog krøb til køjs med en herlig ung mand; \r\n\r\nog jeg fandt hans faliirum faliddle faloorum, \r\njeg fandt hans faliirum faliddle faley, \r\njeg fandt hans faliirum, og han fik min dingdoorum, \r\nPi?r, gift jer aldrig med én på halvfjerds! \r\n  \r\nFor han har ingen ....',81,'2021-09-21 10:30:00',NULL),
	(524,'Rottefængeren','    Dm      \r\nDer bo?de en mand i en landsby i Thy, \r\n    C\r\nsom fangede rotter og mus i sin by, \r\n    Dm                 C\r\nmen når han var ude og passe sit job, \r\n     Dm                      C   Dm\r\nstod konens sov?kammerdør lukket op. \r\n                             C   Dm\r\nDiliædum, diliædum, diliædum-dom-dai. \r\n  \r\nOg li?så snart manden var uden for dør?n \r\nkom naboens forkarl, og han hed Hans Jørn., \r\nog alt imens? mand?n fanged? rotter og mus, \r\nså hygged? de to sig i ro i hans hus. \r\n\r\nDiliædum, diliædum, diliædum-dom-dai. \r\n  \r\nOg forkarlen banked? på døren og sa?: \r\n?Min kæreste skat, er din mand hjemm? i da,?? \r\n?Nej, han fanger rotter, så kom kun, Hans Jørn!? \r\nMen manden var hjemme, han stod bag ved dør?n. \r\n\r\nDiliædum, diliædum, diliædum-dom-dai. \r\n  \r\nHan listede hen hvor de elskende lå, \r\nog råbte så højt, at de helt gik i stå: \r\n?Nu har jeg fanget rotter i hele mit liv, \r\nmen så store som dig trod? jeg ikk? de ku? bliv?!? \r\n\r\nDiliædum, diliædum, diliædum-dom-dai. \r\n  \r\nOg nu skal du bøde for hvad du har gjort, \r\njeg snupper en plovmand fra lommen i din skjort?! \r\n?En plovmand,? sa? karlen, og latteren sang, \r\n?Så bli?r det kun ca. en daler pr. gang!? \r\n\r\nDiliædum, diliædum, diliædum-dom-dai. ',81,'2021-09-21 23:00:00',NULL),
	(525,'Vores værtshus','     Hm                         D             G\r\nHele dagen lang er livet li\\\'som ganske gå\\\'t i stå, \r\n      G             D               Em         Hm\r\nde problemer som vi har, dem er der ingen ende på,\r\n                               D             G \r\nmen det hele får en ende og forsvinder i det blå\r\n                    D              A    D \r\nnår vi samles henad aften på vor\\\'s værtshus. \r\n\r\n      G          \r\nVores værtshus, vores værtshus, \r\n    D\r\ndet er der vi holder til, \r\n    F#         \r\nder bli\\\'r alle vor\\\'s problemer ordnet \r\nHm              A\r\nfør de\\\'r blevet til. \r\n       Hm                        D             G\r\nNår vi ikke har et job er\\\'et ikk fordi vi ikke vil, \r\n                           D            A    D\r\nmen det job sku\\\' helst ku\\\' klares på et værtshus. \r\n  \r\nDet er ganske ud\\\'n besvær vi ordner landets politik, \r\ndet bli\\\'r lettere og lettere, jo mer\\\' vi får å\\\' drikk\\\', \r\nalt vill\\\' blive meget bedre - sikket dejligt land vi fik \r\nhvis regeringen den sad på vores værtshus. \r\n\r\nVores værtshus... \r\n  \r\nVærten han ser ikke skævt til vores sang og vores spil, \r\nom vi slåsser lidt, det si\\\'r han heller ikke noget til, \r\nfor så længe vi har penge, kan vi gøre som vi vil, \r\ndet\\\'r det eneste der tæller på hans værtshus. \r\n\r\nVores værtshus... \r\n  \r\nSå nu ringer han med klokken og vi får det sidste glas, \r\ningen kan forstå vi havde det så skidt i formiddags, \r\nog i morgen mødes vi igen på vores faste plads \r\nved baren i vor\\\'s gode gamle værtshus. \r\n\r\nVores værtshus...',81,'2021-09-22 11:30:00',NULL),
	(526,'Ved Hawet','   D                        A7\r\nDe si\\\'r, der er skønt på Mallorca og Als, \r\n\r\nmen hvem siger noget om Aså og Hals \r\n   D\r\nog Nielstrup og Napstjert, og hvad de nu kald\\\'s, \r\n      A7               D\r\ni den nordlige ende af landet. \r\n\r\n    D\r\nVed hawet, ved hawet, der er \\\'et så skjønt, \r\nA/\r\nsandet er kridhvidt, og vandet er grønt, \r\n      D\r\nog de små badenymfer er ej kun til pynt, \r\n       A7                  D\r\nde ka\\\' andet end blot gå i vandet. \r\n\r\n\r\nNår kroen er lukket, og solen står op, \r\nog det kribler og krabler igennem min krop, \r\nja, så ta\\\'r jeg fiolen, så spiller hun op, \r\nfor vi ta\\\'r os et nummer i sandet. \r\n\r\nVed hawet .... \r\n  \r\nDer er no\\\'n, der vil elske, og no\\\'n vil gi\\\' tæsk, \r\nno\\\'n er vilde med kager og andre med flæsk; \r\nmen vi er tilfreds\\\', hvis i gi\\\'r os en bjæsk, \r\nså ka\\\' I godt beholde det andet. \r\n\r\nVed hawet .... \r\n  \r\nNår vinden fra hawet står ind over land, \r\nså\\\'r den salt, og den tørrer din hals tør som sand; \r\ndet \\\'r no\\\'n, der si\\\'r, det ka\\\' klares med vand, \r\nmen vi bru\\\'r nu helst noget andet. \r\n\r\nVed hawet .... \r\n  \r\nDe sæj\\\'r, wi vendelbofolk er no\\\'e sær\\\', \r\ndet er kaske fordi I int tje\\\'er os bi\\\'er, \r\nså hvis I int ka mæ os, så ka\\\' I bår la\\\' os wær\\\', \r\nog blyw\\\' i jer end\\\' å\\\' land\\\'t. \r\n\r\nVed hawet ....',81,'2021-09-23 00:00:00',NULL);
