	(527,'Ved rugmarkens skæl','        G      D  G                     D  G\r\nDer var stille og fredfyldt denne midsommermorg\\\'n, \r\n                C G         A         D\r\nblæsten bølged\\\' i markernes solgyldne korn, \r\n     G       C      G   C        G        D\r\nbåde solsort og drossel sang fra træernes topp\\\'.\r\n      G              C                  G         D    G \r\nog en lærke sang sin morgensang, medens solen den stod op.\r\n       C              G \r\nJa, en lærke sang sin morgensang\r\n       G              D \r\nJa, en lærke sang sin morgensang\r\n       G              C \r\nJa, en lærke sang sin morgensang\r\n     G         D    G\r\nmens solen den stod op. \r\n  \r\nSe en sømand og hans pige sad ved rugmarkens skæl, \r\nog han sagde til pigen: Jeg må si\\\' dig farvel, \r\nfor jeg sejler her til morgen til Sydamerika \r\nog forlader dig min egen ven, skønt det\\\'r dig jeg holder af. \r\nJeg forlader dig min egen ven (3) \r\nskønt det\\\'r dig jeg holder af. \r\n  \r\nOg han sagde til pigen: Nu mp jeg rejse bort, \r\nvore sejl de er sat, så min tid den er kort \r\nog når vinden er gunstig, så stævner vi ud, \r\nog hvis jeg kommer hjem igen, så skal du vær\\\' min brud. \r\nJa, hvis jeg kommer hjem igen (3) \r\nså skal du vær\\\' min brud. \r\n  \r\nHan tog en ring af sin finger og gav den til sin ven: \r\nTag den og det hjerte, der følger med den! \r\nog imens de tog afsked ved rugmarkens skæl \r\nsa\\\' hun: Må jeg ta\\\' af sted med dig? Jeg kan ikke si\\\' farvel. \r\nHun sa\\\': Må jeg ta\\\' af sted med dig (3) \r\nGu må du da ej! Farvel !!! ',81,'2021-09-23 12:30:00',NULL),
	(528,'I Don\'t Feel Like Dancin\'','Wake up in the morning with a head like \'what you done?\'\r\nThis used to be the life, but I don\'t need another one\r\nYou like cutting up and carrying on you wear them gowns\r\nSo how come I feel so lonely when you\'re up getting down?\r\n\r\nSo I\'ll play along when I hear that special song\r\nI\'m gonna be the one that gets it right\r\nYou\'d better know when you\'re swinging \'round the room\r\nLooks like magic\'s only ours tonight\r\n\r\nBut I don\'t feel like dancin\' when the old joanna plays\r\nMy heart could take a chance but my two feet can\'t find a way\r\nYou\'d think that I could muster up a little soft shoe gentle sway\r\nBut I don\'t feel like dancin\' no sir no dancin\' today\r\n\r\nI don\'t feel like dancin\', dancin\'\r\nEven if I find nothing better to do\r\nDon\'t feel like dancin\', dancin\'\r\nWhy\'d you break it down when i\'m not in the mood?\r\nDon\'t feel like dancin\', dancin\'\r\nI\'d rather be home with the one in the bed till dawn with you\r\n\r\nCities come and cities go just like the old empires\r\nWhen all you do is change your clothes and call that versatile\r\nYou got so many colors it\'d make a blind man so confused\r\nSo why can\'t I keep up when you\'re the only thing I\'d lose?\r\n\r\nI\'ll just pretend that I know which way to bend\r\nI\'m gonna tell the whole world that you\'re mine\r\nPlease understand when I see you clap your hands\r\nIf you stick around i\'m sure that I\'ll be fine\r\n\r\nBut I don\'t feel like dancin\' when the old joanna plays\r\nMy heart could take a chance but my two feet can\'t find a way\r\nYou\'d think that I could muster up a little soft shoe gentle sway\r\nBut I don\'t feel like dancin\' no sir no dancin\' today\r\n\r\nI don\'t feel like dancin\', dancin\'\r\nEven if I find nothing better to do\r\nDon\'t feel like dancin\', dancin\'\r\nWhy\'d you break it down when i\'m not in the mood?\r\nDon\'t feel like dancin\', dancin\'\r\nI\'d rather be home with the one in the bed till dawn with you\r\n\r\nYou can\'t make me dance around\r\nBut your two-step makes my chest pound\r\nJust lay me down\r\nAs you float away into the shimmer lights\r\n\r\nBut I don\'t feel like dancin\' when the old joanna plays\r\nMy heart could take a chance but my two feet can\'t find a way\r\nYou\'d think that I could muster up a little soft shoe gentle sway\r\nBut I don\'t feel like dancin\' no sir no dancin\' today\r\n\r\nI don\'t feel like dancin\', dancin\'\r\nEven if I find nothing better to do\r\nDon\'t feel like dancin\', dancin\'\r\nWhy\'d you break it down when i\'m not in the mood?\r\nDon\'t feel like dancin\', dancin\'\r\nI\'d rather be home with the one in the bed till dawn with you',237,'2021-09-24 01:00:00',NULL),
	(529,'Take your mama','When you grow up \r\nLivin\' like a good boy oughta \r\nAnd your mama \r\nTakes a shine to her best son \r\nSomething different \r\nAll the girls, they seem to like you \r\nCause you\'re handsome, \r\nLike to talk, and a whole lot of fun \r\n\r\nBut now your girl\'s gone a missin\' \r\nAnd your house has got an empty bed \r\nThe folks\'ll wonder \'bout the wedding \r\nThey won\'t listen to a word you said \r\n\r\n[Chorus] \r\nGonna take your mama out all night \r\nYeah, we\'ll show her what it\'s all about \r\nWe\'ll get her jacked up on some cheap champagne \r\nWe\'ll let the good times all roll out \r\nAnd if the music ain\'t good, well it\'s just too bad \r\nWe\'re gonna sing along no matter what \r\nBecause the dancers don\'t mind at the New Orleans \r\nIf you tip \'em and they make a cut \r\n\r\nDo it \r\nTake your mama out all night \r\nSo she\'ll have no doubt \r\nThat we\'re doing all the best we can \r\nGonna do it \r\nTake your mama out all night \r\nYou can stay up late \r\n\'cause baby you\'re a full grown man \r\n\r\nIt\'s a struggle \r\nLivin\' like a good boy oughta \r\nIn the summer \r\nWatchin\' all the girls pass by \r\nWhen your mama \r\nHeard the way that you\'d been talking \r\nI tried to tell you \r\nThat all she\'d wanna do is cry \r\n\r\nNow we end up takin\' the long way home \r\nLookin\' overdressed wearin\' buckets of stale cologne \r\nIt\'s so hard to see streets on a country road \r\nWhen your glasses in the garbage \r\nAnd your Continental\'s just been towed ',237,'2021-09-24 13:30:00',NULL),
