	(566,'Bitter Sweet Symphony','E Bm7 D A\r\n\r\nCos\' it\'s a bittersweet symphony this life...\r\nTrying to make ends meet , you\'re a slave to the money then you die.\r\nI\'ll take you down the only road I\'ve ever been down...\r\nYou know the one that takes you to the places where all the pain ives, yeah.\r\n\r\nNo change, I can change, I can change, I can change,\r\nbut I\'m here in my mould , I am here in my mould.\r\nBut I\'m a million different people from one day to the next...\r\nI can\'t change my mould , no,no,no,no,no,no,no\r\n\r\nWell I never pray,\r\nBut tonight I\'m on my knees, yeah.\r\nI need to hear some sounds that recognise the pain in me, yeah.\r\nI let the melody shine, let it cleanze my mind , I feel free now.\r\nBut the airwaves are clean and there\'s nobody singing to me now.\r\n\r\nNo change, I can change, I can change, I can change,\r\nbut I\'m here in my mould , I am here in my mould.\r\nAnd I\'m a million different people from one day to the next\r\nI can\'t change my mould, no,no,no,no,no,no,no\r\n\r\n(Well have you ever been down?)\r\n(I can change, I can change...)\r\n \r\nCos\' it\'s a bittersweet symphony this life.\r\nTrying to make ends meet, trying to find some money then you die.\r\nYou know I can change, I can change, I can change,\r\nbut I\'m here in my mould, I am here in my mould.\r\nAnd I\'m a million different people from one day to the next.\r\nI can\'t change my mould, no,no,no,no,no,no,no\r\n\r\n(I\'ll take you down the only road I\'ve ever been down)\r\n(I\'ll take you down the only road I\'ve ever been down)\r\n(It justs sex and violence melody and silence)\r\n(Been down)\r\n Ever been down',102,'2021-10-13 07:30:00',NULL),
