	(599,'Lets twist again','Come on everybody!\r\nClap your hands!\r\nAll you looking good!\r\n\r\nI\'m goona sing my song\r\nIt won\'t take long!\r\nWe\'re gonna do the twist\r\nand it goes like this:\r\n\r\nCome on let\'s twist again,\r\nlike we did last summer!\r\nYeaaah, let\'s twist again,\r\nlike we did last year!\r\n\r\nDo you remember when,\r\nthings were really hummin\',\r\nYeaaaah, let\'s twist again,\r\ntwistin\' time is here!\r\n\r\nHeeee, and round and round and up and down\r\nwe go again!\r\nOh, baby, make me know you love me sooooo,\r\nand then:\r\n\r\nTwist again,\r\nlike we did last summer,\r\nCome on, let\'s twist again,\r\nlike we did last year!\r\n\r\nTWIST! YO!\r\n\r\nWho`s that flyin\' up there?\r\nIs it a bird? Noooooo!\r\nIs it a plane? Noooooooo!\r\nIs it the twister? YEAAAAAAAHH!\r\n\r\nTwist again, like we did last summer,\r\nCome on, Let\'s twist again,\r\nlike we did last year!!!!\r\n\r\nDo you remember when, things were really hummin\',\r\nCome on, let\'s twist again,\r\ntwistin\' time is here\r\n\r\nHeeee, and round and round and up and down we go again!\r\nOh, baby, make me know, you love me sooooo! And then:\r\nCome on, twist again, like we did last summer,\r\nlet\'s twist again, like we did last year!\r\n\r\nCome on, let\'s twist again,\r\ntwistin\' time is heeeere!',276,'2021-10-30 12:00:00',NULL),
	(600,'Romeo','D \r\nDer\' no\'ed ved denne scene \r\n    B7                                Em \r\nder minder mig om Romeo og Julie \r\n    A7                         F#7            Bm \r\nDen minder også om hvor lidt du bru\'r din fantasi \r\n     D                       B7              Em \r\nI stedet for at grine gør du livet til det allermest    \r\n   A7                                   F#7       Bm G  Em \r\nDu ender tragikomisk uden vid\'re i melankoli - og nostalgi \r\n          F#7sus \r\nsom er en pestilens for dem der no\'ed at si\' - men \r\n \r\nD      A/C#  Am/c    B7         Em \r\nRomeo   -   vågner aldrig af drømmen \r\nA             D \r\nstår på balkonen \r\nH                Em \r\nRomeo, når Julie \r\nA7             G       Em7 A7sus F#7sus A7 \r\ngår med en anden hjem \r\n \r\nHvad hjælper det at vente \r\npå en der længst er fløjet forbi dig. \r\nJeg er sikker  på hun kendte \r\nhver en tone i din melodi. \r\nHvad hjælper dine sange \r\nhvis de egentlig ikke har mere at gi\' af. \r\nSignor \'Sole mio\' \r\ndu er fanget i en maskepi \r\nW:C: Fields ville ha\' forlangt en whisky \r\nog et klart dementi - men \r\n \r\nRomeo...... \r\n \r\nDer\' no\'ed ved denne scene \r\nder minder mig om Romeo og Julie. \r\nHvis det ikke var fordi - det\' lissom om \r\nder altså mangler en. \r\nDu styrter rundt alene \r\nmens du rimer på det allermest uduelige. \r\nDer er ingen hjælp at hente \r\nnår suffløren holder feriefri. \r\nSå tæl til ti \r\nog hvis hun ikke venter i kulissen \r\ner det sikkert forbi - men \r\n \r\nRomeo.........',248,'2021-10-31 00:30:00',NULL),
	(601,'Du er ikke alene','                G  A              D\r\nNår du ta\'r afsted vend dig ikke om\r\nD                G   E            A\r\nder ingen vej tilbage hvorfra du kom\r\nA           G    G           Hm\r\nAlle deres remser dem kan du uden ad\r\nHm               E         A\r\ndu kender deres mistro og had\r\n\r\nOg du som intet ved, og dog har fået alt\r\ndu ved som nok det hele det er dyrt betalt\r\nOg hvis der er en sandhed, skrevet sort på hvidt\r\nså er det den at ingenting er dit\r\n\r\nD          G      A                    D\r\nDu er ikke alene. Der er en der følger dig\r\nD                   C Hm     E               A\r\nog det\' helt på det rene han har det li\'som dig\r\n   D    G  D\r\nsom dig\r\n\r\n\r\nDe som kaster sten gemmer sig bag glas\r\nDe ku\' ha\' f¨\'t dit hjerte - de havde ikke plads\r\ndu flytter grænser, du kapper deres tov\r\nmen du skal frifindes for deres lov\r\n\r\nFor de står selv for skyld som ejer lov og ret\r\nog de burde dømmes. Lig\' nu er du så træt\r\nmen alle deres sønner og døtre ligeså\r\nde vidner mod den verden de har fået\r\n\r\nDu er ikke alene...\r\n\r\nBli\'r du hentet ind og mærker du en hånd\r\nså bliv ikke bange, du ved hvorfor den kom\r\nder\' ikke megen varme lige her omkring\r\nmen jeg tror nok I finder vejen frem\r\n\r\nDu er ikke alene...',248,'2021-10-31 12:00:00',NULL),
	(602,'Time To Pretend','Verse 1\r\n\r\nD                           G                             D Dsus2 D\r\nI\'m Feelin rough I\'m Feelin raw I\'m in the prime of my life.\r\nD                               G                             D Dsus2 D\r\nLet\'s make some music make some money find some models for wives.\r\nD                              G                           D Dsus2 D   \r\nI\'ll move to Paris, shoot some heroin and fuck with the stars.\r\nD                           G                        D Dsus2 D    \r\nYou man the island and the cocaine and the elegant cars.\r\n\r\nPre-chorus 1\r\n\r\nG                       A\r\nThis is our decision to live fast and die young.\r\nG                      A                   D Dsus2 D Dsus2..... \r\nWe\'ve got the vision, now let\'s have some fun\r\nG                           A\r\nYeah it\'s overwhelming, but what else can we do?\r\nG                      A                            D Dsus2 D Dsus2..... \r\nGet jobs in offices and wake up for the morning commute?\r\n\r\nChorus 1\r\nA                G                A\r\nForget about our mothers and our friends.\r\n        G           D\r\nWe were fated to pretend.\r\n        G           D\r\n              to pretend.\r\n        G           D\r\nWe were fated to pretend.\r\n        G           D\r\n              to pretend.\r\n\r\nVerse 2\r\n\r\n\r\nD                                   G                        D Dsus2 D\r\nI\'ll miss the playgrounds and the animals and digging up worms.\r\nD                           G                                D Dsus2 D\r\nI\'ll miss the comfort of my mother and the weight of the world.\r\nD                            G                             D Dsus2 D\r\nI\'ll miss my sister, miss my father, miss my dog and my home.\r\nD                                 G                            D Dsus2 D\r\nYeah I\'ll miss the boredom and the freedom and the time spent alone.\r\n\r\nPre-chorus 2\r\n\r\nG                       