	(630,'I en lille båd der gynger','I en lille båd der gynger, sidder jeg og synger\r\nSynger om de ting, der gi\'r livet værdi\r\nJeg kan ikke gå på vandet, men jeg kan så meget andet\r\nJeg kan føle mig glad, jeg kan føle mig fri\r\n\r\nDer er forår i min mave. Jeg ved, hvad jeg vil lave\r\nUd at finde fred, fri for nogen der glor\r\nDrive rundt ude på fjorden med begge ben på jorden\r\nJeg er godt tilfreds med en pilsner i snor\r\n\r\nI en lille båd der gynger, sidder jeg og synger\r\nSynger om de ting, der gi\'r livet værdi\r\nJeg kan ikke gå på vandet, men jeg kan så meget andet\r\nJeg kan føle mig glad, jeg kan føle mig fri\r\n\r\nPrøv at mærke hvor luften sitrer. Se på vandet hvor det glitrer\r\nJeg har masser af tid og slet ingen ur\r\nHer er duft af tang og tjære. Det er lige til at bære\r\nTørre fisk på en rist fra et gammelt komfur\r\n\r\nI en lille båd der gynger, sidder jeg og synger\r\nSynger om de ting, der gi\'r livet værdi\r\nJeg kan ikke gå på vandet, men jeg kan så meget andet\r\nJeg kan føle mig glad, jeg kan føle mig fri\r\n\r\nI en lille båd der gynger, sidder jeg og synger\r\nSynger om de ting, der gi\'r livet værdi\r\nJeg kan ikke gå på vandet, men jeg kan så meget andet\r\nJeg kan føle mig glad, jeg kan føle mig fri',294,'2021-11-15 02:00:00',NULL),
	(631,'Alle sømænd er glade for piger','Alle sømænd er glade for piger;\r\nmen min skat, du kan stole på mig. \r\nDet er fuldstændig sandt, når jeg siger, \r\nat mit hjerte kun banker for dig!\r\n\r\nOg lidt for Susanne,\r\nBirgitte og Hanne,\r\nog Tove og Anne,\r\nog Lizzie og Kis. \r\nForuden Agnete, \r\nElisa og Grethe, \r\nog Annemerete,\r\nog Molly og Lis!\r\n\r\nAlle sømænd ta\'r ud i det fjerne. \r\nDu skal vide - om natten, når jeg \r\nstår ved roret og ser på en stjerne, \r\ner jeg altid i tanken hos dig!\r\nOg lidt hos Susanne ...\r\n\r\nAlle sømænd er flot tatoveret.\r\nDu skal se, når jeg kommer i havn; \r\npå min arm er jeg smukt dekoreret \r\nmed et hjerte, og der står dit navn! \r\nVed sid\'n af Susanne\'s...',84,'2021-11-15 14:30:00',NULL),
