	(633,'People Turn Around','D                        G             D\r\nEighteen in jail and with guns in their hands\r\n         A                         G             D\r\nThey were fighting for freedom, but just what is that?\r\n                       G            D\r\nBills to the banks, and food for the kids\r\n    A                     G           D\r\nWith money for college but couldn\'t get in\r\n                             G        D\r\nMade all the grades but God\'s taken to task\r\n      A               G         D\r\nLies a man in an alley wearing a mask\r\n                        G            D\r\nScreaming she begs as the people walk by\r\n       A                       G         D\r\nBut the man he just laughs, the woman she cries\r\n\r\nChorus:\r\n        D                    G      D\r\nWell its time all you people, turn around\r\n        A                      G        D\r\nFor the life we\'ve been living, messing around\r\n                          G        D\r\nBlood we\'ve been spilling, bleed us dry\r\n         A                        G                  D                                   \r\nCause the life you\'ve been killing is your life like mine\r\n\r\nThe needle is sweet and the snow it is pure\r\nThe pain I\'ve been hiding from I\'m finding a cure\r\nThe night it is warm and the light it is cold\r\nThe family I\'m robbing, I\'m calling them home\r\n\r\nChorus\r\n\r\nMy heart it is thumping my veins they are blue\r\nBlood has been pumping still hasn\'t met you\r\nThe beard that I\'m growing will not fully grow\r\nYears are not coming the way I thought they would\r\n\r\nHoping and waiting for something to seem\r\nLike the angels in heaven, bombs on the street\r\nHoping for love to find a new voice\r\nThe song that needs singing has already been sung before\r\n\r\nChorus x2',296,'2021-11-16 15:30:00',NULL),
	(634,'Dagen før','  F                     A7 \r\nTiden den er gået med raske vingeslag \r\n        Bb       Dm        C7 \r\ndet er lang tid siden den første dag \r\n F                            A7 \r\nmen jeg kan stadig huske dit smil og din make up \r\n          Bb                Dm \r\njeg blev stående da du kom gående \r\n         C7 \r\nfor jeg fik et chok \r\n\r\n       F          Dm           C7 \r\nDagen før var du kun en lille tøs \r\n     F            Dm              A \r\nfor lille og for bange til at gå løs \r\n       Bb     Dm \r\nåh åh åh     \r\n   C     Dm \r\nmadonna tænkte jeg \r\n Bb       Dm       F     C \r\nhvem der kunne få fat i dig \r\n\r\n F                       A7 \r\nDine øjne er grønne, det så jeg pludselig \r\n        Bb         Dm               C7 \r\nfor du kiggede et kort sekund da du gik forbi \r\n F                       A7 \r\nog alting stod stille i netop det sekund \r\n          Bb                 Dm              C7\r\nog min dingeling  -uh-  den tikkede, så det gjorde ondt ',79,'2021-11-17 04:00:00',NULL),
	(635,'Gilleleje Valsen','Ved så skøn en strand,\r\nsom man ønske kan\r\nhist ved Kattegat og Øresundens bred\r\nligger byen stolt\r\njeg vil synge op\r\nfor det er jo det bedste sted jeg ved.\r\n\r\nJa Gilleleje!\r\nDu lille fiskerby\r\nmange glade minder gemmer jeg om dig.\r\nJa, Gilleleje!\r\nDit navn har verdens ry\r\nhvor jeg end lever, så glemmer jeg dig ej.\r\n\r\nSom\'ren frisk og sund-\r\nsvale aftenstund\r\ndrager glade gæster til fra fjern og nær.\r\nVi ved kliters kant\r\nfred og hvile fandt\r\nderfor har vi dig allesammen kær.\r\n\r\nJa, Gilleleje!\r\nDu lille fiskerby\r\nmange glade minder gemmer jeg om dig.\r\nJa, Gilleleje!\r\nDit navn har verdens ry;\r\nhvor jeg end lever, så glemmer jeg dig ej.\r\n\r\nMangt et sted jeg så,\r\nsom jeg sige må\r\nder var skønt at se, og højt jeg prise kan;\r\nmen hvorhen jeg kom,\r\nvidt i verden om,\r\nså længtes jeg mod dig og Danmarks land.\r\n\r\nJa, Gilleleje\r\nDu lille fiskerby\r\nmange glade minder gemmer jeg om dig.\r\nJa, Gilleleje!\r\nDit navn har verdensry;\r\nhvor jeg end lever, så glemmer jeg dig ej.',298,'2021-11-17 16:30:00',NULL),
	(636,'Ghost Riders In The Sky','Am                                C\r\nAn old cowboy went riding out one dark and windy day\r\nAm\r\nUpon a ridge he rested as he went along his way\r\n \r\nWhen all at once a mighty herd of red-eyed cows he saw\r\nF                                     Am\r\nPlowing through the ragged skies  and up a cloudy draw\r\n \r\nAm                                        C\r\nTheir brands were still on fire and their hooves were made of steel\r\n      Am\r\nTheir horns were black and shiny and their hot breath he could feel\r\n            \r\nA bolt of fear went through him as they thundered through the sky\r\n       F                                  Am\r\nFor he saw the riders coming hard  and he heard their mournful cry\r\n \r\n        C         Am      F                   Am\r\nYipie i-oh  Yipie i-ay    ghost riders in the sky\r\n \r\nAm\r\nTheir faces gaunt their eyes were blurred\r\n      C\r\nTheir shirts all soaked with sweat\r\n     Am\r\nHe’s riding hard to catch that herd but he ain\'t caught \'em yet\r\n \r\nCause they\'ve got to ride forever on that range up in the sky\r\n   F                             Am\r\nOn horses snorting fire  as they ride on hear their cry\r\n \r\nAm                               C\r\nAs the riders loped on by him he heard one call his name\r\n       Am\r\nIf you want to save your soul from hell a riding on our range\r\n \r\nThen cowboy change your ways today or with us you will ride\r\nF                                 Am\r\nTrying to catch the devil’s herd  across these endless skies\r\n \r\n       C           Am    F                   Am\r\nYipie i-oh  Yipie i-ay   ghost riders in the sky\r\nF                  Am\r\nGhost riders in the sky  \r\nF                   Am\r\nGhost riders in the sky',64,'2021-11-18 05:00:00',NULL),
	(637,'Pigen med det solsort-sorte hår','Lige uden for byen dér hvor husene slår over i land\r\nLå der engang en Shell-tank\r\nDer nær havde gjort mig til en mand\r\nDet står så klart som i aftes – det står så klart som i går\r\nAt jeg gjorde mig til grin for pigen\r\nMed det solsort-sorte hår\r\n\r\nJeg kom kørende fra Bindslev\r\nMed noget grus jeg havde købt af en mand\r\nJeg sku’ ryge men jeg manglede en lighter\r\nOg holdt ind for at købe sådan én\r\nDa jeg stod i butikken og jeg så hende\r\nBlev jeg skræmt som en tævet hund\r\nSå jeg kom til at lette på min træsko\r\nOg tømme den ud for lidt sand\r\nJeg hørte hun lavede sådan et smask med munden\r\nOg kiggede ned på mine fødder\r\nDet blev den eneste gang jeg så pigen\r\nMed det solsort-sorte hår\r\n\r\nJeg skyndte mig at sige – en lighter tak \r\nOg stirrede ned på mine penge\r\nJeg ku’ mærke hun kiggede surt på mig\r\nJeg syntes det varede så længe\r\nDa jeg kom ud ku’ jeg se gennem vinduet\r\nEt kvindemenneske der bøjede sig ned\r\nOg fejede sand op efter et møgsvin\r\nDet var pigen med det solsort-sorte hår\r\n\r\nJeg kørte derfra med mit grus i en fart\r\nJeg forsvandt så hurtigt jeg ku’\r\nÅh sådan et fjols jeg havde været - og så klodset - åh Gud\r\nJeg pinte mig selv helt til Brønderslev \r\nJeg forbandede hvad jeg havde gjort\r\nEller måske ku’ jeg bare ikke glemme pigen\r\nMed det solsort-sorte hår\r\n\r\nSå en dag jeg skulle ind til Hjørring \r\nInd til lægen og ha’ set på en byld\r\nJeg holdt ind i Harken\r\nOg købte chokolade med kirsebærfyld\r\nJeg vidste med mig selv jeg måtte ind og beklage\r\nMit svineri og nu sku’ det være - og gi’ chokoladen\r\nTil pigen med det solsort-sorte hår\r\n\r\nJeg svingede ind på pladsen\r\nHvor butikken plejede at ligge\r\nMen der var ingen Shell-tank mere\r\nOg ingen butik at se\r\nI stedet for en Shell-tank\r\nVar der kommet noget der hed Jet\r\nBare en stor gul plade nogen havde smidt\r\nPå sådan et par stivere hen over en nat\r\nOg nogle standere på et nøgent vindblæst hjørne\r\nDer gabte som et åbent sår\r\nMen ikke så meget som skyggen af pigen\r\nMed det solsort-sorte hår\r\n\r\nJeg er ikke romantisk\r\nNok nærmest en fremskridts-mand\r\nHvis det ikke ka’ gå må det ramle\r\nJeg er sådan set ligeglad\r\nMen jeg skal aldrig ind og tanke mit diesel\r\nOm rabatten er nok så stor\r\nHvor folk er for nærige til at ansætte pigen\r\nMed det solsort-sorte hår',74,'2021-11-18 17:30:00',NULL),
	(638,'5 under 0','Nu har de lukket for varmen igen\r\nher er koldt som i en brøndgravers røv\r\nfem under nulpunkt\r\nmit overskuds G-punkt\r\ngir\' udslag fra middel til sløv\r\nJeg smed en kaktus efter køteren\r\nfordi den ville ud\r\nlige siden har den gemt sig et sted\r\nhun tog alt andet med sig og den er her kun endnu\r\nfordi den ikke kunne sige den ville med\r\n\r\nFørst vil hun giftes\r\nså vil hun skilles\r\nungerne bli\'r omdøbt yo-yo\r\nde sidder og bli\'r fede ved ham båtnakkens pc\r\nhun kalder sin ægtemand nu\r\n\r\nOg jeg er langt fra mit gamle niveau\r\njeg har langt op til toppen endnu\r\nmen jeg skal nok komme igen kan I tro\r\nfor jeg er mere end en mand\r\nmed mere end hævn til gode\r\n\r\nEngang var jeg mæcen for både kvinder og kunst\r\nviril som en hanoihelikopter i brunst\r\njeg har pisset i håndvasken på D\'angleterre\r\nfolk rendte og hylede\r\nhvem kan svinet mon være?\r\nNu hænger jeg på Geefergrund og famler mig frem\r\nigennem alt undtagen alt der kaldes \"light\"\r\nservetricens reaktion når jeg klager min nød\r\ner lisså vild som Stavanger by night\r\n\r\nJeg tar\' ud til onkel Otto hvis han stadigvæk bor\r\ni sin hule gravet ind i en skrænt\r\njeg vil se når han skodder cerutten på tungen\r\nen kunst der ellers snart vil blive glemt\r\nVi tar\' en 60 $ cognac af et Affermanglas\r\nog frådser i kålrabiragout\r\nvi har ingenting at snakke om\r\nså det vil vi gøre\r\nhvis onkel Otto han bor dér endnu',74,'2021-11-19 06:00:00',NULL),
	(639,'Udenfor Sæsonen','Em\r\nPå en rasteplads i Kassel\r\n          D                                      Em\r\ntrak en mama rundt med muttis kluge kinder\r\nEm                    D                         Em\r\npiccolinen var den samme som vi snød i fjor\r\nEm\r\nOg Speedy Gonzales spilled\' honky tonk\r\n        G                        D\r\nfra en veranda vendt mod øst\r\nEm                      D\r\næ blod i hans årer flød stille\r\n                Em\r\nmod den spanske kyst\r\n\r\nG             D          Em\r\nDet er sommer og udenfor sæsonen\r\n\r\nfolk de danser, danser og danser\r\nG             D          Em\r\ndet er sommer og udenfor sæsonen\r\n\r\nog de smiler og griner og smiler\r\nC             D          Em\r\ndet er sommer og udenfor sæsonen\r\n\r\nhula-mula vi elsker coca cola\r\nG             D          Em\r\ndet er sommer og udenfor sæsonen\r\n\r\nI en halv-akustisk guitar midt i city\r\nsov den tynde siameser\r\nradioens ragtime lød lidt hult\r\nog skrammedyret puster i natten\r\nsom den lykkelige profet\r\nhan hedder Villy\r\nmen han kaldes munken fra Tibet',299,'2021-11-19 18:30:00',NULL),
	(640,'Vejen Hjem','En flamme lyser himlen op\r\nog varmer en tiggers krop\r\net sted der står der en dør på klem\r\ndet ku’ han se på vejen hjem\r\n\r\nIgennem de vilde stier\r\nder så han et kirkespir\r\nog lyset det pegede ligefrem\r\ndet ku’ han se på vejen hjem\r\n\r\nEn fattig sov i en park\r\nen engel stod og holdt vagt\r\nsom soldaterne i Bethlehem\r\ndet ku’ han se på vejen hjem\r\n\r\nOg sneen faldt stille og blidt\r\nder lå han livløs i kjole og hvidt\r\nhans liv havde været et rekviem\r\ndet så han først nu på vejen hjem',299,'2021-11-20 07:00:00',NULL),
	(641,'Balladen om T.T.T.','Med lidt spyt på sin tommeltot\r\ntør\'t mor mit ansigt af for snot\r\nsnot af at vræle fordi jeg vil fortælle\r\nom en ponyhest jeg lige ha\' set\r\nen ponyhest der legede med en dreng\r\nmen de gamle fatter ingenting\r\nDet eneste de gamle er kommet for at se er\r\nTårnspringer Thomsen fra Tåstrup\r\n\r\nVi trak videre med strømmen som et bette fnug støv\r\ndet eneste jeg ku\' se var voksne bukserøve\r\nså blev jeg løftet op mod himlens tag\r\nop på fars skuldre på en sommerdag\r\nder var stribede markiser så langt jeg ku\' se\r\nog søndagstøj med rigtige mandfolk i\r\nen mand stod og råbte kom og gi\' en skærv\r\nnår borgmesteren løfter de syv små dværge\r\neller døvstumme Conny der forsøger at danse\r\ntil Poul Dissing der forsøger at synge imens\r\nVi venter på tivolis hovedattraktion\r\nTårnspringer Thomsen fra Tåstrup\r\n\r\nDer var folk helt fra Sæby og Aalborg af\r\nvi stod og måbede med nakken lagt tilbage\r\ntrykket til jorden af det vanvittige syn\r\naf tårnspringermasten højt over byen\r\nda tusind års stilhed endelig lettede\r\nder blev fuldstændig stille da en højttaler skrattede:\r\n\r\n- Damer og Herrer i den her bette by\r\ner i klar til en mand af verdensry\r\nom et øjeblik vil han begynde at kravle op\r\nfor at springe ud fra mastens top\r\noven i købet verdens eneste mand\r\nder ka\' nøjes med at lande i en bette spand vand\r\n30 meter ned uden sikkerhedsnet\r\nfor jer sætter han sit liv på et bræt\r\ni tre dage har han pure nægtet at springe\r\nsimpelthen på grund af for kraftig vind\r\n- ja gu\' er det farligt – næsten uforsvarligt\r\nvi må ha\' fuldstændig ro – ta\' nu godt imod\r\nTårnspringer Thomsen fra Tåstrup\r\n\r\nSå i det samme kom han ud af sit skur\r\nsom et sjældent dyr der kommer ud af sit bur\r\nsammen med ham kom en bette fed mand\r\nder virkede nervøs som var det ham der sku\' springe\r\ndet var svært at høre hvad den bette mand sagde\r\nmen jeg tror jeg vil spørge ham hvis jeg ser ham en dag\r\nTårnspringer Thomsen virkede nærmest lidt skræmt\r\nog den bette fede mand virkede osse beklemt\r\nde pegede på flaget i mastens top\r\nfolk begyndte at råbe kom nu, hop!\r\nEt flertal der kræver er umuligt at stoppe\r\nså Tårnspringer Thomsen begyndte at kravle op\r\n\r\nHan hed faktisk Jamie Jamieson\r\nmen det var der ingen der ku\' sige derfra hvor jeg kom\r\ndet var fuldstændig ligemeget hvad han hed\r\ndet eneste vi vil\' se var en mand der faldt ned\r\nvi kaldte ham Tårnspringer Thomsen fra Tåstrup\r\n\r\nUde over havet var himlen sort\r\nTårnspringer Thomsen stod ved himmerigs\' port\r\nsom engang en håndværker på sit kors\r\nstod han stille lidt med armene spredt ud på tværs\r\nsom engang en håndværker I Palæstina\r\nvar han halvvejs en helt\r\nhalvvejs noget man ku\' grine af\r\nSå var der en der hviskede nu springer han vist\r\nmor rettede lidt på den gamles slips\r\nså holdt hun vejret med åben mund\r\njeg så hun tog fat i den gamles hånd\r\nhendes knoer blev hvide idet hun fik fat\r\nog han løsnede på slipset hun lige havde sat\r\nog idet samme fra toppen af sin 30 meter mast\r\nsprang Tårnspringer Thomsen fra Tåstrup\r\n\r\nVi så ham flyve som en udstrakt pil\r\nskudt ud af himlen som af Wilhelm Tell\r\nhan voksede i os jo mer\' han faldt\r\nmen halvvejs nede var der noget der gik galt\r\nhan baskede med armene som om han fortrød\r\nmens han nærmede sig jorden med en hvislende lyd\r\nhan landede i bassinet som han sku\'\r\nmen han ramte osse jorden så den runger endnu\r\nda Rimmern\' kirke ringede solen ned\r\nomfavnede himlen det sidste skrig\r\nfra Tårnspringer Thomsen fra Tåstrup\r\n\r\nEn stilhed jeg mindes fra før jeg blev født\r\nså stille som de bønner han aldrig fik bedt\r\nham der solgte pølser fik sig banet vej\r\nen tyk bette mand i netundertrøje\r\nvi så ham dykke ned i det bette bassin\r\nog da han langt om længe kom op igen\r\nbar han i favnen den livløse bylt\r\naf Tårnspringer Thomsen fra Tåstrup\r\n\r\nSå skrattede en højttaler med en besked\r\n- Damer og Herrer i den her bette by\r\nmå vi be\' om et bifald som aldrig før\r\nmen der var ingen der klappede\r\nikke så vidt jeg ku\' høre\r\nnu hvor det hele for længst er forbi\r\n- altså bagklog kan man selvfølgelig sige\r\nat en mand der som ham sprang i skæbnens vold\r\nmer\' end nogen havde fortjent sit bifald\r\n- og så alligevel\r\nden eneste der helt sikkert ingenting ku\' høre\r\nvar Tårnspringer Thomsen fra Tåstrup\r\n\r\nDer blev sagt at Poul Dissing sku\' synge et sæt mer\'\r\njeg må lige ha\' spurgt Poul om han ka\' huske hvad han gjorde\r\n- snart poppede popcornmaskinen igen\r\nen sort dag i bizness men the show must go on\r\ni avisens dækning den følgende dag\r\nvar det ham der solgte pølser der var billeder af\r\nhans penge blev våde da han prøvede på at redde\r\nTårnspringer Thomsen fra Tåstrup\r\n\r\nJeg reddede mig en lussing i stedet for en is\r\nved at sige vi var udvalgt blandt tusindvis\r\ntil at se en tårnspringer slå sig ihjel\r\nselvfølgelig noget lort - men han valgte det jo selv\r\nog hvem kan forstå når man kun er en dreng\r\nder findes mennesker med en djævelsk trang\r\ntil at blive husket som mere end sin far\r\nhvem så end hans far han var\r\nMåske den første der sprang ud engang\r\nblandt Tårnspringer Thoms\'ner fra Tåstrup\r\n\r\nFlyv bette fugl ligeså tosset du vil\r\ndet var det du fik dine vinger til\r\nvi andre må nøjes med at forstå\r\nvi blev sat på jorden for at kravle og gå\r\nvi skal fortsat slubre i lunken grød\r\nvi ska\' nøjes med at kratte for det daglige brød\r\nog at den slags krumspring skal gå galt\r\nvar vi mange her i byen der godt ku\' ha\' fortalt\r\nHvis vi ellers ha\' fået en chance for at snakke\'\r\nmed Tårnspringer Thomsen fra Tåstrup',74,'2021-11-20 19:30:00',NULL),
	(642,'Hands Up','Hands up, baby, hands up,\r\nGimme your heart, gimme, gimme your heart\r\nGimme gimme\r\nHands up, baby, hands up,\r\nGimme your heart, gimme, gimme\r\nAll your love, \r\nAll your love.\r\n\r\nAngel face, I love your smile,\r\nLove your ways, I like your style.\r\nWhat can I do to get closer to you?\r\nDon\'t think twice or count to ten.\r\nDon\'t take advice, don\'t ask me when.\r\nJust come my way, simply kiss me and say:\r\n\r\nHands up, baby, hands up, ...\r\nWith your head up in the sky,\r\nEvery day you\'re walkin\' by,\r\nWhy don\'t you have the stars looking at me?\r\n\r\nStop that game, don\'t waste your time,\r\nFor all your dreams are matchin\' mine,\r\nNo use to play hide n seek for a week.\r\n\r\nHands up, baby, hands up,...\r\nLet me be your Romeo, your wonder boy,\r\nAnd your super champ.\r\nLet me take you to the milky way\r\nOn a holiday, (on a holiday)\r\nFollow me (follow me) \r\nwhy don\'t you follow me (why don&\'t you follow me)?\r\nJust come my way simply kiss me and say:\r\n\r\nHands up, baby, hands up, ...',300,'2021-11-21 08:00:00',NULL),
