	(647,'On the turning away','On the turning away\r\nFrom the pale and downtrodden\r\nAnd the words they say\r\nWhich we won\'t understand\r\n\"Don\'t accept that what\'s happening\r\nIs just a case of others\' suffering\r\nOr you\'ll find that you\'re joining in\r\nThe turning away\"\r\n\r\nEm    D         G\r\nIt\'s a sin that somehow\r\n            C         Em\r\nLight is changing to shadow\r\n          D    G\r\nAnd casting its shroud\r\n      C\r\nOver all we have known\r\nEm              C          G\r\nUnaware how the ranks have grown\r\nEm                 G           C\r\nDriven on by a heart of stone\r\nG                         C            Em\r\nWe could find that we\'re all alone\r\n       D            G\r\nIn the dream of the proud\r\n\r\n\r\nEm     D            G\r\nOn the wings of the night\r\n       C          Em\r\nAs the daytime is slurring\r\n          D         G\r\nWhere the speechless unite\r\n     C\r\nIn a silent accord\r\nG                    C         Em\r\nUsing words you will find are strange\r\nG                     Em         C\r\nAnd mesmerized as they light the flame\r\nG                    C\r\nFeel the new wind of change\r\nEm      D           G\r\nOn the wings of the night\r\n\r\n\r\n\r\nEm      D       G\r\nNo more turning away\r\n         C           Em \r\nFrom the weak and the weary\r\nEm      D       G\r\nNo more turning away\r\n         C\r\nFrom the coldness inside\r\nG                    C        Em\r\nJust a world that we all must share\r\nG                       Em        C\r\nIt\'s not enough just to stand and stare\r\nG             C                 Em       \r\nIs it only a dream that there\'ll be\r\n        D       G\r\nNo more turning away?',5,'2021-11-23 22:30:00',NULL),
	(648,'Hollywood','Med ryggen mod muren ved kimmingens port\r\nDansed’ Rogers og Fred Astaire\r\nsom ånder over de stille vande\r\nfik de deres sidste affære\r\n\r\nBag hytten i skoven ved Hollywoods flod\r\nsad Zorro med sin sorte sjæl\r\nog Lilli Marlene trak sig ud af sin silke\r\nog hængte torsk på en bundgarnspæl\r\nDen vilde sti den var øde\r\nog jokeren var krøbet i ly\r\nder var kun de døde\r\ntilbage i Hollywood by\r\n\r\nDe kom fra Hollywood\r\nmed Hollywood Express\r\nde kom fra Hollywood\r\ni deres Hollywood dress\r\n\r\nDen sexede Lassie med den røde tud\r\nhavde mistet sin underdel\r\nden tårnhøje bygning var for længst brændt ud\r\nog Jaws var kun fiskemel\r\n\r\nOg Mae West der red rundt på Tonto’s hest\r\nvar forsvundet på Lykkens Cafe’\r\nog Oliver & Hardy tog på Jane\r\ni Tarzans 2CV\r\nDen vilde sti den var øde\r\nog regnen den tog fat\r\nder var kun de døde\r\ni denne Hollywood nat\r\n\r\nDe kom fra Hollywood',304,'2021-11-24 11:00:00',NULL),
	(649,'Under rimelige grænser','solen skinner sparsomt på den rejsende mand\r\neffektive verdens parodi\r\njeg ta\'r den der rejser natten væk\r\nsom makker ved mit bord\r\njeg sætter mig jeg låner hans fortælling\r\n\r\nunder rimelige grænser\r\ngennem ubevogtet land\r\nunder månens stjålne brand\r\nunder rimelige chancer\r\npå tværs af verdens lov\r\nsom en tråd i hver en sang\r\n\r\nden ældste mand kan se dem\r\naltså vækker han de små\r\nen børneflok af søvnens fantasi\r\nhan peger over bakken gennem tågens silhouet\r\nog si\'r se nattetimens mestermand forsvinder\r\n\r\npå en rasteplads i Kassel\r\npå en bænk i Alamaloo\r\ngør den blinde digters ord til mer end ord\r\nmen når de store store floder\r\nkrydses digitalt\r\nplotter pc-Larry ind på sangens jomfru',304,'2021-11-24 23:30:00',NULL),
