	(660,'V.L.T.J.','Et sted mod vest på Jyllands kyst\r\nderude, hvor sandet er så lyst,\r\nkører toget dagligt i slud og blæst,\r\n:/: mod nye mål i damp og røg:/:\r\nden hedder VLTJ\r\n\r\nDen ta’r fra Vemb fra morg’nen af\r\nta’r over Lemvig og kører derfra\r\nta’r ud mod kysten, hvor den ender helt i Thyborøn\r\nTuren er en: Dejlig rejse, ned til fjorden, ud til havet.\r\nGennem Jylland når man rejser med VLTJ.\r\n\r\nPå den jydske hede langt ude mod vest\r\nligger den station, vi kender bedst.\r\nDet er byen Vemb, hvorfra toget kør’\r\n:/: gennem byer som Vrist og Harboør:/:\r\nmed Georg som chauffør.\r\n\r\nDen ta’r fra Vemb fra morg’nen af\r\nta’r over Lemvig og kører derfra\r\nta’r ud mod kysten, hvor den ender helt i Thyborøn\r\nTuren er en: Dejlig rejse, ned til fjorden, ud til havet.\r\nGennem Jylland når man rejser med VLTJ.\r\n\r\nOg toget kommer så til Lemvig\r\net smilehul ved fjordens vig\r\nen dejlig gammel by syn’s vi,\r\n:/: hvor toget vender og kør’ mod vest:/:\r\nmod Thyborøn i blæst.\r\n\r\nDen ta’r fra Vemb fra morg’nen af\r\nta’r over Lemvig og kører derfra\r\nta’r ud mod kysten, hvor den ender helt i Thyborøn\r\nTuren er en: Dejlig rejse, ned til fjorden, ud til havet.\r\nGennem Jylland når man rejser med VLTJ.\r\n\r\nOg endelig er målet nået,\r\ndet gik som vor chauffør havde spået.\r\nToget holdt til turen og vi har fået\r\n:/: en tur til hav og fjord så skøn:/:\r\nved endestation Thyborøn.\r\n\r\nDen ta’r fra Vemb fra morg’nen af\r\nta’r over Lemvig og kører derfra\r\nta’r ud mod kysten, hvor den ender helt i Thyborøn\r\nTuren er en: Dejlig rejse, ned til fjorden, ud til havet.\r\nGennem Jylland når man rejser med VLTJ.',310,'2021-11-30 17:00:00',NULL),
