	(667,'Den første gang jeg så dig','E                               A            E\r\nDen første gang jeg så dig, det var en sommerdag,\r\n   A               E           H\r\nom formiddag’n, da solen lyste klar\r\n   E                        A             E\r\nOg alle engens blomster var mange hundred flag\r\n    H              F#m7         H\r\nder svajed svagt i blæsten ovenfra\r\n    H             E              A             E\r\nFor blæsten ånded ganske tyst og bristende mod stranden\r\n   H              C#m              F#m7           H\r\nDa klapped bælgen længselsfuldt en musling gemt i sandet\r\n    E                       A                E\r\nDen første gang jeg så dig, det var en sommerdag\r\n    A              E           H  E           A E H E\r\nden første gang vi talte til hinanden.\r\n\r\nDen første gang jeg så dig, da lyste sommerskyen\r\nså blændende som svanen i sit skrud.\r\nDa kvitrede fra skoven - fra skovens grønne bryn\r\nligesom en jubel fugle sang en ud\r\nDa faldt en sang fra himlen ned og hvem kan musicere\r\nsmukt som den lille lærke grå – så svær at observere.\r\nDen første gang jeg så dig, da lyste sommerskyen\r\nså blændende og klar som aldrig mere.\r\n\r\nOg derfor når jeg ser dig – i vinterens kolde dag,\r\nnår sneen dækker jorden som en skal\r\nSå hør’ jeg sommerblæsten og lærkens friske slag\r\nog bølgens brus i alle fulde fag\r\nSå drages sneens tæppe væk fra engen og fra ager\r\nog kløvermarken blir så blød som elskende behager \r\nog sommersolen skinner på dine ansigts træk\r\nsom rødmer og som stråler og betager.',85,'2021-12-04 08:30:00',NULL),
	(668,'Halvnøgne','F G\r\n     Du vil blive løget for\r\nF G  \r\n     Du vil blive lovet noget\r\nF G \r\n     Men du ska’ grine a’ det\r\n\r\n\r\nC                    G          Dm\r\n   Til sommeren og til dine øjne\r\n                F         G\r\n   Til lyden af nat i min barndomsby\r\nC                 G            Dm   F G  \r\n   Hvor vi vågned’ op halvnøgne\r\n\r\n\r\nC                     G                Dm \r\n   Jeg tror jeg står af på drømmenes perron\r\n                F              G\r\n   Hvor man ka’ vente alle tider\r\nC             G                  Dm   F G\r\n   betyder vi ikke noget længer’\r\n\r\nC             G                 Dm\r\n   Hvile min krop på den skrå beton\r\n                  F          G\r\n   og mærke jorden ryste 1000 gange\r\nC              G                 Dm\r\n   Vente for altid på, det kommer\r\n\r\n[PRE-CHORUS]\r\n\r\nF              G               Am          \r\n   Jeg ville ønske jeg ku’ ta’\r\n           Bm      C       \r\n   Hvert et tog tilbag’\r\nF            G\r\n   Hvert et tog tilbag’\r\n\r\n[CHORUS]\r\n\r\nC                    G          Dm\r\n   Til sommeren og til dine øjne\r\n                F         G\r\n   Til lyden af nat i min barndomsby\r\nC                 G            Dm   F G  \r\n   Hvor vi vågned’ op halvnøgne\r\n\r\n[VERSE 2]\r\n\r\nC                 G                  Dm\r\n   Mit liv det har ingen destination\r\n                        F                 G         \r\n   jeg stopper ik’, jeg snakker ik’ med nog’n\r\nC                   G                 Dm\r\n   Men linjen ville altid køre vid’re\r\n\r\n\r\n[PRE-CHORUS]\r\n\r\nF              G               Am          \r\n   Jeg ville ønske jeg ku’ ta’\r\n           Bm      C       \r\n   Hvert et tog tilbag’\r\nF            G\r\n   Hvert et tog tilbag’\r\n\r\n[INSTRUMENTAL BREAK]\r\n\r\n[INTRO]\r\n\r\nF G\r\n     Du vil blive løget for\r\nF G  \r\n     Du vil blive lovet noget\r\n\r\n\r\n[CHORUS]\r\n\r\nC                    G          Dm\r\n   Til sommeren og til dine øjne\r\n                F         G\r\n   Til lyden af nat i min barndomsby\r\nC                 G            Dm   F G  \r\n   Hvor vi vågned’ op halvnøgne\r\n\r\n[PRE-CHORUS]\r\n\r\nF              G               Am          \r\n   Jeg ville ønske jeg ku’ ta’\r\n           Bm      C       \r\n   Hvert et tog tilbag’\r\nF            G\r\n   Hvert et tog tilbag’\r\n\r\n[CHORUS]\r\n\r\nC                    G          Dm  F G\r\n   Til sommeren og til dine øjne\r\nC                 G            Dm   F G  \r\n   Hvor vi vågned’ op halvnøgne',308,'2021-12-04 21:00:00',NULL),
	(669,'Jeg har elsket dig så længe jeg kan mindes','Ofte er det kun en ganske lille ting,\r\ningen lægger mærke til, der sætter det i sving,\r\net tilfældigt strejf af en hånd knytter hjertenes bånd\r\n\r\nSpø\'r jeg nu mig selv, hvorfor det just blev dig,\r\naner jeg det ikke, og jeg husker heller ej,\r\nhvad mit liv var værd, før du kom, nu, nu er det kun som om: \r\n\r\nJeg har elsket dig så længe jeg kan mindes,\r\nog sværmet for din stemmes dybe klang.\r\nHvor findes en beundring som en kvindes,\r\nder elsker en for allerførste gang?\r\n\r\nMit hjerte danser, så det burde bindes,\r\ndet flyver ud mod verden i en sang,\r\nog ingen sang kan juble som en kvindes,\r\nder elsker en for allerførste gang.\r\n\r\nHar verden overho\'det set din lige?\r\nDet går i alt fald over min forstand,\r\njeg er jo kun en lille hverdagspige,\r\nog du er jordens drabeligste mand!\r\n\r\nJeg vil gi\' dig alt det dejligste, der findes\r\nog gætte dine ønsker dagen lang,\r\ningen hænder er så ødsle som en kvindes,\r\nder elsker en for allerførste gang.',314,'2021-12-05 09:30:00',NULL),
	(670,'Tennessee Whiskey','G                            Am\r\nUsed to spend my nights at a barroom\r\nC                             G    C G\r\nLiquor was the only love I\'ve known                \r\nG                                        Am\r\nBut you rescued me from reaching for the bottom\r\n               C         D             G   C G\r\nAnd brought me back from being too far gone               \r\n\r\n\r\n[Chorus]\r\nG                                     Am\r\nYou\'re as smooooooth,    as Tennessee whiskey\r\n          C                        G   C G\r\nYou\'re as sweeeeeeet as strawberry wine\r\nG                                  Am\r\nYou\'re as waaaarrrrm as a glass of brandy\r\n                 C              D            G   C G\r\nAnd honey I stay stoned on your love all the time               \r\n\r\n\r\n[Verse]\r\nG                                        Am\r\nI’ve looked for love in all the same old places\r\nC                                       G      C G\r\nFound the bottom of the bottle\'s always drrryyy             \r\nG                                           Am\r\nBut when you poured out your heart I didn\'t waste it\r\n            C                 D              G           D D D D D D\r\nCause there nothing like your love to get me hiiiiigggh. You\'re as\r\n\r\n\r\n[Chorus]\r\n          G                           Am\r\n          smooooooth,    as Tennessee whiskey\r\n          C                         G   C G\r\nYou\'re as sweeeeeeet as strawberry wine\r\nG                                  Am\r\nYou\'re as waaaarrrrm as a glass of brandy\r\n                  C             D            G   C G\r\nAnd honey I stay stoned on your love all the time              \r\n\r\n\r\n[Chorus]\r\nG                                     Am\r\nYou\'re as smooooooth,    as Tennessee whiskey\r\n          C                        G   C G\r\nYou\'re as sweeeeeeet as strawberry wine\r\nG                                  Am\r\nYou\'re as waaaarrrrm as a glass of brandy\r\n                 C              D           G   C G\r\nAnd honey I stay stoned on your love all the time                \r\n\r\n\r\n[Chorus]\r\nG                                     Am\r\nYou\'re as smooooooth,    as Tennessee whiskey\r\n          C                        G   C G\r\nYou\'re as sweeeeeeet as strawberry wine\r\nG                                  Am\r\nYou\'re as waaaarrrrm as a glass of brandy\r\n                 C              D            G   C G\r\nAnd honey I stay stoned on your love all the time         \r\n\r\n\r\n[Outro]\r\nG                                     Am\r\nYou\'re as smooooooth,    as Tennessee whiskey\r\n               C                   G  C G\r\nTennessee whiskey   Tennessee whiskey\r\nG                                     Am\r\nYou\'re as smooooooth,    as Tennessee whiskey\r\n               C\r\nTennessee whiskey\r\n               G\r\nTennessee whiskey',315,'2021-12-05 22:00:00',NULL);
