	(671,'Lille ørred','      C     F        C         Am\r\nLille Ørred   gemt i bækken\r\nG              C\r\nStår du der endnu?\r\n                F          C       Am\r\nDet var mig der   stod med snøren\r\nF            G\r\nÉn af os var Gud\r\n    C           F        C \r\nMen landevejens summende kalden\r\n   Am            F              G\r\nOg pigen der var lisså glat som dig\r\n      C      F         C       Am\r\nLille Ørred     gemt i bækken\r\nG                C\r\nTrak os hver sin vej\r\n\r\nLille Ørred gemt i bækken\r\nStår du der endnu?\r\nEller drev du som mig med strømmen\r\nLagt i rør og rettet ud\r\n\r\nAm    F         C\r\nSolen   gav dig pletter\r\nAm     F         G  \r\nRegnen   gav dig ro\r\n      C     F         C       Am\r\nLille Ørred   hvis du vågner\r\n          G\r\nSkræmt af natten er vi to\r\n\r\nJeg har stemt på dem der snakker\r\nOg snakket mer’ end dem\r\nLille Ørred på mit vindspejl\r\nDu får mig til at længes hjem',74,'2021-12-06 10:30:00',NULL),
