	(673,'Hvad er der så mer?','Du brokker dig og klager\r\n? kaldet ikke mer\'\r\nspekulerer så det knager\r\nmens rynkerne bliver flere\r\nDer er fuger i din pande\r\nog du er begyndt at bande\r\nsiger gad Fanden tage det hele\r\nput\' det hele op på skrå\r\nMen så smid det dog fra dig\r\nsmæk en dør gå ud og gå\r\n\r\nFor når du ser at gæsset gror\r\nog at skoven springer ud\r\nHva\' er der så mer\'\r\nmellem dig og så din gud?\r\nJeg siger når du ser at græsset gror\r\nog at skoven springer ud\r\nHva\' er der så mer\'\r\nmellem dig og så din gud?\r\n\r\nDu spidser albuer\r\nkridter skoene\r\nheller ikke uden stop\r\nog du har ingen resto\r\nog er stået lidt for tidligt op\r\nDu har glemt at se din kone\r\nhun var før din lille Lone\r\nsidder ikke ved bordet\r\nskælder ud og siger ting\r\nJamen så stands dog nu for fanden\r\nog så se dit lidt omkring\r\n\r\nFor når du ser at gæsset gror\r\nog at skoven springer ud\r\nHva\' er der så mer\'\r\nmellem dig og så din gud?\r\nJeg siger når du ser at græsset gror\r\nog at skoven springer ud\r\nHva\' er der så mer\'\r\nmellem dig og så din gud?\r\n\r\nMen du styrter blot afsted\r\nuden at høre eller se\r\nind i bilen frakken ned\r\nog hov, hvad var det der skete?\r\nDu har fået så ondt i hjertet,\r\nbare der ikke er noget galt\r\npå det sidste har det smertet\r\nlidt ligesom du\' blir\' kvalt\r\n\r\nDet er nu og det er her\r\nog det er her og nu det sker.\r\n\r\nMen når du ser at gæsset gror\r\nog at skoven springer ud\r\nHva\' er der så mer\'\r\nmellem dig og så din gud?\r\nJeg siger når du ser at græsset gror\r\nog at skoven springer ud\r\nHva\' er der så mer\'\r\nmellem dig og så din gud?',83,'2021-12-07 11:30:00',NULL),
	(674,'Lille Sommerfugl','C           F     G7               C\r\nI en dejlig have, fyldt med gylden sol,\r\nC                 D7    G   D7        G\r\nfyldt med duft af lil - je, rose og viol\r\nC          F       G7             C\r\nmøder vi hinanden, jeg er tung og træt,\r\nD7          G      Am      D7     G7\r\ndu på hvide vinger svinger dig så let.\r\n\r\n      C                 F          Dm\r\nLille sommerfugl, lille sommerfugl\r\n         G7                        C                  G7\r\nflyv fra blomst og til blomst, fra skjul til skjul. \r\n        C                  F            Dm\r\nNår jeg ser på dig, ak, så tænker jeg, \r\n         G7             C         G\r\nhvem der bare var sommerfugl.\r\n\r\nEr violen troløs, finder straks du trøst\r\ntæt ved liljens var-me, jom-fru-hvide bryst\r\nMen til rosens favntag snart du kaldes bort, \r\nhimlen er så blå, og livet er så kort\r\n\r\nLille sommerfugl...\r\n\r\nLille glade flyver under himlens blå,\r\ndin er hver en blomst, som solen skinner på\r\nFørst når jorden dækkes tæt af gyldent løv, \r\nfolder du din vin-ge træt og bli\'r til støv\r\n\r\nLille sommerfugl, lille sommerfugl\r\ndu var glad, til du fandt dit sidste skjul\r\nNår jeg mindes dig ak, så tænker jeg, \r\nhvem der bare var sommerfugl.',316,'2021-12-08 00:00:00',NULL),
	(675,'Kys hinanden','Verden er vild! Alting er skørt! \r\nBibelens ti bud blir slet ikke hørt! \r\nDet som vi mangler er selveste \r\nbud nummer elleve\r\nOg det bud har jeg fundet på,\r\nog det lyder i korthed som så:\r\n\r\nKys hinanden!\r\nKærligt og blidt på panden.\r\nKys er jo tegn på fordragelighed. \r\nDet\'n behagelighed!\r\nOg min svagelighed!\r\nAltså: Kys hinanden!\r\nFor det vil ærgre Fanden.\r\n(Men) englene jubler, og guderne ler, \r\nhvis vi kysser hinanden lidt mer.\r\n\r\nPrøv nu at se, hvad der vil ske,\r\nhvis man går ind på min fikse ide. \r\nFørste eksempel skal være\r\nto fjendtlige hære,\r\nsom kampberedt står opmarcher\'t,\r\nmen så pluds\'lig blir der kommander\'t: \r\n\r\nKys hinanden!\r\nBare gå li\' på manden.\r\nSå går det frem gennem pigtråd og hegn \r\nmod en fjendtlig kaptajn,\r\nsom si\'r: Kom så min eg\'n!\r\nOg så op på skansen\r\nog kys dem helt fra sansen.\r\nNår de har kysset det første geled, \r\nbryder fjend\'n samm\'n og trygler om fred.\r\n\r\nFlere og fler\' kører i bil,\r\nmen i trafikk\'n ser man aldrig et smil. \r\nDer skal man bare fornærme\r\nog helst krølle skærme.\r\nMen hvis I vil følge mit bud,\r\nså rul ned og stik ho\'derne ud.\r\n\r\nKys hinanden!\r\nSpar jeres banden.\r\nHam der kør\' rundt i en gammel Chevrolet \r\nog med murerkasket \r\nhan kan osse ha\' ret!\r\nOg såfremt en Opel\r\nkører lidt mindre nobel\'\r\nog torpederer dig midt i et kryds\r\nså stig ud og gi\' manden et kys.\r\n\r\nDisse ord, som står over dom-\r\nhuset, dem må vi jo ha\' lavet om.\r\nDet er vist noget i retning\r\naf denne her sætning:\r\nMed lov skal man bygge et land.\r\nMen der burde ha stået sådan:\r\n\r\nKys hinanden!\r\nLa\' vær\' med at slå på panden.\r\nBissen i Nyhavn blir ydmyg og blid.\r\nEllers kommer politi \'t.\r\nOg begynder kysseri\'t\r\nSå må hver en sagfør\'\r\nbegynde at rense tagrør.\r\nDer vil aldrig bli\' brug for en lovparagraf -\r\nhvis man skal kysse sin modpart som straf\r\n\r\nMed dette bud mener jeg sel\'\r\nverden blir hyggelig og ideel.\r\nDet skal lanceres med ynde.\r\nLad os her begynde.\r\nFor det er en mægtig ide.\r\nOg vi starter når jeg siger tre!\r\n(En - to - tre - og så ...)\r\n\r\nKys hinanden!\r\nKys nu ham hustyrannen!\r\nOg når De nu kommer hjem til Dem sel\', \r\nhusk så på min appel,\r\nså\' den højaktuel!\r\nTa\' og kys hinanden!\r\n(Så) sti\'r barometerstanden.\r\nOg barometret blir stå \'nde på smukt - \r\nlænge efter at lyset er slukt',317,'2021-12-08 12:30:00',NULL),
	(676,'Veras vinterven','Vera sir\', jeg er så sød og rar,\r\nmen om som\'ren holder hun mig kun for nar.\r\nHun skifter hele tiden kavaler.\r\nHver dag har hun en ny og ofte fler\'.\r\n\r\nFor jeg véd jeg kun er Veras vinterven.\r\nHver sommer er der fyldt med andre mænd.\r\nMen jeg véd, hun helt og kun er min,\r\nindtil bøgens knopper springer ud igen.\r\n\r\nVera er en pryd for vores by.\r\nHos drenge har hun fået et mægtigt ry.\r\nHver sommer finder nye hendes seng,\r\nmen om vint\'ren er jeg byens eneste dreng.\r\n\r\nFor jeg véd jeg kun er Veras vinterven.\r\nHver sommer er der fyldt med andre mænd.\r\nMen jeg véd, hun helt og kun er min,\r\nindtil bøgens knopper springer ud igen.\r\n\r\nMen når det først er startet med og sne,\r\nså er der ikke mange mænd at se.\r\nSå véd jeg Vera kommer til min gård,\r\nog vi har det herligt sammen til det blir’ vår.\r\n\r\nFor jeg véd jeg kun er Veras vinterven.\r\nHver sommer er der fyldt med andre mænd.\r\nMen jeg véd hun helt og kun er min,\r\nindtil bøgens knopper springer ud igen. \r\n',318,'2021-12-09 01:00:00',NULL),
