	(678,'Når lyset bryder frem','Intro: D \r\n\r\n          D                    Em\r\nDu lille barn du er på vej til drømmeland\r\nC            G          D\r\n  Pludselig møder du en mærkelig mand\r\n                         Em\r\nHan tar dig med over det dybe vand\r\nC        G             D\r\n   Til I kommer til en fremmed strand\r\n         Bm\r\nSom i et eventyr\r\n          Em\r\nEr alt du ser\r\n            Bm             A     \r\nHer er onde trolde og gode feer,\r\nG   D    A  A   A  A  \r\nAah-ah - Du vil se mer\r\n\r\nOmkvæd:\r\n    G            D\r\nNår lyset bryder frem\r\n    G            D\r\nNår lyset bryder frem\r\n             Em\r\nJa, så må du hjem\r\nC          D\r\n  Så må du hjem\r\n\r\nDet smukke hus højt på en bakketop\r\nKun den smalle sti kan nå derop\r\nEt kraftigt sus fra gribbens vingeslag\r\nDøde rotter er her masser af\r\nSom i et eventyr\r\nEr alt du ser\r\nAlle er mætte og pudser fjer\r\nDu vil se mer\r\n\r\nOmkvæd\r\n\r\nDen søde vin har slået drengen helt omkuld\r\nHan samler tårer i en spand af guld\r\nEt smykkeskrin begravet i et mægtigt hul\r\nHvor tyven selv faldt ned så plørefuld\r\nSom i et eventyr\r\nEr alt du ser\r\nEn syndig sjæl fløj væk\r\nMen her er mange fler\r\nDu vil se mer\r\n\r\nOmkvæd',248,'2021-12-10 02:00:00',NULL),
	(679,'Den grimmeste mand i byen','       D                    G7\r\nFlotte fyre får altid fat i damer\r\n                                 D\r\nSmarte fyre får også altid fat i damer\r\n                               B7\r\nMen når damerne ser mig sir de nej fanden ta\' mig\r\n           E7                A\r\nHan er den grimmeste mand, i byen\r\n\r\nVerse 1\r\n                            D\r\nJeg kører gennem byen i min Jaguar\r\n                                     G7\r\nBruger hundredekroneseddeler når jeg tænder min cigar\r\n         D                                   B7\r\nMen hvad fanden hjælper det, og alt hvad jeg har\r\n               E7        A7     D\r\nNår jeg er den grimmeste mand i byen.\r\n\r\nVerse 2\r\nA\r\nDe fandt mig på en trappe med en seddel på maven\r\nD\r\nHan er virkelig grim han er ikke bare gnaven\r\nA\r\nPas godt på ham fra vuggen og til graven\r\nE7                                    A             A7\r\nOg hvis de syn\'s han er for slem, slå hovedet ned i maven.\r\n\r\nVerse 3\r\nD\r\nPigerne gi\'r mig hverken kys eller kæl\r\nG7\r\nDe vil godt ha\' mine penge, men ikke mig selv\r\n       D                                 B7\r\nJeg er fæl men der bor dog den dejligste sjæl\r\n        E7        A7     D\r\nDet den grimmeste mand i byen.\r\n\r\nVerse 4\r\nA\r\nJeg er så grim at når jeg vil ud og gå\r\nD\r\nså si\'r politiet at jeg ikke må\r\nA\r\nFor alle glor så trafikken går i stå\r\nE7                    A      A7\r\nOg jeg forskrækker de små\r\n\r\nVerse 5\r\nA\r\nJa jeg ser kun i spejlet når lyset det er slukket\r\nD\r\nFolk går og tror at det er en maske jeg har hugget\r\nA\r\nMan kan ikke se det på mig men lad mig gi\' dem et vink\r\nE7                 A     A7\r\nJeg er så helvedes flink\r\n\r\nVerse 6\r\nD\r\nJeg har prøvet med langt hår, jeg har også ladet mig plysse\r\nG7\r\nMen damerne lader til at tro at jeg er bøsse\r\nD                                            B7\r\nDe vil måske det frække, men de vil sgu ikke kysse\r\n  